	(11, '76314216', 'Trilocale via Tommaso Inghirami, Roma', 'https://www.immobiliare.it/annunci/76314216/', 'Rif: D209 - Nel quartiere Colli Albani a pochi metri dall\'omonima fermata Metro vicinissimo al Parco della Caffarella, vendiamo in Via Inghirami appartamento di circa 94mq posto al primo piano con totale esposizione esterna. Il palazzo costruito nel 1965 si presenta in buono stato ed ha la facciata in cortina. L\'androne è ben rifinito con servizio di portineria, ascensore ed elevatore per portatori d\'handicap. L\'appartamento del piano primo si presenta con l\'ampio open space che ingloba l\'ingresso e salone con annessa cucina a vista, con accesso ad un piccolo balcone. Ampio corridoio soppalcato che porta alla zona notte composta da due ampie camere, bagno con doccia. Le finestre sono munite di inferiate in ferro, porta blindata.', '€ 329.000', '€ 339.000', '3 locali', '94 m2', '1 bagni', '1 piano', 'RE/MAX Urbest', '06 9480 3186', 'D209 (2591094)', '17/12/2019', 'REJECTEDprimo piano\nprimo piano', 0, 'REJECTED'),
	(13, '76301074', 'Quadrilocale via Tuscolana 243, Roma', 'https://www.immobiliare.it/annunci/76301074/', 'A pochi passi dalla stazione Tuscolana e dalla fermata della metro A Furio Camillo abbiamo appena messo in vendita un immobile di ampia metratura composto da ingresso, soggiorno, tre comode camere da letto, cucina abitabile, doppi servizi, un funzionale ripostiglio, due balconi e cantina. L\'immobile è dotato di porta blindata, infissi con doppio vetro e caldaia a gas per la produzione di acqua calda. Il riscaldamento è centralizzato con contabilizzatori di calore. La zona è molto ben servita sia per quanto riguarda i trasporti pubblici (la fermata della metropolitana è facilmente raggiungibile a piedi) sia per quanto riguarda le attività commerciali. Uno Studio Professionale sempre al tuo fianco! La Gruppo Capital “Consulenti Immobiliari Associati” nasce come esigenza di riunire eccellenti professionisti del settore immobiliare che insieme, con la formula di studio associato, hanno deciso di mettere a disposizione della propria clientela un servizio sempre più professionale e trasparente nell’ambito delle operazioni immobiliari e finanziarie. Il Nostro Gruppo è formato da Assistenti Associati e Consulenti Immobiliari con una elevata esperienza maturata negli anni nel settore dell’intermediazione immobiliare. Frequentano costantemente corsi di formazione tecnico-professionali e gestione della comunicazione proprio per dare risposte certe e precise alle richieste della clientela. La Gruppo Capital è costantemente orientata a fornire ai propri clienti un servizio di straordinaria qualità con strumenti innovativi, tecnologicamente all’avanguardia ed estremamente scrupolosa nel rispetto delle normative vigenti in ambito immobiliare. I nostri Consulenti non hanno nessuna remora a mettersi in prima linea, raggiungendo così un elevato senso di responsabilità e credibilità che viene sempre di più richiesto dal mercato immobiliare. Nella nostra organizzazione la passione e la dedizione che viene rivolta al lavoro è lo stimolo più grande a fare le cose in grande. Il nostro motto è: "PER NOI LE PERSONE SONO PIU’ IMPORTANTI DEI NUMERI!", ed è per questo motivo che mettiamo al centro delle nostre attività i nostri clienti con le loro esigenze specifiche, proprio per offrire un servizio sempre più attento e personalizzato alla circostanza specifica per ogni operazione immobiliare si voglia intraprendere, in qualsiasi zona di Roma e d’Italia e anche a livello internazionale attraverso i migliori e selezionati referenti con cui abbiamo stretto collaborazioni di partnership. In Gruppo Capital, la competenza, l’etica professionale e la disponibilità sono valori fondamentali ed è per questo motivo che per noi il Cliente è al centro di tutte le nostre attività. "Passione per il nostro lavoro, sicurezza per le tue compravendite"', '€ 349.000', '€ 365.000', '4 locali', '130 m2', '2 bagni', '1 piano', 'Gruppo Capital', '06 7049 2448', '2/113', '17/12/2019', 'REJECTED primo piano \nprimo piano', 0, 'REJECTED'),
	(14, '71455158', 'Quadrilocale via Casilina 95, Roma', 'https://www.immobiliare.it/annunci/71455158/', 'Piazza Lodi, a pochi metri da Porta Maggiore, precisamente nella parte iniziale di via Casilina, zona centrale servita da negozi e ben collegata con i mezzi pubblici e la nuova metropolitana, proponiamo in vendita un immobile di circa 120 mq in stabile con servizio di portineria, composto da ampio ingresso con guardaroba, salone doppio, cucina abitabile, due camere, cameretta/studio, doppi servizi finestrati e terrazzina con armadi da esterno. L\' appartamento si presenta in buono stato con infissi nuovi in legno di ciliegio e pavimenti di marmo "Valentino". Completa la proprietà una cantina di circa 7 mq.', '€ 300.000', '€ 325.000', '4 locali', '120 m2', '2 bagni', '1 piano', 'Dinamica Servizi Immobiliari', '06 8953 3829,320 2155 017', 'Casilina', '15/11/2019', 'REJECTED primo piano \nprimo piano', 0, 'REJECTED'),
	(15, '74815618', 'Trilocale via Don Filippo Rinaldi, Roma', 'https://www.immobiliare.it/annunci/74815618/', 'Nell\'elegante contesto di Villa Lais, precisamente in Via Don Filippo Rinaldi,vicinissimo a Via Tuscolana ed alla fermata Metro Furio Camillo, in signorile stabile in tinta, interessante appartamento posto al piano 1° con ascensore di mq. 87 interni, così composto: ampio ingresso, luminoso soggiorno, due camere matrimoniali, cucina abitabile, bagno, ampio ripostiglio (mq. 5 circa) due balconi di complessivi mq, 9. Le spese di condominio sono pari ad Euro 35,00 poichè il condominio gode della locazione dell\'alloggio portiere, utilizzando il ricavato della locazione per le spese comuni. L\'appartamento si presenta nel suo stato originale; in sede di eventuale ristrutturazione sarà possibile rimodulare lo spazio utilizzando la metratura dell\'ampio ripostiglio, così da creare un secondo bagno oppure un ampliamento della cucina. Un immobile sicuramente interessante nel suo rapporto qualità/prezzo per ubicazione, caratteristiche costruttive, possibilità di rimodulare lo spazio.', '€ 330.000', NULL, '3 locali', '87 m2', '1 bagni', '1 piano', 'PROFESSIONALCASA S.R.L.', '366 2693 409', 'SIGNORILE TRILOCALE VILLA LAIS', '11/12/2019', 'primo piano', 0, 'DELETED'),
	(16, '76187374', 'Quadrilocale via Michele Amari, Roma', 'https://www.immobiliare.it/annunci/76187374/', 'In zona Appio Latino, Via Michele Amari, in stabile d\'epoca del 1950 di 5 piani, I piano di circa 110 mq, piu\' cantina di 6 mq. Soggiorno con angolo cottura, 3 camere, doppi servizi e ripostiglio. Da ristrutturare. I pavimenti sono in marmo. Tripla esposizione con affaccio tranquillo su Via Michele Amari e verso spazi condominiali. Termocontabilizzatori. Spese condominiali € 100,00 mensili. CL G 175.', '€ 335.000', NULL, '4 locali', '110 m2', '2 bagni', '1 piano', 'Aureli Immobiliare', '06 7107 7001', 'TU-419', '05/12/2019', 'primo piano', 0, 'REJECTED'),
	(17, '72977874', 'Trilocale piazza Zama, Roma', 'https://www.immobiliare.it/annunci/72977874/', 'Appio San Giovanni a pochi passi da Piazza Zama e Piazza Re di Roma, quartiere ricco dal punto di vista storico e paesaggistico, ricco di servizi e di collegamenti da e per il centro di Roma, proponiamo in palazzo anni \'40 in ottimo stato conservativo, appartamento finemente ristrutturato, silenzioso e luminoso grazie alla doppia esposizione est/ovest, composto da: ampio ingresso, soggiorno, cucina a vista con finestra, due grandi camere matrimoniali, bagno con antibagno, possibilità secondo bagno, ripostiglio. Pavimentazione tutto in parquet in rovere, infissi in alluminio con vetro camera di primaria qualità. La Basit Servizi Immobiliari S.r.l. vanta un’esperienza dal 1985 nell’attività dell’intermediazione di immobili residenziali e commerciali. Offriamo ai nostri clienti il massimo della professionalità, esperienza, competenza e supporto per tutta la fase del processo fino al raggiungimento dell’obiettivo, con passione e determinazione unite al codice deontologico e ad un nostro codice etico. Da noi si trova il punto d’incontro tra aspettative e realtà grazie al nostro staff di professionisti che studiano servizi su misura per ogni tipo di clientela. Il nostro scopo è la piena soddisfazione del cliente stesso in modo tale da rendere unico ed irripetibile un momento da ricordare. I nostri clienti sono i migliori referenti e garanti della nostra professionalità. La sede attuale é ubicata nel residenziale quartiere di Monteverde; Basit: “ La realizzazione dei tuoi sogni”', '€ 355.000', NULL, '3 locali', '100 m2', '1 bagni', '1 piano', 'BASIT SERVIZI IMMOBILIARI SRL', '06 5815 064,346 9604 336', '755 - (1795052)', '12/12/2019', 'primo piano', 0, 'DELETED'),
	(18, '67833443', 'Trilocale via Monte d\'Onorio, Roma', 'https://www.immobiliare.it/annunci/67833443/', 'Rif: Trilocale rifinito - APPIA NUOVA - In zona Tor Fiscale, nei pressi del Parco dell\'Acquedotto Felice, in contesto riservato, la CLODIACASE vende un trilocale finemente arredato e pregiamente rifinito e curato in ogni dettaglio. Lo stabile è in cortina. L\'immobile si trova al primo piano di una piccola palazzina di 2 piani senza ascensore. Mq. 80 distribuiti in salone a vista con angolo cucina e balcone, disimpegno, due camere da letto, di cui una con balcone, bagno e ripostiglio. Balconi con presenza di tende parasole. Il triplo affaccio ed il distacco dalla strada e dalle palazzine adiacenti lo rendono luminoso e silenzioso. L\'impianto elettrico è a norma con certificazione. Il riscaldamento è centralizzato con le valvole contabilizzatori. Dotato di climatizzatori. Gli infissi nuovi sono in pvc con doppio vetro bianco a vasistas con zanzariere e persiane. La porta è blindata. Gres porcellanato in tutte le stanze. Impianto TV terrestre e satellitare singolo. Adiacente l\'abitazione le linee autobus: 663 che transita nel quartiere, 664 che porta alla metro di Arco di Travertino tramite Via Appia ed il 650 che passa su Via Tuscolana, oltre un servizio di scuola bus che porta in tre diversi istituti scolastici. Per chi ha voglia di immergersi nel verde a circa 200 metri dall\'abitazione si trova il Parco Regionale dell’Appia Antica dove poter passeggiare tra i suggestivi resti storici romani degli antichi Acquedotti.', '€ 245.000', NULL, '3 locali', '81 m2', '1 bagni', '1 piano', 'CLODIACASE servizi immobiliari', '06 9480 5110', 'Trilocale rifinito (2249078)', '26/11/2019', 'primo piano', 0, 'DELETED'),
	(19, '76147084', 'Quadrilocale via Enea, Roma', 'https://www.immobiliare.it/annunci/76147084/', 'Rif: Enea - Appartamento in vendita San Giovanni - Appia Nuova In Via Enea, nelle vicinanze della fermata metro di Furio Camillo e a pochi passi da Villa Lazzaroni, proponiamo la vendita di un immobile posto al primo piano di uno stabile in ottimo stato. L\'appartamento si compone di un ingresso, un salone doppio divisibile, due ampie camere da letto, una cucina abitabile, un servizio, un ripostiglio ed un balcone a cui si accede dal salone. L\'immobile è da ristrutturare ed espone su Via Enea (est) e su un ampio e gradevole cortile condominiale (ovest), affaccio che non ne pregiudica la luminosità. La pavimentazione è in marmo nell\'ingresso e nel corridoio, in ceramica in una camera e nel salone e in parquet nell\'altra camera. Lo stabile è stato oggetto di una recente ristrutturazione sia esterna che interna e si presenta in ottimo stato.', '€ 315.000', NULL, '4 locali', '100 m2', '1 bagni', '1 piano', 'ABITHA - San Giovanni immobiliare S.r.l.', '06 9480 5701', 'Enea (2587866)', '08/10/2019', 'primo piano', 0, 'REJECTED'),
	(20, '76909718', 'Trilocale via Tuscolana, Roma', 'https://www.immobiliare.it/annunci/76909718/', 'Rif: AUSILIATRICE 127 - TUSCOLANA - PORTA FURBA In palazzina in cortina, proponiamo appartamento luminoso, ottimo stato, ingresso, salone, cucina, due camere, bagno, ripostiglio, balcone, ampio terrazzo, cl. energ E Without Limits s.r.l. non è un franchising e opera solo con agenzie “dirette” della proprietà del marchio. È una società specializzata nell\'attività di consulenza professionale, intermediazione immobiliare, rivolta alla compravendita, locazione, valutazione e valorizzazione di immobili e patrimoni immobiliari ad uso terziario, residenziale e aree. La società opera in Italia attraverso le sedi di Roma 1 : Piazza Santa Maria Ausiliatrice Roma 2 : Cinecittà - Appio - Tuscolano Roma 3 : Morena - Ciampino - Anagnina Dispone di una rete capillare di professionisti in grado di coprire tutto il territorio di Roma / GRA / Ciampino Castelli Romani Vasta è quindi l\'offerta di proposte immobiliari, offerte da Without Limits I consulenti immobiliari di Without Limits mettono a disposizione della clientela tutte le competenze per un completo supporto operativo in tutti gli ambiti immobiliari. Il marchio del gruppo immobiliare è rappresentato da tre ovali, simbolo di equilibrio e perfezione, riassumendo appieno la filosofia di chi si muove con professionalità nel proprio settore. Tre ovali, come le tre parti essenziali di un’operazione immobiliare: il venditore, l’acquirente e Without Limits Immobiliare. Chi vende o acquista un immobile con Without Limits è certo di essere assistito con serietà ed efficienza, dal momento della valutazione dell\'immobile fino alla firma del contratto di vendita. I nostri servizi: Per i costruttori: - Assistenza globale per piccole, medie e grandi operazioni immobiliari di nuova costruzione e/o demolizione e ricostruzione a Roma ed in Italia - Ufficio commerciale/ loghi e potente pubblicità per vendita su pianta di nuove costruzioni - Ufficio vendite aperto 7 giorni su 7 con personale altamente specializzato - Consulenza commerciale per frazionamenti e cantieri Per i clienti privati che vendono casa: - Assistenza legale in tutte le fasi della compravendita - Analisi e ricerche di mercato - Merchandising e alta rappresentanza - Vendita retail su Roma e provincia - Forza vendite altamente specializzata - Intermediazione creditizia con i principali istituti di credito - visure ipocatastali - accertamenti urbanistici - potente pubblicità - servizio fotografico altamente professionale', '€ 235.000', '€ 245.000', '3 locali', '90 m2', '1 bagni', '1 piano', 'WITHOUT LIMITS SRL', '06 4555 0105', 'AUSILIATRICE 127 (2603811)', '10/12/2019', 'REJECTED primo piano \nprimo piano', 0, 'REJECTED'),
	(21, '67646185', 'Trilocale via Etruria 44, Roma', 'https://www.immobiliare.it/annunci/67646185/', 'RE DI ROMA e più precisamente in Via Etruria, in zona ottimamente servita da servizi, negozio e infrastrutture, a 150mt c.a. dalla fermata metro "Re di Roma", in complesso con ampi giardini condominiali e servizio di portineria proponiamo in vendita appartamento posto al piano rialzato (primo catastale e di affacci) di c.a. 100 mq composto da corridoio, salone, due camere matrimoniali, cucina abitabile, servizio; L\'appartamento è completamente ristrutturato con rifiniture di pregio, attualmente adibito ad uso ufficio. Parquet, infissi vetro camera/alluminio, grate, climatizzato, impianti a norma certificati. Prezzo richioesto € 369.000,00 tratt. Per info e appuntamenti contattare 3282463415', '€ 369.000', NULL, '3 locali', '100 m2', '1 bagni', '1 piano', 'LA IMMOBILIARE', '347 9448 617', 'RC4444', '17/06/2019', 'primo piano', 0, 'REJECTED'),
	(22, '75081572', 'Trilocale via Sinuessa, Roma', 'https://www.immobiliare.it/annunci/75081572/', 'San Giovanni - Via Sinuessa A pochi passi da Piazza Tuscolo, proponiamo in vendita un appartamento composto da un soggiorno con angolo cottura, due camere da letto una delle quali possiede una cabina armadio ed un bagno. La posizione dell\' immobile consente di usufruire di tutti i servizi della zona tra cui la metro A. L\'appartamento è in fase di realizzazione e verrà consegnato completamente rifinito verso la metà del mese di gennaio 2020. La soluzione è posta al primo piano. E\' prevista tra i comfort l\'installazione di un impianto domotico per tapparelle e scaldasalviette elettrico in bagno , mentre tra i materialil\'utilizzo del gres porcellanato effetto legno colore miele. Le foto interne e la planimetria sono il rendering dell\'immobile finito.', '€ 285.000', NULL, '3 locali', '65 m2', '1 bagni', '1 piano', 'Affiliato Tecnorete: STUDIO IMMOBILIARE MERULANA SRL', '06 6936 6239,392 3432 243', '40203677', '19/12/2019', 'primo piano', 0, 'REJECTED'),
	(23, '75465344', 'Appartamento via Sgurgola 9, Roma', 'https://www.immobiliare.it/annunci/75465344/', 'Appartamento situato in una via privata, composto da tra enormi camere da letto, salone , cucina abitabile , bagno, ripostiglio, zona lavabo, balcone verandato, soppalco e ampio corridoio.', '€ 330.000', NULL, '5 locali', '135 m2', '1 bagni', '1 piano', 'francesco sarago', 'https://media.immobiliare.it/text/tel_75465344_10e0a.jpg?k=bd1024033ad68efb8f2145077f99bf5a', 'EK-75465344', '30/08/2019', 'primo piano', 0, 'REJECTED'),
	(24, '71097012', 'Quadrilocale via Alfredo Baccarini, Roma', 'https://www.immobiliare.it/annunci/71097012/', 'Rif: 235/A - (Appio Latino-Ad via Alfredo Baccarini) Tel 06.86.97.45.20 LUMINOSO ingresso, salone, due camere, cameretta, cucina, due servizi. € 265.000 Rif. 235/A Cl En G kwh 100,8 Tel 06.86.97.45.20 L\'immobile si trova nel quartiere Appio latino, zona ottimamente fornita da servizi commerciali, a pochi passi da Via Appia nuova e dalla metro "A" (stazione Ponte Lungo). L\'appartamento è posto al primo piano in uno stabile signorile degli anni \'40, internamente è da ristrutturare e data la metratura si presta ottimamente per diversi tipi di utilizzo.', '€ 265.000', NULL, '4 locali', '110 m2', '2 bagni', '1 piano', 'Di Porto Immobiliare', '06 4274 2227,06 3545 0059', '235/A (2409458)', '21/11/2019', 'primo piano', 0, 'REJECTED'),
	(25, '76394826', 'Trilocale via Macedonia, Roma', 'https://www.immobiliare.it/annunci/76394826/', 'Rif: T338B - CAFFARELLA, Via Macedonia. In una palazzina signorile ristrutturata sia esternamente che internamente, l\'agenzia SOLO CASA propone in vendita un silenzioso appartamento posto al primo piano. Internamente si compone di un ampio ingresso, salone con balcone, cucina abitabile, corridoio, due camere da letto matrimoniali e doppi servizi finestrati. L\'appartamento necessita di un restauro interno. L\'ampia metratura permette la personalizzazione per ogni esigenza abitativa. L\'immobile si trova a 100 metri dall\'ingresso del Parco della Caffarella ed inoltre il quartiere è ottimamente collegato dal servizio metro “A”, dai mezzi di trasporto su gomma, da infrastrutture quali poste, farmacie, supermercati e dal mercato rionale. Classe Energetica: G Rif.T338B € 269.000 tratt. Siamo a disposizione per fornirVi maggiori informazioni e per fissare un sopralluogo sull\'immobile in oggetto, se è possibile con un minimo di preavviso, al nostro numero telefonico 06.96.03.56.48 oppure al nostro indirizzo email monteverde@solocasaimmobiliare.it. Siamo reperibili dal lunedì al venerdì dalle ore 9.00 alle ore 13.00 e dalle 15.30 alle 19.30, mentre il sabato dalle ore 9.00 alle ore 13.00. Per ulteriori foto e dettagli visitate il nostro sito internet www.solocasaimmobiliare.it.', '€ 269.000', NULL, '3 locali', '100 m2', '2 bagni', '1 piano', 'Solo Casa', '06 9480 4062', 'T338B (2487091)', '12/12/2019', 'primo piano', 0, 'REJECTED'),
	(26, '77324672', 'Trilocale piazza Scipione Ammirato, Roma', 'https://www.immobiliare.it/annunci/77324672/', 'Rif: 272/A - (Appio Latino - Piazza Scipione Ammirato) Tel. 06.86.97.45.20 OTTIME CONDIZIONI , SOFFITTI ALTI, luminoso, silenzioso, ingresso, salone, due camere, cucina abitabile, servizio, ripostiglio. € 299.000,00 Rif. 272/A Cl En G kwh 100,8 Tel 06.86.97.45.20 L\'immobile si trova in zona Appio Latino, adiacente metro "A" (fermata Ponte Lungo) a pochi passi dal parco della Caffarella, posto al primo piano in un palazzetto liberty dei primi novecento, senza ascensore, restaurato di recente quindi in ottime condizioni. L\'appartamento internamente è in ottime condizioni, ristrutturato di recente, nonostante il piano è luminoso e silenzioso. Data la metratura si presta ottimamente per diversi tipi di utilizzi, ottimo anche come uso investimento.', '€ 299.000', '€ 349.000', '3 locali', '90 m2', '1 bagni', '1 piano', 'Di Porto Immobiliare', '06 4274 2227,06 3545 0059', '272/A (2611062)', '29/11/2019', 'REJECTED primo piano \nprimo piano', 0, 'REJECTED'),
	(27, '74171892', 'Trilocale Circonvallazione Appia 100, Roma', 'https://www.immobiliare.it/annunci/74171892/', 'Roma, Appio Latino - Circonvallazione Appia. A pochi passi dalle fermate della metropolitana Ponte Lungo e Furio Camillo e da ogni servizio, la Quadrifoglio Immobiliare di Piazza dei Re di Roma propone appartamento finemente ristrutturato, posto al piano primo sul rialzato (affaccio da secondo piano) e composto da: ampio e luminoso ingresso, soggiorno, cucina abitabile , due camere da letto matrimoniali, servizio e soppalco di mq 8. Il riscaldamento è autonomo con alimentazione a gas e collegato in due ambienti (salone e cucina) con apparecchi di climatizzazione estiva e invernale. L\'immobile, vista la ristrutturazione interna, si presta a chi è alla ricerca di un appartamento da poter vivere immediatamente e a chi cerca un immobile da mettere a reddito velocemente. Nelle Immediate vicinanze si trovano le fermate della metropolitana della linea "A", Ponte Lungo e Furio Camillo. La via Appia Nuova con tutti i suoi servizi si trova a pochi passi.', '€ 369.000', NULL, '3 locali', '90 m2', '1 bagni', '1 piano', 'Quadrifoglio Immobiliare Srl Re Di Roma', '06 9480 7722', 'EK-74171892', '18/12/2019', 'primo piano', 0, 'DELETED'),
	(28, '76493422', 'Trilocale via Appia Nuova 146, Roma', 'https://www.immobiliare.it/annunci/76493422/', 'Ottimo investimento a due passi da Piazza San Giovanni delizioso appartamento posto al piano primo luminoso mq 80 composto da ingresso, soggiorno, cucina semiabitabile ( tavolo per 2 persone), 2 camere matrimoniali, bagno, Completa la proprietà una comoda cantina, il palazzo è dotato di ascensore, All\'interno l\'appartamento si presenta da ristrutturare, porta blindata e infissi di alluminio. La zona è ben servita da mezzi pubblici e dalla vicina metro fermata "Re di Roma", nelle immediate vicinanze troviamo negozi, bar, edicole e scuole.', '€ 310.000', NULL, '3 locali', '80 m2', '1 bagni', '1 piano', 'Casagregory Re', '06 9450 6580', '1694412', '16/10/2019', 'primo piano', 0, 'DELETED'),
	(29, '77190104', 'Trilocale via Mario Menghini, 45, Roma', 'https://www.immobiliare.it/annunci/77190104/', 'Questo trilocale di 70 mq si trova al primo piano di un palazzo dotato di servizio di portierato ed è così composto: salotto con angolo cottura e balcone, una camera da letto doppia, cameretta, bagno e ripostiglio. L\'immobile è in ottimo stato di manutenzione, ha l\'aria condizionata nel salotto e, pur essendo al primo piano, gode di una discreta luce. Il riscaldamento è condominiale. L\'immobile, in Via Mario Menghini, si trova a due minuti a piedi dal Parco della Caffarella e dalla Metro A Colli Albani, inoltre ogni genere di negozi e servizi sono a portata di mano. Costi di condominio: circa 55 € mensili + 50 € di riscaldamento.', '€ 260.000', NULL, '3 locali', '70 m2', '1 bagni', '1 piano', 'Remax Aliante', '06 4577 2771', '37581006-6', '18/12/2019', 'primo piano', 0, 'DELETED'),
	(30, '76825508', 'Trilocale via Appia Nuova, Roma', 'https://www.immobiliare.it/annunci/76825508/', 'SAN GIOVANNI esattamente in via Appia Nuova proponiamo in vendita un appartamento posto al primo piano di una palazzina degli anni 40 con ascensore. L\'appartamento internamente è composto da salone, cucina semiabitabile, 2 camere matrimoniali, bagno. Completa la proprietà una cantina. L\'appartamento NON ha balconi. Il prezzo richiesto è di Euro 310.000 PER ULTERIORI INFORMAZIONI POTETE CONTATTARE I SEGUENTI NUMERI 0645447628 3664278979 anche via WhatsApp o mandando una richiesta alla nostra e-mail frimm_montesacro@yahoo.it Esempio di mutuo, che non costituisce impegno contrattuale: MUTUO 100.000 - DURATA ANNI 30 - TASSO VARIABILE - € 306,04 (mensile) Eventuali preventivi di mutui direttamente c/o i nostri uffici di Roma “Le informazioni riportate non hanno alcun contenuto contrattuale. Le metrature commerciali sono puramente indicative. I dati riguardanti le informazioni commerciali relative alle inserzioni pubblicate provengono direttamente all’agenzia immobiliare dai relativi incarichi di mediazione. La CMimmobiliare declina ogni responsabilità per eventuali indicazioni erronee”.', '€ 310.000', NULL, '3 locali', '80 m2', '1 bagni', '1 piano', 'CM immobiliare', '06 4544 7628,366 4278 979', 'APPIA NUOVA _1694412_APPIA NUOVA', '16/12/2019', 'primo piano', 0, 'REJECTED'),
	(31, '76642142', 'Trilocale viale Furio Camillo, Roma', 'https://www.immobiliare.it/annunci/76642142/', 'FURIO CAMILLO N.2 ABITAZIONI DA RISTRUTTURARE CON RISTRUTTURAZIONE PERSONALIZZATA SAN GIOVANNI, più precisamente in Viale Furio Camillo, proponiamo la vendita di un appartamento completamente al primo piano di un palazzo di otto con ascensore. L\'appartamento di mq 75 si compone di soggiorno, angolo cottura, due camere, bagno e un balcone di mq 5. Riscaldamento centralizzato con contabilizzatori di calore. La zona è servitissima da qualsiasi tipo di attività commerciale, palestre, scuole e raggiungibile in metropolitana grazie alla vicinanza della fermata della metro A Furio Camillo. Si propongono anche altre n°4 abitazioni nello stesso fabbricato con diverse metrature.', '€ 220.000', NULL, '3 locali', '75 m2', '1 bagni', '1 piano', 'RE/MAX Key House', '06 9480 3198', 'T3144', '19/12/2019', 'primo piano', 0, 'REJECTED'),
	(32, '76572468', 'Trilocale via Cerreto Sannita, Roma', 'https://www.immobiliare.it/annunci/76572468/', 'Via Cerreto Sannita : nello storico quartiere di San Giovanni Villa Fiorelli, a pochi passi da Piazza Re di Roma, proponiamo soluzione immobiliare al piano primo, in stabile degli anni 40 di cinque piani con ascensore. L\'immobile si colloca in una via privata, tranquilla e riservata e si compone di sala a vista con cucina e balcone, due camere da letto e due bagni, di cui uno in camera. L\'immobile si presenta completamente ristrutturato, la ristrutturazione ha meno di due anni, dotato di serrande elettriche , laminato nelle camere e gres porcellanato nel bagno, impianti nuovi dotati di certificazioni. Impianto termo autonomo, con caldaia. Luminoso, con esposizione doppia. La vicinanza ad attività commerciali, mezzi di trasporto e scuole rende la proprietà un punto strategico per abitare e/o investire, adatto anche per struttura ricettiva, in un quartiere che collega sia storia che vita quotidiana. A completare la proprietà un posto auto condominiale a rotazione. La metropolitana Re di roma dista soltanto 450 metri a piedi, a 700 metri la stazione tuscolana e 800 metri Piazza Lodi. Contesto gradevole e riservato. Per info o visite contattare Immobiliare Vigne Nuove srls, via della Bufalotta 176, ai numeri 06.86974021 o 366.7864118/116. Vuoi sapere il valore della tua casa, contattaci per una valutazione gratuita. SCARICA LA NOSTRA WEB APP Digita sul tuo browser m. replat. com/43812 Ricerca Immobili e Valutazioni Personal Site. ". ". ". ". ".', '€ 279.000', NULL, '3 locali', '69 m2', '2 bagni', '1 piano', 'IMMOBILIARE VIGNE NUOVE SRLS', '06 9480 7624', '1701500', '10/12/2019', 'primo piano', 0, 'DELETED'),
	(33, '77024526', 'Trilocale via Latina, Roma', 'https://www.immobiliare.it/annunci/77024526/', 'APPIO LATINO - Via Latina, a pochi passi dal Parco della Caffarella, all\'interno di uno stabile signorile, proponiamo la vendita di un trilocale di ca 100 mq, con ampia cucina, servizio e balcone. L\'appartamento si presenta in buone condizioni interne con una doppia esposizione ed offre la possibilità di realizzare un secondo servizio.', '€ 360.000', NULL, '3 locali', '96 m2', '1 bagni', '1 piano', 'Frimm Exclusive', '06 9480 0743', '(2605639)', '19/12/2019', 'primo piano', 0, 'DELETED'),
