	(36, '74730684', 'Trilocale via ETRURIA 37, Roma', 'https://www.immobiliare.it/annunci/74730684/', 'Rif: TRILOCALE SAN GIOVANNI - In palazzo d\'epoca restaurato degli anni 20 proponiamo in vendita appartamento mq 70 composto da ampio ingresso, soggiorno, due camere, cameretta/studio finestrata (attualmente adibita a cabina armadio), cucina e servizio. Doppia esposizione. Ottime condizioni. Euro 295.000,00. Per informazioni o appuntamenti contattare il numero 335/7641032 o inviare un sms con scritto "etruria 295" e sarete ricontattati. Le informazioni dell\'annuncio e le planimetrie sono indicative e non costituiscono elementi contrattuali.', '€ 295.000', NULL, '3 locali', '70 m2', '1 bagni', '1 piano', 'Studio Le B 45 di Barbara Ragno', '335 7641 032', 'TRILOCALE SAN GIOVANNI (2555989)', '16/12/2019', 'primo piano', 0, 'REJECTED'),
	(37, '76484066', 'Trilocale via San Antonio Maria Gianelli, Roma', 'https://www.immobiliare.it/annunci/76484066/', 'Villa Fiorelli – via San Antonio Maria Gianelli, proponiamo in vendita immobile in ottime condizioni interne. La soluzione si compone di : soggiorno a vista, cucina abitabile, due ampie camera da letto e ampio ripostiglio. L’ immobile si presenta luminoso con doppia esposizione. Situata strategicamente nel centro di Villa Fiorelli, ottimamente collegata con mezzi di trasposto che collegano il centro è servita da ogni tipo di servizio commerciale. Classe Energetica G - Indice Prestazione Energetica (IPE): >175 Kwh/m2/anno.', '€ 349.000', NULL, '3 locali', '85 m2', '1 bagni', '1 piano', 'Affiliato Tecnocasa: STUDIO SAN GIOVANNI S.R.L.', '393 9278 224', '40232804', '07/12/2019', 'primo piano', 0, 'REJECTED'),
	(38, '69126392', 'Quadrilocale via di Santa Maria Ausiliatrice 111, Roma', 'https://www.immobiliare.it/annunci/69126392/', 'VIA DI S. MARIA AUSILIATRICE - VIA APPIA NUOVA - P.ZZA CESARE CANTU\'- Adiacente Via Appia Nuova e Piazza Cesare Cantù ed a 500 mq di distanza dalle fermate metro A di Furio Camillo e Colli Albani, proponiamo la vendita di un immobile di 94 mq catastali, finemente e modernamente ristrutturato a fine 2016, posto all\'interno di uno stabile di 7 piani che si presenta in buonissime condizioni. L\'appartamento si compone di un Soggiorno con Angolo Cottura, realizzato con rivestimenti di ceramiche \'ASCOT\' di prima scelta, Camera da letto con Servizio e 2 Camere con affaccio riservato. I Bagni presenti sono due ed anch\'essi sono rivestiti con ceramiche \'ASCOT\' di prima scelta, entrambe le docce hanno il \'pannello doccia\' con faretti a Led, Swarovski, idromassaggio e cromoterapia. La pavimentazione all\'interno dell\'immobile è in Resina Epossidica di colore grigio chiaro (mentre la pavimentazione dei bagni è in gres porcellanato per interni di prima scelta). L\'illuminazione è realizzata completamente a scomparsa con faretti ed indicatori \'LED TOUCH\', nello specifico all\'ingresso l\'accensione è automatica al passaggio grazie ai sensori. Gli infissi sono interamente in PVC con Vetrocamera e tutti con apertura \'vasistas\' mentre le tapparelle sono tutte motorizzate ed elettrocomandate. L\'impianto termico è gestito da condizionatori a pompa di calore caldo/freddo canalizzato \'HISENSE\', ma l\'appartamento è interamente predisposto per renderlo termo-autonomo. Il servizio di acqua calda è fornito tramite scaldino a gas. Il portoncino d\'ingresso è blindato con chiave europea, e le porte interne sono su misura \'MESSERE\' laccate bianche. Gli impianti elettrico, idraulico, telefonico e di trasmissione dati sono stati eseguiti secondo le normative vigenti e tutte correlate della relative certificazioni. Ogni agenzia ha un proprio titolare ed e\' autonoma - Le presenti informazioni non costituiscono elemento contrattuale.', '€ 369.000', NULL, '4 locali', '94 m2', '2 bagni', '1 piano', 'AFFILIATO TECNOCASA: STUDIO SMA UNO SRL', '06 7803 661,06 7825 790', '40055698', '19/12/2019', 'primo piano', 0, 'DELETED'),
	(39, '77452242', 'Trilocale via Appia Nuova 199, Roma', 'https://www.immobiliare.it/annunci/77452242/', 'Piazza dei Re di Roma esattamente in Via Appia Nuova proponiamo la vendita di un appartamento Mq.80 posto al primo piano di uno stabile del 1940 di otto piani dotato di ascensore. Internamente è composto da: ingresso, salone singolo, cucina semi abitabile, due camere matrimoniali, bagno, completa la proprietà una cantina. Si presenta da ristrutturare. Quartiere ben servito, ubicato a poca distanza dalla fermata della Metro linea A “Re di Roma” Ottimo per uso investimento. Rif.1694412 Per informazioni contatta la Omega Service Consulting S.r.l. affiliata Frimm allo 064461826 Visita il nostro sito www.omegacase.it e lascia la tua richiesta.', '€ 310.000', NULL, '3 locali', '80 m2', '1 bagni', '1 piano', 'Omega Service Consulting', '06 9450 2316', '1694412', '21/11/2019', 'primo piano', 0, 'DELETED'),
	(40, '75733254', 'Quadrilocale piazza Lazzaro Papi, Roma', 'https://www.immobiliare.it/annunci/75733254/', 'Appartamento con doppia esposizione angolare e affaccio completamente aperto su piazza, da ristrutturare, cosi composto: ingresso, soggiorno con angolo cottura, due camere da letto matrimoniali e una camera da letto singola, bagno, due balconi e una terrazzetta vivibile. Ubicato in zona molto servita e adiacente parco della Caffarella. Completamente da ristrutturare e\' un appartamento che, avendo solo tre colonne portanti e essendo un grande rettangolo inoltre con molte finestre grandi, si presta a qualsiasi tipo di ridivisione interna con un utile calpestabile di 100mq. La terrazzetta vivibile e\' il valore aggiunto. IN TRATTATIVA!', '€ 375.000', NULL, '4 locali', '120 m2', '1 bagni', '1 piano', 'Taloni Immobiliare di Alfredo Taloni', '06 9450 6586', '2903', '17/12/2019', 'primo piano', 0, 'REJECTED'),
	(41, '73495558', 'Trilocale via delle Cave, Roma', 'https://www.immobiliare.it/annunci/73495558/', 'Appia nuova -Via delle Cave Proponiamo la vendita di un appartamento posto al piano 1°, luminoso e silenzioso, di una palazzina in cortina degli anni 40\', con servizio di portineria tutto il giorno. L\'immobile si presenta da ristrutturare e grazie alle sue numerose tramezzature si presta ad un ampio ventaglio di possibilità abitative possiamo tranquillamente ricavare una zona living con angolo cottura,due camere matrimoniali ,una cameretta e un servizio. Attualmente l\' appartamento e\' così composto da:Un ampio ingresso, cucina abitabile con porta finestra che conduce direttamente al comodo e funzionale terrazzo di 80 MQ ,soggiorno, due camere e un servizio . Una delle caratteristiche principale che rende il nostro immobile unico nel suo genere è la sua vicinanza a tutti i servizi ed attività commerciali che offre la zona;adiacente al Parco Regionale dell\' Appia antica e raggiungere comodamente a soli 300 metri dalla fermata metropolitana della linea A (stazione Colli Albani). € 295.000 Sistemacasa Monteverde www.sistemacasare.it 0686979098', '€ 295.000', NULL, '3 locali', '83 m2', '1 bagni', '1 piano', 'Sistema Casa - Monteverde -', '06 8697 9098', 'T303B', '11/12/2019', 'primo piano', 0, 'REJECTED'),
	(42, '77049274', 'Quadrilocale via Rocca Di Papa, 25, Roma', 'https://www.immobiliare.it/annunci/77049274/', 'Appartamento totalmente ristrutturato recentemente, composto di due stanze con angolo cottura a vista, ingresso e bagno. Completano la proprietà un bel terrazzo rialzato ed un balcone con affaccio sul giardino condominiale. Ottima esposizione, luminoso. Parzialmente arredato. Necessità di rifacimento infissi e vetri e di revisione impianto di riscaldamento autonomo. Palazzina compresa in condominio con posizione centrale soggetto a ristrutturazione recente. Spese di condominio contenute senza riscaldamento centralizzato.', '€ 247.000', NULL, '4 locali', '53 m2', '1 bagni', '1 piano', 'RE/MAX Dolcevita', '06 9480 3150', '30851076-1', '18/12/2019', 'primo piano', 0, 'REJECTED'),
	(43, '76921844', 'Trilocale via Albano, Roma', 'https://www.immobiliare.it/annunci/76921844/', 'Via Albano: proponiamo la vendita di un immobile posto al piano primo LUMINOSO in uno stabile di 4 piani in cortina con ascensore. Internamente la casa si compone di un ingresso, soggiorno, cucina abitabile, due camere, bagno, ripostiglio e balcone perimetrale. Da ristrutturare.', '€ 280.000', NULL, '3 locali', '101 m2', '1 bagni', '1 piano', 'Affiliato Tecnocasa: EMME IMMOBILIARE S.R.L.', '06 7820 445,06 7805 965', '40240062', '19/12/2019', 'primo piano', 0, 'DELETED'),
	(44, '73763084', 'Trilocale via appia, Roma', 'https://www.immobiliare.it/annunci/73763084/', 'Rif: David Moscati - Colli Albani si vende appartamento A/10 (Ufficio) di 75 mq al primo piano di un palazzo di 7 piani su Via Appia Nuova. Il prezzo richiesto per la vendita è di € 280.000. Il contratto di locazione è 6+6, con decorrenza 1 giugno 2002 Il canone di locazione mensile è di € 1.220 e la prossima scadenza contrattuale è il 30 maggio 2020. Per ulteriori info chiamare il numero 3288622591 (David)', '€ 280.000', NULL, '3 locali', '75 m2', '2 bagni', '1 piano', 'Alberto Pagani', '06 6892 515,329 3610 026', 'David Moscati (2527286)', '14/10/2019', 'primo piano', 0, 'REJECTED'),
	(45, '75963954', 'Trilocale via acaia, Roma', 'https://www.immobiliare.it/annunci/75963954/', 'Via Acaia, ad. Via Vetulonia, proponiamo in esclusiva la vendita di un appartamento posto al primo piano all\'interno di una palazzina che si presenta in ottomo stato manutentivo e servita da vano ascensore. L\'immobile si presenta da ristrutturare, composto da ingresso, tre camere, cucina e bagno. Esposizione unica con affacci luminosi. Ottimo anche come investimento. A pochi passi dallo stazionamento autobus di Piazza Zama, in una zona centrale e servita da molte attività commerciali, come bar, supermercati, negozi, palestre e parchi pubblici; da Via Acaia è possibile raggiungere in soli pochi minuti le fermate metro della linea A quali San Giovanni e Re di Roma che collegano la zona alla restante parte della città. Nuova l\'apertura della fermata metro di San Giovanni della Linea C che ha permesso il collegamento delle zone periferiche di Roma con il centro dell\'Urbe. Nei pressi dello storico mercato di Piazza Epiro e da Porta Metronia, una passeggiata di circa venti minuti vi condurrà nel cuore della città eterna dove attraverso Via della Navicella potrete raggiungere il centro città e ammirare tutte le bellezze della Roma antica.', '€ 295.000', '€ 310.000', '3 locali', '95 m2', '1 bagni', '1 piano', 'Affiliato Tecnocasa: STUDIO SAN GIOVANNI METRONIO S.R.L.', '06 9450 2091', '40222206', '15/11/2019', 'REJECTED primo piano \nprimo piano', 0, 'REJECTED'),
	(46, '75946642', 'Trilocale via Amedeo Crivellucci, Roma', 'https://www.immobiliare.it/annunci/75946642/', 'Parco della Caffarella più precisamente in via amedeo crivelucci, proponiamo la vendita di un grazioso trilocale posto al piano primo in uno stabile in tinta recentemente ristrutturato. La superficie interna è così distribuita: soggiorno e cucina open space, due camere e bagno con doccia. La soluzione si presenta completamente ristrutturata con impianti a norma, zanzariere, aria condizionata e porta blindata. Senza balcone. La zona è perfettamente collegata al centro della città grazie alle vicine linee atac e alla metro a e ben servita da ogni genere di attività.', '€ 275.000', '€ 290.000', '3 locali', '69 m2', '1 bagni', '1 piano', 'Affiliato Tecnocasa: EMME IMMOBILIARE S.R.L.', '06 7820 445,06 7805 965', '40221689', '19/11/2019', 'REJECTED primo piano \nprimo piano', 0, 'REJECTED'),
	(47, '74806538', 'Quadrilocale via del Velodromo, Roma', 'https://www.immobiliare.it/annunci/74806538/', 'AGENZIA DIRETTAMENTE INCARICATA ALLA VENDITA DAL PROPRIETARIO- COLLI ALBANI, in zona semi-centrale, adiacente alla metropolitana linea "a" fermata Colli Albani ed Arco di Travertino, precisamente in Via del Velodromo, in contesto signorile e tranquillo proponiamo appartamento quadrilocale da ristrutturare, sito al primo piano in stabile in ottime condizioni, con ascensore. L\'immobile è così composto: ingresso, soggiorno, due camere matrimoniali, una cameretta, cucina abitabile, bagno, ripostiglio ed ampio terrazzo di 32 mq. Ape G. Per info e appuntamenti tel. 0666032385 3500809745. "ElEman srl, agenzia immobiliare fondata nel 2000, per idea dei suoi due titolari, eleuterio dato ed emanuele di biagio. nel tempo, con la passione e l\'impegno, la eleman e\' riuscita a trasmettere competenza e serietà alla propria clientela, grazie anche al supporto valido dei suoi collaboratori, ottenendo notevoli consensi. i punti cardine della eleman: serietà, dinamicità, professionalità e cortesia. nel tempo, per poter dare ai nostri clienti servizi maggiori e velocità, la scelta di far parte di un sistema globalizzato si e\' resa necessaria; infatti, la eleman, aderisce al portale replat di frimm. la frimm è il primo franchising immobiliare ad aver introdotto il concetto di collaborazione nella compravendita tra operatori, oltre a una gamma di servizi e strumenti innovativi di alta qualità. il nostro obiettivo è di offrire, a chi si rivolge a noi, un servizio efficiente".', '€ 269.000', NULL, '4 locali', '95 m2', '1 bagni', '1 piano', 'Eleman srl di Eleuterio ed Emanuele', '06 6603 2385,350 0809 745', 'RV 05', '23/07/2019', 'primo piano', 0, 'DELETED'),
	(48, '73361938', 'Trilocale piazza dei Re di, Roma', 'https://www.immobiliare.it/annunci/73361938/', '***VENDUTO*** Nel cuore di San Giovanni, nella centralissima piazza dei Re di Roma, è nuova sul mercato questo spaziosa e accogliente casa posta al primo piano - di circa 80 mq - con doppio affaccio tranquillo e silenzioso, sia su strada che su cortile interno. La casa si sviluppa con un ingresso e corridoio, la zona living ha un taglio diagonale ed accogliente, con una distinzione tra zona pranzo ( dove è possibile pranzare in 10 persone comodamente) e la zona conversazione, che può ospitare divani angolari o speculari. La cucina è semiabitabile e si affaccia sul balcone interno con gradevoli affacci sul verde. E\' possibile immaginare di creare una zona cottura nell\'ampio salone e ricavare una terza cameretta o studio. Il bagno è completo di vasca ed è in perfette condizioni manutentive. I pavimenti della casa sono in parquet di legno spesso e robusto e possono essere lamati e riverniciati secondo i propri gusti. L\'appartamento, molto amato dai proprietari, è stato ben tenuto nel corso degli anni e può essere abitato senza la necessità di grandi interventi di ristrutturazione, ed è possibile usufruire della cantina condominiale. Il condominio, in tinta ed in ottime condizioni, è sicuro e videosorvegliato. - INFORMAZIONI SULLA ZONA: La casa si trova a soli 2 minuti a piedi dalla fermata della metro A - Re di Roma, la zona è ricca di attività commerciali e supermercati aperti h24, importanti scuole e uffici pubblici. E\' possibile affittare un posto auto al costo di € 140,00 mensili o acquistare un box auto singolo o doppio con detrazioni fiscali. Elisa Rachmaninov - iscritta al registro delle imprese presso la CCIAA di ROMA al n° RM 1479926 - è uno studio immobiliare con sede legale nel cuore dell’appio latino. Nasce nel 2019 da un’idea giovane e dinamica , al passo con i tempi e improntata ad una più moderna concezione consulenziale a 360° gradi. Elisa Rachmaninov non è un’agenzia , ma uno studio immobiliare fatto di persone che amano il proprio lavoro, senza vincoli di zona. Noi siamo professionisti al passo con i tempi che cambiano con l’evolversi del mercato immobiliare Romani e ci prendiamo cura di pochi immobili per volta. Offriamo per tutte i clienti, un team di lavoro di fotografi, video maker, home stager e grafici pubblicitari, che lavorano in sinergia per creare un piano di marketing efficace, mirato a valorizzare tutte le case con classe e ricercatezza e proporle ad un più vasto pubblico, italiano ed internazionale. Elisa Rachmaninov è un gruppo di lavoro appassionato, competente e che offre una negoziazione eticamente corretta e incentrata sulle necessità del proprio cliente, a prescindere che esso sia venditore o acquirente e affianca il proprio cliente passo passo, fino al momento del trasloco.', '€ 330.000', NULL, '3 locali', '80 m2', '1 bagni', '1 piano', 'Elisa Rachmaninov Studio Immobiliare', '06 9480 4414', 'e_08', '07/12/2019', 'primo piano', 0, 'REJECTED'),
	(49, '77132606', 'Quadrilocale via Pistoia, Roma', 'https://www.immobiliare.it/annunci/77132606/', 'La FLAT STUDIO IMMOBILIARE è lieta di proporre in vendita nel centralissimo quartiere San Giovanni/Re Di Roma ed esattamente in Via Pistoia un immobile di 105 mq. comm.li in uno stabile degli anni 30. L\'appartamento si trova al primo piano (catastalmente 2°) , ha una doppia esposizione ed è così composto: ingresso, ampio soggiorno, un corridoio/disimpegno che porta alle tre camere da letto, un bagno con doccia ed una cucina abitabile. Risulta essere silenziosissimo. E\' dotato di riscaldamento autonomo, aria condizionata. Le spese condominiali ammontano ad euro 50 mensili non essendoci il servizio di portineria . La posizione è centralissima e più precisamente si trova a pochi passi da Piazza Ragusa e Villa Fiorelli e si raggiunge la fermata della metropolitana di Piazza Re Di Roma tramite Via Pinerolo in soli dieci minuti a piedi, quindi data la posizione dell\'immobile è ottimamente collegato con numerosi servizi pubblici. Richiesta euro 369.000,00 Per maggiori informazioni contattare tel. fisso 06/86391447 cell.389/0212798 334/3399886', '€ 369.000', NULL, '4 locali', '105 m2', '1 bagni', '1 piano', 'Flat Studio Immobiliare', '06 8639 1447,334 3399 886', 'Via Pistoia', '20/11/2019', 'primo piano', 0, 'REJECTED'),
	(50, '77265846', 'Trilocale via Segesta, Roma', 'https://www.immobiliare.it/annunci/77265846/', 'In palazzina del 1956 in tinta, con servizio di porteriato, di 5 piani, appartamento posto al primo piano di 70 mq circa in ottimo stato di manutenzione composto da soggiorno a vista con cucinotto, due camere matrimoniali, bagno e ripostiglio. Ottima è l\'esposizione, sud e ovest. Completano le qualità dell\'appartamento la vicinanza con il parco della caffarella e a tutti i maggiori servizi. Silenzioso.', '€ 270.000', NULL, '3 locali', '70 m2', '1 bagni', '1 piano', 'VR Servizi Immobiliari', '06 7834 6528,389 1774 681', 'EK-77265846', '19/12/2019', 'primo piano', 0, 'DELETED'),
	(51, '74835986', 'Trilocale via Acqua Donzella, Roma', 'https://www.immobiliare.it/annunci/74835986/', 'Colli Albani e precisamente in Via Acqua Donzella proponiamo in vendita trilocale da ristrutturare di circa 100 metri quadri in una palazzina in cortina con servizio di portierato e ascensore posto al piano primo e composto da ampio ingresso, soggiorno, cucina abitabile, ampia camera matrimoniale, cameretta, bagno, ripostiglio e balcone. Il riscaldamento è centralizzo e le spese condominiali sono di euro 70 mensili. Esposizione ovest. Sono già stati deliberati i lavori per il rifacimento della palazzina a carico del proprietario. Adiacente al Parco della Caffarella, alla metro Colli Albani e a tutti i servizi principali. Facilità di parcheggio.', '€ 290.000', NULL, '3 locali', '102 m2', '1 bagni', '1 piano', 'PP IMMOBILIARE', '06 9450 2352', 'EK-74835986', '09/08/2019', 'primo piano', 0, 'REJECTED'),
	(52, '76492952', 'Trilocale via Mestre 16, Roma', 'https://www.immobiliare.it/annunci/76492952/', 'SAN GIOVANNI - VIA MESTRE Nelle immediate vicinanze della Stazione Tuscolana e a pochi passi dalla fermata della Metro A “Ponte Lungo”, in zona servitissima grazie alle numerose attività commerciali, proponiamo in vendita un trilocale posto ad un primo piano di uno stabile in tinta di otto. L’immobile, completamente ristrutturato, si compone di soggiorno, cucina, due camere, bagno, ripostiglio e balcone. L’immobile si vende completo di mobilio nuovo. Immobile gestito da: QUALITY IMMOBILIARE SRL 06.59601544 www.qualityimmobiliare.it – eurmontagnola@qualityimmobiliare.it SERVIZI PER IL CLIENTE: • valutazione immobiliare scritta gratuita • vendita e/o locazioni di appartamenti, uffici, locali commerciali, box • preparazione e stesura di contratti di locazione (liberi e/o transitori) • preparazione e stesura di contratti preliminari di compravendita • pubblicità capillare e mirata sui principali siti e rivista Quality • A.P.E. (attestato di prestazione energetica) • clientela/investitori selezionata • assistenza e consulenza in sede da parte di professionisti del settore (Notaio, Avvocato, Architetto)', '€ 330.000', NULL, '3 locali', '86 m2', '1 bagni', '1 piano', 'Quality Immobiliare', '06 5960 1544,393 8721 654', '16 m', '19/12/2019', 'primo piano', 0, 'DELETED'),
	(53, '72613700', 'Trilocale da ristrutturare, primo piano, Roma', 'https://www.immobiliare.it/annunci/72613700/', 'Via Appia Nuova ad.ze Via Menghini vicino metro Colli Albani appartamento di ampia metratura posto al 1° piano e composto da ingresso 3 ampie camere cucina abitabile bagno doppia esposizione da ristrutturare Euro 249.000,00 Via Appia Nuova ad.ze Via Menghini vicino metro Colli Albani appartamento di ampia metratura posto al 1° piano e composto da ingresso 3 ampie camere cucina abitabile bagno doppia esposizione da ristrutturare Euro 249.000,00.', '€ 249.000', NULL, '3 locali', '100 m2', '1 bagni', '1 piano', 'media immobil srl', '393 9621 622,06 7885 1202', 'appia1', '05/12/2019', 'primo piano', 0, 'REJECTED'),
	(54, '76125828', 'Trilocale via Poggi d\'Oro, Roma', 'https://www.immobiliare.it/annunci/76125828/', 'Appia Colli Albani: zona ricca di servizi, ottimamente collegata, fermata di metro A Colli Albani raggiungibile in pochi minuti a piedi. Precisamente in via Poggi D\'Oro, proponiamo un ampio appartamento trilocale di 100 mq ca. posto al primo piano in palazzina di 6 piani con ascensore. L\'immobile è così composto: un ampio ingresso, soggiorno, due ampie camere da letto di 20 mq ca. , cucina abitabile, antibagno e bagno, un balcone, corte esterna mattonata di 25 mq. Doppia esposizione. Impianto di riscaldamento centralizzato con contabilizzatori.', '€ 330.000', NULL, '3 locali', '100 m2', '1 bagni', '1 piano', 'APPIA IMMOBILIARE', '06 9480 9080', 'POGGID', '11/10/2019', 'primo piano', 0, 'REJECTED'),
	(55, '76366420', 'Trilocale via Appia Nuova 197, Roma', 'https://www.immobiliare.it/annunci/76366420/', 'San giovanni via appia nuova vicino re di roma 1piano su via appia mq 80 interni ampio ingresso, soggiorno, cucina abitabile, ampio corridoio camera matrimoniale, camera matrimoniale , bagnovasca , cantina 9mq, esposizione a sud luminoso, vicino 50 mt metro re di roma.', '€ 305.000', NULL, '3 locali', '80 m2', '1 bagni', '1 piano', 'Francesco Montebovi D.I.', '06 5654 6364,392 5000 392', 'EK-76366420', '15/11/2019', 'primo piano', 0, 'DELETED'),
	(56, '77342512', 'Trilocale ottimo stato, primo piano, Roma', 'https://www.immobiliare.it/annunci/77342512/', 'Via Luigi Cibrario, adiacente Baronio e la Via Latina, proponiamo in vendita un appartamento sito al 1°piano sopra il rialzato, cosi composto: Ingresso con soggiorno a vista ed angolo cottura, camera matrimoniale, cameretta, bagno, ripostiglio, balcone. La casa è luminosa, espone tutta a Sud/Ovest, interamente ristrutturata qualche anno fa con pavimenti in parquet, climatizzatori, infissi in alluminio con doppio vetro ed il riscaldamento autonomo.', '€ 260.000', '€ 280.000', '3 locali', '66 m2', '1 bagni', '1 piano', 'Affiliato Tecnocasa: STUDIO APPIO LATINO S.R.L.', '06 7835 9093,393 9214 042', '40247422', '03/12/2019', 'REJECTED primo piano \nprimo piano', 0, 'REJECTED'),
	(57, '69528934', 'Trilocale largo Orazi e Curiazi, Roma', 'https://www.immobiliare.it/annunci/69528934/', 'Appia -TUSCOLANA SANTA MARIA AUSILIATRICE e precisamente in Largo Orazi e Curiazi in palazzo signorile proponiamo appartamento di circa 90 mq. posto al primo piano con ascensore composto da Ingresso Soggiorno 2 Ampie Camere da Letto Cucina abitabile 12 mq. e Bagno. Buono stato affaccio libero sulla piazza. Luminoso.Attualmente a reddito , euro 1200 mensili., ottimo immobile anche come b e b, affitta camere , ottima posizione e due passi dalla metro A e dalle fermate bus.', '€ 275.000', '€ 295.000', '3 locali', '90 m2', '1 bagni', '1 piano', 'ROMA REAL ESTATE srls', '06 9450 0140', '915A', '25/09/2019', 'REJECTED primo piano \nprimo piano', 0, 'REJECTED'),
	(58, '75505192', 'Trilocale piazza Camillo Re, Roma', 'https://www.immobiliare.it/annunci/75505192/', 'Roma - Piazza Re di Roma - Proponiamo all\'interno di palazzo ristrutturato internamente e con lavori già deliberati per il rifacimento della facciata di Appartamento di mq. 75 c.a posto al piano primo e cosi composto: Cucina abitabile, 2 camere matrimoniali, cabina armadio, bagno con vasca. L\'immobile è dotato di aria condizionata, grate in ferro, porta blindata. Prezzo di vendita richiesto € 305.000 Proposto da Immobiliare Fagnani 06/96142506', '€ 305.000', NULL, '3 locali', '75 m2', '1 bagni', '1 piano', 'Fagnani', '06 9450 6730', '360/D', '07/09/2019', 'primo piano', 0, 'REJECTED'),
	(59, '67330849', 'Quadrilocale buono stato, primo piano, Roma', 'https://www.immobiliare.it/annunci/67330849/', 'San Giovanni - Villa Fiorelli, all\'interno di uno stabile signorile , proponiamo la vendita di un appartamento di 108 mq, composto da ingresso, soggiorno, tre camere. cucina e bagno. L\'immobile è in buono stato e l\'affaccio silenzioso', '€ 369.000', NULL, '4 locali', '108 m2', '1 bagni', '1 piano', 'Professionecasa Roma SRL', '06 7726 831,345 4337 918', '10/18', '02/08/2019', 'primo piano', 0, 'DELETED'),
	(60, '77157606', 'Quadrilocale primo piano, Roma', 'https://www.immobiliare.it/annunci/77157606/', 'Colli Albani appartamento su strada principale ben servita da negozi, banche, scuole e prossimo alla fermata della metropolitana, composto da ampio ingresso sfruttabile, camera da letto di circa di 18 mq., altra camera da letto da 12 mq., ripostiglio/camera abitabile con finestra su altra stanza, salotto/pranzo, cucina abitabile, bagno, terrazzo di circa 40 mq, su cui affacciano camera da letto, cucina e soggiorno.', '€ 350.000', NULL, '4 locali', '106 m2', '1 bagni', '1 piano', 'CERENOVA INTERNATIONAL HOLIDAYS', '06 9905 607', 'RM/350', '11/11/2019', 'primo piano', 0, 'REJECTED'),
	(61, '74578550', 'Quadrilocale via Tuscolana, Roma', 'https://www.immobiliare.it/annunci/74578550/', 'Furio Camillo, Via Tuscolana, in stabile in tinta con ascensore proponiamo la vendita di un appartamento di 125 mq catastali sito al piano primo e composto da ingresso, salone, tre camere da letto, cucina, doppi servizi, ripostiglio soppalco, tre balconi. Completa la proprietà la cantina. Ristrutturato, riscaldamento autonomo, climatizzato, climatizzato. Buona luminosità, doppia esposizione. Ottima ubicazione a due passi dalla metropolitana Furio Camillo e dalla Stazione Tuscolana Le presenti informazioni e planimetrie sono meramente indicative e non costituiscono elementi contrattuali.', '€ 370.000', NULL, '4 locali', '125 m2', '2 bagni', '1 piano', 'Studio Immobiliare Ulmo', '06 9480 9086', '(2375111)', '04/10/2019', 'primo piano', 0, 'REJECTED'),
	(62, '77038572', 'Appartamento via Tuscolana 946, Roma', 'https://www.immobiliare.it/annunci/77038572/', 'In zona super servita si vende appartamento di grande metratura, in stabile curato ed ottimamente collegato, che si trova sulla via Tuscolana, a dieci passi dall\'accesso della METRO A (Numidio Quadrato) e direttamente connesso al GRA. L\'abitazione si trova al primo piano e vanta triplice esposizione su prospetti laterali e corte interna, il che la rende silenziosa e luminosa. Nella configurazione attuale, la casa prevede una comoda cucina chiusa, una stanza dedicata al tavolo da pranzo, il soggiorno, tre camere da letto, un bagno confortevole, un balcone ed un ampio terrazzo coperto, oltreché ingresso e spazi di disimpegno di dimensioni generose; Bagno e cucina sono recentissimi. L\'offerta si completa con l\'opportunità di disporre di garage, a pagamento/abbonamento, nell\'interrato del palazzo; Circostanza che rende l\'unità immobiliare appetibile anche per uffici e studi professionali. No agenzie, no affaristi, no perditempo, grazie.', '€ 380.000', NULL, '5 locali', '157 m2', '1 bagni', '1 piano', '', '', 'EK-77038572', '06/11/2019', 'primo piano', 0, 'REJECTED'),
	(63, '73096426', 'Trilocale via Segesta, Roma', 'https://www.immobiliare.it/annunci/73096426/', 'Appartamento in zona silenziosa vicino al parco della caffarella, poco distante da metro Ponte Lungo. Solo quattro piani, pochi condomini.', '€ 259.000', NULL, '3 locali', '85 m2', '1 bagni', '1 piano', 'DANIELA CELESTINI CAMPANARI', 'https://media.immobiliare.it/text/tel_73096426_b5a99.jpg?k=753e9499381788d8ab2a7d9992d51c14', 'EK-73096426', '22/10/2019', 'primo piano', 0, 'DELETED'),
	(64, '77203456', 'Trilocale piazza Scipione Ammirato, Roma', 'https://www.immobiliare.it/annunci/77203456/', 'Rif: R23 - Appio Latino Piazza Scipione Ammirato proponiamo in vendita grazioso appartamento completamente ristrutturato sito al terzo piano di una palazzina degli anni \'50 di 5 piani con ascensore. Composto da soggiorno con cucina a vista, camera, cameretta, bagno, ripostiglio e balcone. La zona è ricca di ogni genere di servizi commerciali, scuole, vicina al parco della Caffarella; è ben collegato con i mezzi pubblici, a pochi metri dalla fermata metro A Furio Camillo.', '€ 250.000', NULL, '3 locali', '45 m2', '1 bagni', '3 piano', 'RE/MAX Urbest', '06 9480 3186', 'R23 (2609457)', '17/12/2019', '45m2 - cucina in salone', 0, 'DELETED'),
	(65, '71283472', 'Trilocale via Orazio Coclite, Roma', 'https://www.immobiliare.it/annunci/71283472/', 'Proponiamo appartamento in Ottime Condizioni Interne posto ad un quinto piano su sei piani composto da:ingresso con ripostiglio,soggiorno living,due camere da letto,bagno.L\'appartamento ha una doppia esposizione su strada e su cortile interno.Gli infissi interni ed esterni sono nuovi e la pavimentazione è conforme.Il palazzo si presenta in buono stato e anche le spese di gestione sono di bassa entita\'. A pochi passi dalla fermata della Metro Furio Camillo e da tutti i mezzi pubblici si trova vicino a tutte le attivita\' commerciali di zona e al Nuovissimo Centro Commerciale Happio.', '€ 330.000', NULL, '3 locali', '75 m2', '1 bagni', '5 piano', 'STIMACASA ,Media Immobili S.r.l con Socio Unico', '06 7835 9402,320 1744 183', 'Co350', '05/03/2019', 'cucina in salone', 0, 'DELETED'),
	(66, '75085568', 'Trilocale via Antonio degli Effetti 19, Roma', 'https://www.immobiliare.it/annunci/75085568/', 'APPIO LATINO Via Antonio degli Effetti, in posizione eccellente, adiacente Metro Furio Camillo, a 600 metri da Villa Lazzaroni e Centro Commerciale Happio, la società House Dream propone la vendita di un trilocale posto ad un piano alto con doppia esposizione solare. Entrando nell\'immobile ci si trova nel soggiorno della casa con cucina a vista, proseguendo si arriva alla camera matrimoniale, disimpegno zona notte, seconda camera da letto ed infine servizio finestrato. L\'immobile presenta rifiniture quali infissi in alluminio doppio vetro, portoncino blindato e climatizzatori. POSSIBILE PERMUTA Rif. 95/19 Richiesta € 259.000,00 La nostra sede di Viale Giulio Agricola 23/31 (Metro Giulio Agricola) cura le transazioni immobiliari che avvengono su tutto il territorio romano L’ottima conoscenza del mercato immobiliare dei nostri agenti , uniti all’ elevatissima visibilità su tutti i portali immobiliari e riviste del settore di tutti gli immobili gestiti dalla House Dream ne fanno il punto di riferimento per chi desidera vendere, acquistare o locare un immobile. Siamo in grado di gestire e risolvere qualsiasi problematica di natura tecnico, urbanistico e catastale del vostro immobile. Potete contattarci tutti i giorni compreso il sabato ai numeri 06.71587043 Fax 0671544351 una e-mail all’indirizzo info@housedream.it o visitate il nostro sito www.housedream.it', '€ 259.000', NULL, '3 locali', '72 m2', '1 bagni', '6 piano', 'HOUSE DREAM', '06 7158 7043,328 1707 485', '95/19', '09/08/2019', 'cucina in salone', 0, 'REJECTED'),
	(67, '76696394', 'Trilocale ottimo stato, secondo piano, Roma', 'https://www.immobiliare.it/annunci/76696394/', 'Via del Pastore Faustolo - In strada privata, tranquilla e silenziosa, proponiamo in vendita una luminosa soluzione di 65 mq interamente ristrutturata, sita al primo piano di una piccola palazzina in tinta, di soli tre piani munita di terrazzo condominiale. L’immobile si trova in un contesto ottimale, infatti pur essendo collocato in una strada privata e silenziosa, è al tempo stesso in una posizione strategica rispetto ai servizi e ai mezzi di trasporto: la ferma della linea A – Furio Camillo – dista solo 250 mt; in 5 minuti è possibile raggiungere anche la stazione Tuscolana che collega la zona con gli aeroporti e le altre stazioni centrali della Capitale. L’immobile al suo interno è cosi composto: l’ingresso si apre direttamente nella zona giorno con angolo cottura, dotata anche di un pratico soppalco; da qui si accede ad un piccolo disimpegno che conduce alle due camere da letto matrimoniali, in cui le eleganti cornici in legno che rivestono le pareti la fanno da padrona, entrambe con accesso ad un bagno privato dotato di box doccia e rivestito da piastrelle rettangolari con raffinati inserti in mosaico. Entrambe le camere sono dotate anche di prese con accesso alla linea telefonica ed internet. La ristrutturazione è stata pensata con una particolare attenzione al lato estetico, senza tralasciare la funzionalità: in tutti gli ambienti è presente un impianto di climatizzazione, di cui si può fare uso sia nella stagione estiva che invernale. L’immobile gode di una doppia esposizione parallela, che lo rende particolarmente arieggiato, mentre l’affaccio nel cortile interno garantisce la massima tranquillità. E’ dotato, inoltre, di caldaia a condensazione utile sia alla produzione di acqua calda sanitaria che all’impianto di riscaldamento autonomo. Completa la proprietà una cantina di pertinenza sita al piano seminterrato dello stabile. La posizione centrale, unita alle rifiniture di pregio utilizzate nella ristrutturazione e alla presenza dei due bagni di uso esclusivo di ciascuna camera, rendono la soluzione abitativa adatta anche ad un uso ricettivo (casa vacanza, B&b, affitta camere, ecc.) o ad uso investimento. Per informazioni e appuntamenti contattare lo 06.78.53.207 oppure 377.02.21.574.', '€ 330.000', NULL, '3 locali', '65 m2', '2 bagni', '2 piano', 'Affiliato Tecnorete: MEDIAZIONI IMMOBILIARI APPIO ALBERONE SRLS', '06 7853 207,377 0221 574', '40236170', '19/12/2019', 'cucina in salone', 0, 'REJECTED'),
	(68, '75779420', 'Trilocale via Tuscolana 465, Roma', 'https://www.immobiliare.it/annunci/75779420/', 'Arco di Travertino - Via Tuscolana, proponiamo la vendita di un appartamento trilocale, in buono stato, di circa 75 mq composto da : soggiorno con cucina a vista, due camere, una cameretta, servizio e balcone', '€ 255.000', NULL, '3 locali', '75 m2', '1 bagni', '3 piano', 'Professionecasa Roma SRL', '06 7726 831,345 4337 918', 'F.23/19', '25/11/2019', 'cucina in salone', 0, 'REJECTED'),
	(69, '74157014', 'Trilocale via Albano, Roma', 'https://www.immobiliare.it/annunci/74157014/', 'Rif: 257/A - (Colli Albani - Via Albano) Tel 06.86.97.45.20 QUINTO PIANO con 2 BALCONI, in contesto signorile, COMPLETAMENTE RISTRUTTURATO, ingresso, salone con cucina a vista, due ampie camere e servizio. € 335.000,00 Rif. 257/A Cl En G kwh 100,8 Tel 06.86.97.45.20 L\'immobile si trova in zona Colli Albani più precisamente in Via Albano, pochi passi dalla metro "A" (stazione Colli Albani) e da tutti i servizi pubblici e commerciali del quartiere. L\'appartamento è posto al penultimo piano in uno stabile signorile in ottime condizioni, internamente è stato completamente ristrutturato, gode di una doppia esposizione, che lo rendono luminoso e silenzioso eh ha come sfogo due comodi balconi, Data la metratura e la zona si presta ottimamente per diversi tipi di utilizzo, Ottimo anche come uso investimento.', '€ 335.000', NULL, '3 locali', '80 m2', '1 bagni', '5 piano', 'Di Porto Immobiliare', '06 4274 2227,06 3545 0059', '257/A (2540951)', '03/09/2019', 'cucina in salone', 0, 'REJECTED'),
	(70, '74825908', 'Trilocale Circonvallazione Appia, Roma', 'https://www.immobiliare.it/annunci/74825908/', 'Nelle immediate vicinanze della metro Ponte lungo, e a ridosso di tutti i principali servizi commerciali, precisamente in Circonvallazione Appia, proponiamo in vendita un grazioso trilocale posto al quarto piano di uno stabile di nove. Entrando troviamo un salone con cucina a vista, attraverso un piccolo disimpegno soppalcato passiamo alla zona notte composta da un’ampia camera da letto, una cameretta ed un bagno. L’appartamento gode di una doppia esposizione ed è rifinito con pavimentazione in parquet nella zona living e nelle camere, grès porcellanato nel bagno, le finestre sono in alluminio con doppi vetri e le persiane in alluminio, porta blindata e impianto di riscaldamento centralizzato con contabilizzatori.', '€ 285.000', NULL, '3 locali', '77 m2', '1 bagni', '4 piano', 'LA CASA agency - ROMA CIPRO - MARZULLI MARCO', '06 3903 1073', 'EK-74825908', '11/12/2019', 'cucina in salone', 0, 'DELETED'),
	(71, '76834966', 'Trilocale via Verbania 4, Roma', 'https://www.immobiliare.it/annunci/76834966/', 'Privato vende appartamento in Via Verbania al 6° piano di 9 con ascensore. La proprietà è così composta: Soggiorno con cucina a vista e accesso al balcone, 2 camere, piccolo corridoio soppalcato (accesso dal bagno), bagno. Infissi con doppi vetri, porta blindata, parquet in tutti gli ambienti ad esclusione di bagno e cucina, termo autonomo. Spese condominiali 70€ a bimestre. L’appartamento risulta arioso dato il piano alto, la doppia esposizione(affaccio su Via Verbania per tutte le camere, affaccio su chiostrina interna per bagno e cucina) e la totale assenza di costruzioni di fronte che consente di godere di una ampia vista panoramica. La posizione è strategica, la zona è ricca di servizi quali supermercati, negozi e strade commerciali(Via Appia e Via Tuscolana). E’ possibile raggiungere a piedi i maggiori luoghi di interesse turistico (Colosseo a soli 30 minuti). Per via della vicinanza alle stazioni della metro e fermate bus che collegano al centro di Roma e altre principali Stazioni di scambio è possibile raggiungere qualsiasi zona di Roma in poco tempo prendendo un unico mezzo. Distanze a piedi dai principali mezzi pubblici Stazione Tuscolana (connessione per Stazione Tiburtina, Stazione Ostiense, Aeroporto Fiumicino) 220 m Metro A Ponte Lungo 400 m Bus 85 - Piazza Venezia/Centro Storico 200 m Metro C Lodi - 1 Km - APPARTAMENTO LIBERO AL ROGITO - ASTENERSI AGENZIE IMMOBILIARI', '€ 259.000', '€ 270.000', '3 locali', '60 m2', '1 bagni', '6 piano', '', '', 'EK-76834966', '02/12/2019', 'REJECTEDfuori zona prescelta\ncucina in salone', 0, 'DELETED'),
	(72, '64341946', 'Trilocale ottimo stato, secondo piano, Roma', 'https://www.immobiliare.it/annunci/64341946/', 'Rif: V2138 - Via Latina, adiacente al parco della Caffarella, in zona servita dai principali servizi quali scuole, supermercati, circoscrizione, cinema e attività commerciali, proponiamo in vendita un appartamento bilocale, situato in una piccola palazzina di soli 3 piani. L\'appartamento è stato recentemente ristrutturato ed è composto da soggiorno con angolo cottura, 2 camere matrimoniali e il bagno. Per info: 3454378090', '€ 285.000', NULL, '3 locali', '58 m2', '1 bagni', '2 piano', 'Immobiliare Universitaria', '06 6480 3183', 'V2138 (2112601)', '02/12/2019', 'cucina in salone', 0, 'REJECTED'),
	(73, '73452904', 'Villa bifamiliare via Casilina, Roma', 'https://www.immobiliare.it/annunci/73452904/', 'Rif: Via Casilina - Roma (FS) In Via Casilina, a 3 km capolinea Metro C Pantano Borghese, proponiamo in vendita ville di nuova costruzione. Le ville di 180 mq sono disposte su tre livelli e hanno la possibilità di essere personalizzate a seconda delle esigenze del Cliente. Giardino di circa 300 mq e diversi posti auto. Vista panoramica su tutta Roma. Le spese di riscaldamento sono indicative. Per maggiori informazioni contattare il seguente numero: 334.50.24.522', '€ 255.000', NULL, '5 locali', '210 m2', '3 bagni', NULL, 'Studio Legale Immobiliare', '06 9480 3678', 'EK-73452904', '07/05/2019', 'immobile lontano - metro C pantano', 0, 'REJECTED'),
	(74, '73567740', 'Villa plurifamiliare via Casilina, Roma', 'https://www.immobiliare.it/annunci/73567740/', 'VIA CASILINA (FS) In Via Casilina, a 10 minuti dal Capolinea metro C Pantano Borghese, proponiamo in vendita una villa di 280 mq, suddivisa in due appartamenti da 140 mq. Giardino di 1300 mq. Le spese di riscaldamento sono indicative. Per maggiori informazioni rivolgersi al seguente numero: 334.50.24.522', '€ 280.000', NULL, '5+ locali', '280 m2', '3 bagni', NULL, 'Studio Legale Immobiliare', '06 9480 3678', 'EK-73567740', '13/05/2019', 'immobile lontano - metro C pantano', 0, 'REJECTED'),
	(75, '74406166', 'Trilocale via Colle Terrigno, Roma', 'https://www.immobiliare.it/annunci/74406166/', 'VIA COLLE TERRIGNO - Se state cercando una soluzione inserita in un contesto verdeggiante, adiacente ai principali servizi e a pochi km dal centro, siamo lieti di proporvi un complesso residenziale di prossima costruzione tra il circolo del golf Acquasanta ed il parco di Tor Fiscale. L\'iniziativa prevede varie tipologie di appartamenti Trilocali e Quadrilocali con terrazzi e giardini; ogni soluzione avrà la possibilità di acquistare la pertinenza del box o della cantina . FARE Immobiliare vi seguirà in tutte le fasi della compravendita garantendovi assistenza tecnico legale dalla prenotazione all\'atto definitivo di compravendita. Valutiamo eventuali Permute con il vostro Immobile. Appartamenti a partire da € 240.000 Per VEDERE I PROGETTI e avere maggiori informazioni FA. RE immobiliare Viale Giulio Agricola 118 Roma Tel. 067477643.', '€ 260.000', NULL, '3 locali', '81 m2', '2 bagni', '1 piano', 'FARE SRL', '06 9450 2100', '002', '11/12/2019', 'prossima costruzione', 0, 'REJECTED'),
