	(78, '75705174', 'Trilocale via degli Orti Variani, Roma', 'https://www.immobiliare.it/annunci/75705174/', 'Via degli Orti Variani nei pressi di piazza Lodi (Pigneto) metro linea C e nelle vicinanze di porta Maggiore proponiamo in vendita all\'interno di complesso residenziale munito di sbarra con telecomando per auto un appartamento completamente ristrutturato al 2° piano di mq. 70 con balcone e cantina di 6 mq. Attualmente l\'immobile è composto di soggiorno camera cameretta cucina abitabile con uscita sul balcone di 5 mq bagno e completa la proprietà una cantina posta al seminterrato della palazzina di 6 mq. Ottimo uso investimento per locazione studenti in quanto vicino università La Sapienza. l\' immobile è dotato di porta blindata, marmo graniglia alla veneziana a terra, impianti a norma infissi in alluminio bianco doppio vetro con inferriate, porte laminate due climatizzatori e termovalvole contabilizzatore caldaia condominiale con predisposizione per l\' autonomo. Posto auto scoperto condominiale non assegnato.', '€ 239.000', NULL, '3 locali', '70 m2', NULL, '2 piano', 'Punto Immobiliare Esquilino SRLS', '06 8767 7265,392 2600 950', '13/19', '08/11/2019', 'zona sopraelevata tang.est', 0, 'DELETED'),
	(79, '77510868', 'Trilocale via degli Orti Variani 35, Roma', 'https://www.immobiliare.it/annunci/77510868/', 'Roma, San Giovanni - a pochi passi da Villa Fiorelli e precisamente in Via degli Orti Variani la Quadrifoglio Immobiliare di Piazza dei Re di Roma propone un luminoso appartamento posto al piano quinto e composto da: ampio ingresso, soggiorno, due camere da letto matrimoniali, cucina abitabile, servizio e balcone. L\'immobile al suo interno si presenta da ristrutturare e questo permette di poter ridistribuire gli spazi interni. Vista la vicinanza a Porta Maggiore, alla stazione Tuscolana e alla fermata della metropolitana linea C (Piazza Lodi) l\'appartamento è adatto sia a chi è alla ricerca di un immobile da adibire come abitazione principale e sia a chi invece intende acquistare un immobile come forma di investimento. Nella immediate vicinanze si possono trovare scuole di ogni grado e tutti i principali servizi.', '€ 195.000', NULL, '3 locali', '70 m2', '1 bagni', '5 piano', 'Quadrifoglio Immobiliare Srl Re Di Roma', '06 9480 7722', 'EK-77510868', '18/12/2019', 'zona sopraelevata tang.est', 0, 'REJECTED'),
	(80, '75346258', 'Trilocale via Appia Nuova 243, Roma', 'https://www.immobiliare.it/annunci/75346258/', 'Roma (RM) zona Appio latino, appartamento al piano secondo, composto da cinque vani catastali con bagno. Offerta minima 240.000 euro data di vendita 04/12/2019. Acquisto tramite asta giudiziaria assistita dallo studio Aste Immobiliari Florio. La Società di consulenza fornisce assistenza legale per tutto l’iter procedurale: • Ricerca immobile in base alle esigenze del cliente • Studio di fattibilità del mutuo mediante primari istituti bancari convenzionati. • Esame della perizia • Visita dell’immobile In caso di mancata aggiudicazione nulla sarà dovuto. Per fissare una consulenza gratuita e non vincolante è possibile chiamare i numeri 328 8271502 / 06.5130271 oppure inviare una mail a studio.astegiudiziarie.florio@gmail.com . L’esattezza dei dati pubblicati sarà confermata in sede di consulenza. Ulteriori foto e planimetrie relative all’immobile saranno consultabili previo vostro contatto. Aste Immobiliari Florio ROMA 00162 – Via Ridolfino Venuti, 27/29 Tel 06.513027', '€ 240.000', NULL, '3 locali', '103 m2', '1 bagni', '2 piano', 'Studio Florio', '0584 1620 414', 'appia nuova', '05/11/2019', 'asta', 0, 'DELETED'),
	(81, '77041758', 'Trilocale via Appia Nuova,, 261, Roma', 'https://www.immobiliare.it/annunci/77041758/', 'Roma - San Giovanni - Re di Roma - Immobile in Asta - Zona San Giovanni - Via Appia Nuova, altezza ponte lungo - CAP 00181 Roma Immobile Acquisibile tramite ASTA GIUDIZIARIA e visionabile previa richiesta Appartamento posto al piano secondo, composto da cinque vani catastali, per una superficie commerciale di 103 metri quadri. Prezzo base d’asta 320.000,00 Offerta minima in asta € 240.000 Asta 04 Dicembre 2019 Termine presentazione offerte 03 Dicembre 2019 ore ore 11:00 CONTATTI Per informazioni contattare il seguente numero 06 (mettiamo quello di maison) I NOSTRI SERVIZI : - PRIMA CONSULENZA GRATUITA - CONSULENZA TECNICA: - ASSISTENZA E CONSULENZA LEGALE - ASSISTENZA E CONSULENZA FISCALE. - ASSISTENZA E CONSULENZA FINAZIARIA (POSSIBILITA’ DI MUTUO 100%) - VALUTAZIONE ACQUISTO PRE-ASTA La partecipazione in asta e’ GRATUITA in caso di mancata aggiudicazione. REMAX MAISON', '€ 240.000', NULL, '3 locali', '103 m2', '2 bagni', '2 piano', 'RE/MAX Maison', '06 6228 6670', 'T418', '17/12/2019', 'asta', 0, 'DELETED'),
	(82, '76985820', 'Trilocale via Appia Nuova 243, Roma', 'https://www.immobiliare.it/annunci/76985820/', 'APPARTAMENTO - VIA APPIA NUOVA 243 - ROMA MQ 90 DATA ASTA 04/12/2019 PREZZO 240.000 ( POSSIBILITA\' SALDO E STRALCIO ) Situato in uno dei quartieri più commerciali ed ottimamente serviti dai mezzi pubblici, posto al piano secondo è composto da : ingresso cucina, living, due camere disimpegno, bagno. Con l\'affidamento dell\'incarico di acquisto allo studio “VALUTARE srl”, viene assegnato un legale specializzato nel settore, che seguirà personalmente tutte le procedure necessarie per l\'acquisto dell\'immobile all\'asta o prima dell\'asta attraverso dismissione volontaria; Quest\'ultima modalità di acquisto, la cui fattibilità è da valutarsi caso per caso, prevede l\'accordo tra il proprietario dell\'immobile creditori intervenuti nella procedura e ratifica finale del Giudice dell\'Esecuzione mediante apposita udienza. In particolare tra le attività di supporto effettuate dallo studio si evidenzia: - visita dell\'immobile. - partecipazione all\'asta. – assistenza per decreto di trasferimento proprietà. Il legale seguirà la fase della liberazione fino alla consegna delle chiavi ed all’ immissione in possesso al Ns cliente. Dalla prima, visita fino alla consegna, delle chiavi sarete sempre coadiuvati da un nostro professionista, per assicurarvi un acquisto in totale sicurezza. Il nostro studio presta assistenza a 360° sostituendosi ai tradizionali canali di acquisto, agenzie immobiliari, cui ci si rivolge nella vendita tradizionale. Sia in caso di acquisto in asta che in caso di transazione il vantaggio per l\'acquirente è sensibile rendendo di fatto l\'acquisto di immobili oggetto di esecuzione immobiliare una tra le migliori strategie di investimento.La possibilità che il prezzo della base d’asta scenda per successive aste deserte,infatti, rappresenta una delle grandi opportunità del sistema delle aste in quanto è possibile acquistare immobili a prezzi vantaggiosi, e sicuramente concorrenziali rispetto ai prezzi del libero mercato. Per ogni immobile viene effettuata: - perizia di corrispondenza catastale - verifica titoli di occupazione - analisi valore reale commerciale in rapporto al mercato di riferimento - vincoli amministrativi e tutti gli adempimenti necessari nel singolo caso al fine di assicurare il vostro acquisto in asta. Le posizioni esposte consentono un risparmio medio superiore al 25% del valore del mercato, rappresentando una reale occasione immobiliare. Sul nostro sito troverete gli immobili che abbiamo selezionato, escludendo le realtà che non rappresentano opportunità per i nostri clienti. In caso di mancata aggiudicazione nulla sarà dovuto in termini di parcella al nostro studio. Per info e appuntamenti chiamare 0647544352', '€ 240.000', NULL, '3 locali', '91 m2', '1 bagni', '2 piano', 'Valutare srl', '06 4754 4352,335 1920 744', '246/2016 ASTA', '04/11/2019', 'asta', 0, 'DELETED'),
	(83, '74206144', 'Trilocale via Appia Nuova 381, Roma', 'https://www.immobiliare.it/annunci/74206144/', 'APPIA NUOVA: In posizione eccellente, adiacente Metro Furio Camillo e a pochi passi da Villa Lazzaroni e Centro Commerciale Happio, l\' immobilare House Dream propone la vendita di un trilocale posto ad un piano alto con splendidi affacci, completamente assolato con doppia esposizione Sud - Sud/Ovest . Entrando nell\'immobile abbiamo un ingresso che porta al salone della casa, proseguendo si arriva alla cucina abitabile, disimpegno, due camere da letto e servizio finestrato. L\'immobile si trova in condizioni originali. Ideale anche ad uso investimento. POSSIBILE PERMUTA Rif. 13/19 Richiesta €290.000,00 La nostra sede di Viale Giulio Agricola 23/31 (Metro Giulio Agricola) cura le transazioni immobiliari che avvengono su tutto il territorio romano L’ottima conoscenza del mercato immobiliare dei nostri agenti , uniti all’ elevatissima visibilità su tutti i portali immobiliari e riviste del settore di tutti gli immobili gestiti dalla House Dream ne fanno il punto di riferimento per chi desidera vendere, acquistare o locare un immobile. Siamo in grado di gestire e risolvere qualsiasi problematica di natura tecnico, urbanistico e catastale del vostro immobile. Potete contattarci tutti i giorni compreso il sabato ai numeri 06.71587043 Fax 0671544351 una e-mail all’indirizzo info@housedream.it o visitate il nostro sito www.housedream.it Nazione Italia Regione Lazio Provincia Roma Comune Roma Zona Appio Latino, Colli Albani Quartiere Furio Camillo Indirizzo Via Appia Nuova, 381', '€ 290.000', NULL, '3 locali', '76 m2', '1 bagni', '8 piano', 'HOUSE DREAM', '06 7158 7043,328 1707 485', '13/19', '19/12/2019', 'no balcone', 0, 'DELETED'),
	(84, '74652420', 'Trilocale piazza dell\'Alberone 15, Roma', 'https://www.immobiliare.it/annunci/74652420/', 'A piazza dell\'Alberone, storico quartiere di Roma, all\'interno di un palazzetto d\'epoca ristrutturato qualche anno fa, proponiamo la vendita di un immobile posto al quarto piano così composto: ingresso, soggiorno, camera, cameretta, cucina abitabile e servizio. La casa è ristrutturata ed è dotata di riscaldamento autonomo e climatizzazione interna. L\'immobile gode di un\'ottima luminosità grazie alla doppia esposizione sia sulla piazza dell\'Alberone che sul giardino condominiale. Si valutano permute anche in altri quartieri.', '€ 335.000', NULL, '3 locali', '75 m2', '1 bagni', '4 piano', 'area-re agenzia appio', '06 7047 4087', 'AR003149', '05/07/2019', 'no balcone', 0, 'REJECTED'),
	(85, '77345284', 'Trilocale da ristrutturare, secondo piano, Roma', 'https://www.immobiliare.it/annunci/77345284/', 'Via Rea Silvia - In palazzetto d\'epoca dei primi anni del 900, il cui valore storico sarà ulteriormente valorizzato dall\'amministrazione condominiale di concerto con le Belle Arti. (verranno effettuati lavori di rifacimento dell\'intero stabile e sarà possibile visionare la relazione tecnica riguardante i progetti di tutti i lavori.) Il comprensorio è sito in posizione strategica per la vicinanza ad ogni tipo di attività commerciale e ai principali mezzi di trasporto pubblico (fermata Furio Camillo della linea A a 300 mt, fermata Ponte Lungo della linea A a 200 mt, Stazione Tuscolana a 700 mt, autobus per il centro e le principali stazione ferroviarie), proponiamo in vendita un appartamento di 90 mq sito al secondo piano di un piccolo stabile di quattro piani, dotato di ascensore. All\'interno, la porta di ingresso si apre su un corridoio che conduce, sulla destra, alle due camere da letto con affaccio silenzioso nel cortile interno e sulla sinistra al soggiorno e ad un piccolo disimpegno da cui si accede al bagno, finestrato e con doccia, e alla cucina abitabile. La zona giorno ed il bagno godono di un affaccio aperto con esposizione ad Ovest, mentre le due camere sono esposte ad Est. La doppia esposizione parallela, quindi, rende la soluzione particolarmente ariosa. Grazie all\'architettura d\'epoca novecentesca, internamente, è possibile sfruttare l\'altezza dei soffitti per ricavare una o più zone soppalcate anche in vista dei lavori di ristrutturazione di cui l\'appartamento necessita. La soluzione è dotata di riscaldamento di tipo centralizzato con contabilizzatori di calore e dispone di boiler elettrico per la produzione di acqua calda sanitaria. Completa la proprietà una cantina di pertinenza di circa 10 mq, con finestra, sita al piano seminterrato. Per informazioni e appuntamenti contattare lo 06.78.53.207 oppure 377.02.21.574.', '€ 265.000', NULL, '3 locali', '90 m2', '1 bagni', '2 piano', 'Affiliato Tecnorete: MEDIAZIONI IMMOBILIARI APPIO ALBERONE SRLS', '06 7853 207,377 0221 574', '40247291', '20/12/2019', 'no balcone', 0, 'REJECTED'),
	(86, '76962766', 'Trilocale via Appia Nuova 414, Roma', 'https://www.immobiliare.it/annunci/76962766/', 'Appartamento posto al secondo piano di una palazzina d\'epoca su via Appia Nuova, a 100 metri dalla Metro A Furio Camillo, in una zona ampiamente coperta da servizi. L\'appartamento, è composto da tre stanze, cucina abitabile, bagno e piccolo soppalco; le stanze più grandi hanno affaccio su strada, gli altri tre ambienti si affacciano su un\'ampia corte interna. Dotato di porta blindata, riscaldamento autonomo, è libero e in buono stato e le stanze hanno altezza superiore a m 3,80. Astenersi agenzie.', '€ 330.000', NULL, '3 locali', '91 m2', '1 bagni', '2 piano', '', '', 'EK-76962766', '04/11/2019', 'no balcone', 0, 'REJECTED'),
	(87, '68172417', 'Trilocale piazza Lodi, Roma', 'https://www.immobiliare.it/annunci/68172417/', 'Piazza Lodi, Appartamento in Vendita, piano alto libero luminoso ristrutturato ingresso salone due camere (possibilità terza camera) cucina abitabile doppi servizi. Dilazioni - Permute. Rif. 969S Tel. 06. 69353612 Apartment for Sale, free bright high floor, renovated entrance hall two bedrooms (possibility third bedroom) kitchen two bathrooms. Appartement à Vendre, étage élevé lumineux gratuit, hall d\'entrée rénové deux chambres (possibilité troisième chambre) cuisine deux salles de bains. Apartamento en venta, alto piso libre brillante, hall de entrada renovado dos dormitorios (posibilidad de tercer dormitorio) cocina dos baños.', '€ 355.000', NULL, '3 locali', '110 m2', '1 bagni', '3 piano', 'Bovi RE', '06 8396 4019', '969S', '14/12/2019', 'no balcone', 0, 'REJECTED'),
	(88, '75821370', 'Quadrilocale buono stato, terzo piano, Roma', 'https://www.immobiliare.it/annunci/75821370/', 'ALBERONE-APPIA-FURIO CAMILLO - VIA APPIA NUOVA (ADIACENZE VIALE FURIO CAMILLO) - Appartamento di ampia metratura, MOLTO LUMINOSO che gode di una DOPPIA ESPOSIZIONE, posto al terzo piano; composto di: ingresso,soggiorno,2 camere, studio,corridoio,cucina abitabile,bagno. Dotato di un comodo armadio a muro collocato nel corridoio. L\'immobile è ubicato in zona centrale con tutti i servizi necessari nelle immediate vicinanze, tra cui: la fermata della Metro, linea A, Furio Camillo ed il Centro Commerciale Happio. Affaccio del soggiorno con vista sul verde della ottocentesca Villa Lazzaroni.', '€ 365.000', NULL, '4 locali', '104 m2', '1 bagni', '3 piano', 'Affiliato Tecnocasa: STUDIO APPIO ALBERONE S.R.L.', '06 7821 531', '40219043', '26/11/2019', 'no balcone', 0, 'REJECTED'),
	(89, '76693952', 'Trilocale via Mario Menghini, Roma', 'https://www.immobiliare.it/annunci/76693952/', 'Parco della Caffarella - Adiacente fermata della metropolitana colli albani, più precisamente in via mario menghini, via principale del quartiere e vicinissima a tutti i servizi quali: scuole, negozi, ristoranti, farmacie, bar etc... proponiamo la vendita di un immobile posto al piano quinto in stabile in cortina di sette piani...internamente si compone di un ingresso con salone a vista, cucina abitabile, due camere da letto e bagno. Senza balcone. La casa esponendo tutta a sud-est risulta LUMINOSA.', '€ 375.000', NULL, '3 locali', '89 m2', '1 bagni', '5 piano', 'Affiliato Tecnocasa: EMME IMMOBILIARE S.R.L.', '06 7820 445,06 7805 965', '40236240', '19/11/2019', 'no balcone', 0, 'REJECTED'),
	(90, '71789756', 'Trilocale via Genzano 31, Roma', 'https://www.immobiliare.it/annunci/71789756/', 'Appio Latino, Via Genzano adiacente Via Appia Nuova,7° piano con ascensore PRIVATO vende appartamento di circa 100 mq internamente composto da : ingresso con salone a vista, 2 camere da letto matrimoniali , doppi servizi ( un bagno completo e l\'altro con lavandino e wc) , cucina abitabile, ripostiglio, veranda e balcone. L\'appartamento è molto luminoso e silenzioso , è dotato aria condizionata, parquet in salone e nelle camere. Discreto stato di manutenzione. ASTENERSI TASSATIVAMENTE AGENZIE', '€ 340.000', '€ 345.000', '3 locali', '100 m2', '2 bagni', '7 piano', 'gabriele lucaroni', 'https://media.immobiliare.it/text/tel_71789756_0a2aa.jpg?k=4984e7135c1f5c77508c80767b0c087b', 'EK-71789756', '17/12/2019', 'REJECTED ultimo piano \nultimo piano', 0, 'REJECTED'),
	(91, '76494936', 'Trilocale via adiacente V SANTA CROCE IN GERUSALEMME A, Roma', 'https://www.immobiliare.it/annunci/76494936/', 'Rif: FRIMM - porta maggiore san giovanni adiacente alla chiesa santa croce in gerusalemme in comprensorio di palazzine d\'epoca con portiere e possibilità di parcheggio interno disponiamo di un appartamento posto al 4°e ultimo piano cosi meglio descritto : ingresso soggiornino due camere servizio e possibilità di parcheggio di una autovettura nel comprensorio euro 295000 L\'APPARTAMENTO HA N OTTIMA ESPOSIZIONE ED E MOLTO LUMINOSO- ZONA COMMERCIALE -RICCA DI SERVIZI ED OTTIMAMMENTE COLLEGATA PER INFO E APPUNTAMENTI FRIMM VIALE TRASTEVERE -98 TEL.0658335076 WWW.TRASTEVEREIMMOBILIARE.COM', '€ 295.000', NULL, '3 locali', '75 m2', '1 bagni', NULL, 'WWW.TRASTEVEREIMMOBILIARE.COM', '06 5833 5076', 'FRIMM (2596514)', '11/11/2019', 'ultimo piano', 0, 'DELETED'),
	(92, '68582851', 'Trilocale via Sebastiano Grandis, Roma', 'https://www.immobiliare.it/annunci/68582851/', 'In zona Centro Storico - Santa Croce in Gerusalemme e precisamente in Via Sebastiano Grandis, in complesso d\'epoca del 1910 in tinta, di 5 piani con ascensore, con sevizio di portineria e parcheggio condominiale, proponiamo la vendita di un appartamento trilocale di 88 mq commerciali, sito al II piano. Internamente si compone di soggiorno a vista, disimpegno, camera matrimoniale, cameretta, cucina abitabile, bagno, posto auto condominiale e cantina a € 20,00 mensili . Da ristrutturare. Doppia esposizione, con affaccio della zona notte a Sud/Est su Via Grandis e per la zona giorno,cucina e bagno su ampia corte condominiale a Sud/Ovest . Il riscaldamento è centralizzato. Le spese condominiali € 140,00 mensili omnicomprensive. Classe Energetica G - IPE 175. ** Per info e appuntamenti chiamare 392/8210724 **', '€ 295.000', NULL, '3 locali', '88 m2', '1 bagni', '2 piano', 'Aureli Immobiliare', '06 7834 7464', 'CE-1581', '03/07/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(93, '75855168', 'Quadrilocale via Prenestina, Roma', 'https://www.immobiliare.it/annunci/75855168/', 'Rif: 4158 - In zona Porta Maggiore, a pochi passi dalla metro C Lodi, in stabile in tinta di 7 piani con ascensore in ottimo stato manutentivo, proponiamo la vendita di un piano alto luminoso e panoramico composto da: ampio ingresso, soggiorno, tre camere, cucina abitabile, doppi servizi. Completano la proprietà due balconi. Internamente si presenta rifinito. Prezzo di vendita Euro 330.000,00. Classe energetica F. L\'immobile è ubicato in contesto caratterizzato dalla presenza di istituti bancari, negozi vari, supermercati e scuole; la zona è ottimamente servita da mezzi pubblici con una buona frequenza verso il centro storico e la stazione centrale. La posizione strategica nonchè i numerosi servizi rendono particolarmente interessante questa proposta immobiliare. La Grasso Group offre ai propri clienti VALUTAZIONI GRATUITE, continua e mirata promozione del proprio immobile, rapidità nella ricerca dell\'acquirente, consulenza tecnico-legale, supporto qualificato da parte di professionisti quali architetti e notai, realizzando tutto questo con la serietà e la trasparenza che da sempre la contraddistinguono. Per visionare l\'immobile o per ulteriori informazioni può contattarci al numero 06.77272 o all\'indirizzo e-mail info@grassogroup.it.', '€ 330.000', NULL, '4 locali', '115 m2', '2 bagni', '6 piano', 'Grasso Group', '06 772 72', '4158 (2580501)', '19/12/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(94, '75886534', 'Trilocale via Casilina 9, Roma', 'https://www.immobiliare.it/annunci/75886534/', 'SAN GIOVANNI/PORTA MAGGIORE - PIANO ALTO - OTTIMO STATO - COMPLETO DI ARREDI - OTTIMO COME USO INVESTIMENTO ZONA SAN GIOVANNI, adiacente Porta Maggiore e Piazza Lodi, precisamente in via Casilina n. 9 - ex Mulino Pantanella - all\'interno di una costruzione ristrutturata ex novo nel 2010, proponiamo in vendita un particolare e panoramicissimo 9° piano su 10 con soffitti alti 4,80 mt in salone ma attualmente ridotti a mt 2,95 per via del controsoffitto; si può ripristinare il soffitto a mt 4,80 e soppalcare, come altri condomini dello stesso stabile hanno già fatto. La casa è composta da ingresso, soggiorno, due camere, studiolo, angolo cottura, doppi servizi, il tutto in ottimo stato di manutenzione. Nei 2 disimpegni della casa ci sono dei comodi armadi a muro. L\'immobile si vende completo di arredamento (cucina completa, bagni, soggiorno e camere se interessa). Molto Interessante, inoltre, la valutazione dell\'immobile come OTTIMO USO INVESTIMENTO data la vicinanza all\'Università "La Sapienza di Roma" che lo rende perfetto per affitti a studenti universitari. Completa la proprietà una cantina di mq 5 circa. Possibilità di acquisto di un posto auto coperto doppio al piano seminterrato dello sesso stabile. #PortaMaggiore #PiazzaLodi #SanGiovanni #SoffittiAlti #Metropolitana #Centrale #Panoramico #Ascensore #PianoAlto #ExMulinoPantanella #Trilocale #TreLocali #DoppiServizi #2Bagni #Arredato #MetroC #MetroA #VicinanzaMezziPubblici #VicinoServizi #VicinoAttivitàCommerciali°RecenteCostruzione', '€ 325.000', NULL, '3 locali', '95 m2', '2 bagni', '9 piano', 'RE/MAX Key House', '06 9480 3198', 'T3166', '02/10/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(95, '72227594', 'Trilocale Circonvallazione Appia, Roma', 'https://www.immobiliare.it/annunci/72227594/', 'In zona Appio Latino, Circonvallazione Appia, in palazzina d\'epoca in tinta del 1935 di 5 piani con ascensore, proponiamo la vendita di un trilocale di 83 metri quadri circa, sito al II piano. Internamente si compone di ampio ingresso, soggiorno, cucina abitabile, camera con doppio punto luce (ed uscita sul balcone), cameretta, bagno, balcone di 6 metri quadi circa e posto moto scoperto nell\'area condominiale. L\'appartamento si presenta in buono stato, con marmitte a terra ed infissi nuovi in Pvc con vetro camera. Ha un\'esposizione ad Ovest, con affaccio angolare sulla via e verso la ferrovia. Il riscaldamento è termoautonomo. Le spese condominiali sono di Euro 60 mensili. Classe Energetica G - IPE 175', '€ 295.000', NULL, '3 locali', '83 m2', '1 bagni', '2 piano', 'Aureli Immobiliare', '06 7834 7464', 'CE-1738', '28/03/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(96, '75710168', 'Trilocale via Lidia, Roma', 'https://www.immobiliare.it/annunci/75710168/', 'Nel quartiere Appio Latino, nelle immediate vicinanze del parco della Caffarella, UniCredit Subito Casa propone in vendita un trilocale recentemente ristrutturato, sito al terzo piano di una palazzina in tinta di quattro piani, con servizio di guardia ed ascensore. L\'appartamento, con doppia esposizione, ha un ampio ingresso, un soggiorno con balcone, una cucina, due camere da letto ed un bagno. Impianto di riscaldamento condominiale con termo contabilizzatori. Possibilità di acquisto cantina ad euro 5.000,00. Per valutare la proposta commerciale personalizzata sulle vostre esigenze, è possibile chiamare il numero verde di UniCredit Subito Casa 800.896.968', '€ 298.000', NULL, '3 locali', '80 m2', '1 bagni', '3 piano', NULL, NULL, '(1810487)', '11/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(97, '77537224', 'Quadrilocale via Antonio degli Effetti 9, Roma', 'https://www.immobiliare.it/annunci/77537224/', 'Adiacente a Piazza Scipione Ammirato vendesi appartamento perfettamente suddiviso, composto da ampio salone, cucina a vista, camera matrimoniale, cameretta e bagno. Ottimo stato, parquet nelle camere, balconcino su cortile interno, infissi in alluminio con doppi vetri, grate antieffrazione a scomparsa e porta blindata. A soli 5 minuti dalla metro A (fermata Ponte Lungo). Possibilità di box auto pertinenziale con annessa cantina (per un totale di 21 mq). No agenzie.', '€ 319.000', NULL, '4 locali', '86 m2', '1 bagni', '2 piano', 'Luca Michelangeletti', 'https://media.immobiliare.it/text/tel_77537224_795b0.jpg?k=9f1f85eae178bbc29690014f19e5a7d1', 'EK-77537224', '18/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(98, '71089024', 'Trilocale via Taranto 47, Roma', 'https://www.immobiliare.it/annunci/71089024/', 'San Giovanni, Appartamento in Vendita, adiacente Re di Roma piano alto libero tranquillo luminoso ampio ingresso salone due camere cucina bagno. Due balconi. Dilazioni - Permute. Rif. 1094S - Tel. 06.69353612. Apartment for Sale, adjacent King of Rome high floor free quiet bright large entrance hall two bedrooms kitchen bathroom. Two balconies Appartement à vendre, adjacent roi de Rome étage élevé libre calme lumineux grand hall d\'entrée deux chambres cuisine salle de bains. Deux balcons Apartamento en venta, adyacente a la planta alta del rey de Roma, libre, tranquilo, luminoso, amplio, vestíbulo de entrada, dos dormitorios, cocina y baño. Dos balcones', '€ 359.000', NULL, '3 locali', '90 m2', '1 bagni', '5 piano', 'Bovi RE', '06 8396 4019', '1094S', '11/06/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(99, '76937810', 'Trilocale via dei Laterani, Roma', 'https://www.immobiliare.it/annunci/76937810/', 'Via dei Laterani, proponiamo rifinitissimo secondo piano, in palazzina ristrutturata con servizio di portineria FD a due passi da Rione Monti alle spalle della Basilica di San Giovanni in Laterano e del Colosseo. L\' immobile misura circa 70 mq commerciali ed è composto da: soggiorno con cucina a vista arredata, una camera matrimoniale con ampio armadio a muro, una camera singola, bagno con doccia e terrazzino vivibile. L\'immobile è stato completamente ristrutturato nel 2013 e dotato di condizionatori caldo/freddo, infissi nuovi, impianti idraulico/elettrico, parquet e risulta molto luminoso in quanto presenta un\'ottima esposizione su due lati. Ottimo anche come struttura ricettiva data dalla posizione centrale o per investimento.', '€ 355.000', NULL, '3 locali', '69 m2', '1 bagni', '2 piano', 'Studio Barone Raschi', '06 4566 6148,339 3441 925', 'laterani355', '31/10/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(100, '74185484', 'Quadrilocale via della Stazione Tuscolana, 92, Roma', 'https://www.immobiliare.it/annunci/74185484/', 'Villa Fiorelli a pochi passi da Piazza Ragusa. Delizioso appartamento di mq 85 posto al piano terzo di una palazzina in tinta di cinque piani con ascensore Ingresso su corridoio, tre ampie stanze, cucina con tinello, bagno con finestra e balcone. La doppia esposizione e le ampie finestre conferiscono un\'ottima luminosità in tutti gli ambienti. Riscaldamento autonomo.', '€ 293.000', NULL, '4 locali', '85 m2', NULL, '3 piano', 'RE/MAX Abacus', '06 9480 8599', 'T428', '16/10/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(101, '76214194', 'Trilocale via Ferdinando Ughelli, Roma', 'https://www.immobiliare.it/annunci/76214194/', 'Nel cuore dell’Appio Latino vicinissimo al parco della Caffarella, proponiamo in vendita esclusiva un comodo trilocale piano alto con ascensore, in una palazzina in tinta degli anni ‘50. Lo stabile è ubicato in un contesto signorile e silenzioso, inoltre gode di un ampio ingresso pedonale che lo contraddistingue conferendogli affacci aperti e luminosi. L’appartamento, situato al quarto piano di cinque, si sviluppa su una pianta regolare dal cui ingresso si accede nell’ampio soggiorno con balcone, proseguendo trovano posto due camere matrimoniali, una cucina semi abitabile e un bagno. Si tratta di una soluzione ideale per giovani coppie e per famiglie con uno o due figli, che potranno godere di tutti i vantaggi offerti dal vivere in città, come la metro e il vicino centro commerciale Happio e, al tempo stesso, il vantaggio di fruire di una delle più importanti aree verdi della capitale. Le presenti informazioni e planimetrie sono meramente indicative e non costituiscono elementi contrattuali. Rif. W-02GT40 - Stefano D\'Alisera - Tel. +39 06 45 54 81 20', '€ 360.000', NULL, '3 locali', '90 m2', '1 bagni', '4 piano', 'Engel & Völkers Roma • Market Center', '06 4554 8120', 'W-02GT40 - S11', '20/12/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(102, '77532964', 'Trilocale via Alba 34, Roma', 'https://www.immobiliare.it/annunci/77532964/', 'DB case vende appartamento sito nel cuore di Ponte Lungo - Re Di Roma, precisamente in Via Alba, zona strategica a metà tra Via Appia Nuova e Via Tuscolana, servitissima da ogni mezzo di trasporto come autobus, linea ferroviaria stazione Tuscolana che raggiunge l\'aeroporto di Fiumicino e la Metro A fermata “Ponte Lungo” e dalle molteplici attività commerciali della zona quali bar, farmacie,supermercati, negozi ecc ecc che consentono di vivere a pieno il quartiere. La casa è posta al primo piano ed è composta da ingresso, soggiorno con doppia finestra angolare, cucina abitabile, 2 camere da letto, servizio e balcone. Internamente è da ristrutturare, presenta la pavimentazione dell\'epoca in tutte le camere ad eccezione del servizio e della cucina che hanno la ceramica. Gli infissi sono in alluminio anodizzato, l\' esposizione è tripla ed interna, quindi molto silenziosa ma allo stesso tempo garantisce un ottimo ricircolo d\'aria. L\'appartamento gode di grande luminosità. Il palazzetto, di soli 2 piani è stato edificato nei primi anni del 900\' ed è in tinta. Ideale come casa vacanze, B&B o ufficio. Ottimo uso investimento. € 249.000,00 Classe energetica G 132,4 kwh/m2 anno Per info e visite 06/70614285 o www.dbcase.it RICHIEDI LA VALUTAZIONE DI CASA TUA GRATUITAMENTE. DB CASE VIA CASORIA 48 / 50 ( METRO RE DI ROMA )', '€ 249.000', NULL, '3 locali', '76 m2', '1 bagni', '1 piano', 'DB case', '06 7061 4285', 'via alba 249', '28/11/2019', 'primo piano', 0, 'DELETED'),
	(103, '76908164', 'Trilocale via Caulonia, Roma', 'https://www.immobiliare.it/annunci/76908164/', 'All\'interno del celeberrimo quartiere di San Giovanni, nel centro storico di Roma, nelle adiacenze di Piazza Zama e più precisamente in Via Caulonia, CONCEPT HOME cura la vendita di un ampio trilocale posto al quinto piano in un’elegante stabile in tinta recentemente ristrutturato. Entrando nell’appartamento ci troviamo in un lungo corridoio che ci consente l’accesso a tutti gli ambienti. Per prima incontriamo una comoda camera da letto matrimoniale, proseguendo abbiamo la cucina, il servizio con vasca e finestra, il soggiorno con porta finestra che ci fa uscire sul primo balcone ed una seconda camera matrimoniale balconata. L’immobile si presenta completamente da ristrutturare. Gode di una doppia esposizione opposta che lo rende molto luminoso e arioso. La zona è servitissima essendo uno dei quartieri principali e nevralgici della Capitale. Siamo a ridosso di Piazza Zama, dove c’è uno dei più grandi capolinea autobus della città; raggiungibili a piedi anche le fermate della metropolitana linea A San Giovanni e Re di Roma. Nelle vicinanze abbiamo il famoso mercato di Via Satrico e tutte le principali attività commerciali quali farmacie, scuole, supermercati e negozi di ogni genere. Qualunque sia la Vostra esigenza immobiliare, inviateci una e-mail all\'indirizzo info@concepth.it. o visitate il nostro sito http://www.concepth.it. CONCEPT HOME - Sentirsi di Casa.', '€ 320.000', NULL, '3 locali', '90 m2', '1 bagni', '5 piano', 'Concept Home', '06 9785 7971', 'T372', '13/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(104, '72156628', 'Trilocale via La Spezia, Roma', 'https://www.immobiliare.it/annunci/72156628/', 'San Giovanni, Appartamento in Vendita Via La Spezia, piano alto, libero tranquillo luminoso, completamente ristrutturato, ampio ingresso, salone, due camere, cucina, bagno (possibilità secondo bagno), ripostiglio. Dilazioni - Permute. Rif. 1145S - Tel. 06.69353612. Apartment for Sale, via La Spezia bright top floor renovated entrance hall two bedrooms kitchen bathroom possibility second bathroom closet Appartement à vendre, via La Spezia lumineux dernier étage hall d\'entrée rénové deux chambres cuisine salle de bain possibilité deuxième salle de bains placard Apartamento en venta, a través de La Spezia, piso superior luminoso, renovado, entrada, dos dormitorios, cocina, baño, posibilidad, segundo baño, armario', '€ 375.000', NULL, '3 locali', '100 m2', '1 bagni', '4 piano', 'Bovi RE', '06 8396 4019', '1145S', '01/10/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(105, '77158442', 'Trilocale via della Pisana40, 66, Roma', 'https://www.immobiliare.it/annunci/77158442/', 'Appartamento in via della Pisana (altezza incrocio Bravetta), privato propone in vendita un appartamento di 50 mq. posto al primo piano di una palazzina in cortina. L\'appartamento è in buone condizioni, non affaccia sulla strada perché si accede da un cortile interno; pertanto risulta molto silenzioso. L\'immobile è composto da un soggiorno con angolo cottura da una camera matrimoniale, bagno e un balcone su tutte le stanze. Posto motorino nel cortile. Le caratteristiche dell\'immobile e la presenza nelle vicinanze di aree verdi, impianti sportivi, scuole e tutti i principali servizi, rendono questa proprietà un\'ottima opportunità sia per single, per coppie giovani o anche come uso investimento. Per ulteriori informazioni o per avere un appuntamento e visionare l\'immobile non esitate a contattarci.', '€ 140.000', NULL, '3 locali', '50 m2', '1 bagni', '1 piano', 'Homepal', '334 1071 883,334 1071 883', '217407', '12/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(106, '75878616', 'Trilocale via Albenga, Roma', 'https://www.immobiliare.it/annunci/75878616/', '(ad. Via Appia - metro Ponte Lungo) LUMINOSO PIANO ALTO ingresso, salone con angolo cottura, 2 camere, servizio, soppalco e balcone. RISTRUTTURATO €299.000 Rif. LZ/185 Tel.0669339108 www.leximmobiliare.it Nel quartiere Appio Latino, zona ben fornita da servizi di ogni genere ( scuola, negozi, supermercati, centri commerciali) nelle vicinanze di Via Appia Nuova , a pochi passi dalla metropolitana linea A (Ponte Lungo) e dalla stazione ferroviaria Tuscolana,più precisamente Via Albenga, proponiamo la vendita di un appartamento sito al 5° piano catastale di un palazzo in tinta di 10 piani degli anni \' 50. L\'immobile è composto da un ampio ingresso, salone con angolo cottura, 2 camere di cui una con il balcone , servizio ed un comodo soppalco. L\'appartamento gode di una doppia esposizione interna con affaccio su un grazioso giardino condominiale che lo rende luminoso e silenzioso. L\'immobile è stato oggetto di una totale ristrutturazione, la posizione strategica risulta ideale sia per uso abitativo sia per uso investimento dato il facile collegamento con le università di Roma. "Le presenti informazioni e planimetrie sono meramente indicative e non costituiscono elementi contrattuali." (ad. Via Appia - Ponte Lungo meter) BRIGHT UPPER FLOOR entrance, living room with kitchenette, 2 bedrooms, bathroom, mezzanine and balcony € 299,000 Ref LZ / 185 Tel.0669339108 www.leximmobiliare.it In the Appio Latino district, an area well supplied by services of all kinds (school, shops, supermarkets, shopping centers) near Via Appia Nuova, a few steps from the underground line A (Ponte Lungo) and the Tuscolana railway station, more precisely Via Albenga, we offer the sale of an apartment on the 5th floor of a 10-storey building in the same color of the 50s. The property consists of a large entrance hall, living room with kitchenette, 2 bedrooms, one with a balcony , service and a comfortable loft. The apartment enjoys a double internal exposure overlooking a lovely communal garden that makes it bright and quiet. The building has undergone a total renovation, the strategic position is ideal for both residential and investment use given the easy connection to the universities of Rome.', '€ 299.000', NULL, '3 locali', '85 m2', '1 bagni', '5 piano', 'LEX Immobiliare', '06 6933 9108', 'LZ/185', '19/12/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(107, '76985006', 'Trilocale via Satrico 52, Roma', 'https://www.immobiliare.it/annunci/76985006/', 'APPIA SAN GIOVANNI – APPIO LATINO AD. PIAZZA ZAMA VIA SATRICO Proponiamo la vendita di un appartamento di circa 80 mq sito al quinto piano. L\'immobile è composto da: Ampio ingresso, salone, cucina, 2 camere da letto, bagno e due balconi. L\'appartamento è in ottimo stato. Completano la proprietà una cantina. Doppia esposizione, esterna su via Satrico (nord/est) e interna (sud/ovest). Riscaldamento centralizzato con contabilizzatori a consumo. Euro 335.000 - Per informazioni e/o appuntamenti su questo immobile contattare direttamente Fabrizio Posta al 3287957492 Siamo disponibili per qualsiasi altra informazione: - sulle eventuali procedure per l\'acquisto della vostra casa, - per aiutarvi a reperire un mutuo a tassi vantaggiosi più adatti alle vostre esigenze; - Valutazione dei vostri immobili per eventuali permute - Consulenze notarili - Consulenze Fiscali - Consulenze tecnico urbanistiche. Per qualsiasi cosa in materia immobiliare. non esitate a contattarci, siamo disponibili a darvi tutte le info che vi interessano!', '€ 335.000', NULL, '3 locali', '80 m2', '1 bagni', '5 piano', 'Studio Tecnico Immobiliare Associato', '328 7957 492,320 1908 994', 'FP satrico', '04/11/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(108, '76025842', 'Trilocale via Caulonia, Roma', 'https://www.immobiliare.it/annunci/76025842/', 'San Giovanni - Via Caulonia - Vi proponiamo in vendita un appartamento di tre locali composto da un ingresso, un soggiorno, una cucina abitabile, due camere da letto, un bagno ed un ripostiglio. L\'immobile si presenta da ristrutturare ed ha un ottimo potenziale. E\' posto al secondo piano di otto, con ascensore al piano, ha una doppia esposizione, ed ha inoltre due balconi uno dei quali abitabile. Gode di una posizione ottimale essendo vicinissimo a Piazza Zama, la via è privata e si trova a pochi passi da tutti i servizi della zona.', '€ 330.000', NULL, '3 locali', '90 m2', '1 bagni', '2 piano', 'Affiliato Tecnocasa: Studio Immobiliare Caffarella srl', '06 9450 2069', '40223545', '19/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(109, '74569858', 'Trilocale via Altino, Roma', 'https://www.immobiliare.it/annunci/74569858/', 'Nel quartiere storico di San Giovanni, più precisamnente nella centrale e ben servita zona di Piazza Tuscolo, a pochi passi dalla metro A San Giovanni, Re di Roma e la fermata della linea C, proponiamo in vendita un ampio trilocale in palazzina anni \'30 posto al terzo piano di 75mq ca. . L\'immobile, ristrutturato e luminoso, è ubicato nella silenziosa ma allo stesso tempo centrale Via Altino, e si presenta così composto: ampio soggiorno con angolo cottura, camera matrimoniale con bagno e balcone, cameretta e bagno padronale. Climatizzato. Attualmente locato ad un canone mensile di Euro 1.100,00.', '€ 340.000', '€ 349.000', '3 locali', '75 m2', '2 bagni', '3 piano', 'Affiliato Tecnocasa: MEDIAZIONI SAN GIOVANNI S.R.L. SOCIO UNICO', '06 7720 6070', '40193705', '21/11/2019', 'REJECTEDfuori zona prescelta\nfuori zona prescelta', 0, 'REJECTED'),
	(110, '75564836', 'Trilocale via Casilina 102, Roma', 'https://www.immobiliare.it/annunci/75564836/', 'A pochi passi da Piazza Lodi e Porta Maggiore, precisamente in via Casilina, proponiamo la vendita di un appartamento, all’interno di uno stabile d’epoca costruito in data 1930, composto da: ingresso, soggiorno, due camere, cucina abitabile, due servizi, ripostiglio e balcone. Finemente ristrutturato. La tramezzatura interna consente di modificare al meglio secondo le proprie esigenze la struttura dell’appartamento. La recentissima ristrutturazione consente comunque l\'accesso immediato senza nessun lavoro da apporre. La doppia esposizione lo rende molto luminoso ed è da sottolineare il bellissimo affaccio sull\'Acquedotto romano. Completa l\'immobile una comoda cantina asciutta di 12 mq all\'interno del palazzo.', '€ 300.000', NULL, '3 locali', '80 m2', '2 bagni', '2 piano', 'area-re agenzia appio', '06 7047 4087', 'AR000360', '22/11/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(111, '73689756', 'Trilocale via Appia Nuova 226, Roma', 'https://www.immobiliare.it/annunci/73689756/', 'In via Appia Nuova, nelle immediate adiacenze di Piazza dei Re di Roma, proponiamo la vendita di un immobile posto al 3° piano all\'interno di un palazzina d\'epoca di 6 piani. L\'appartamento è composto da: ingresso, soggiorno, due ampie camere da letto, cucina abitabile e due servizi di cui uno in camera, a completare l\'offerta una comoda cantina. L\'immobile è stato completamente ristrutturato ed è dotato di riscaldamento autonomo e condizionatori in ogni stanza; il piano alto e l\'esposizione esterna lo rendono luminoso per tutto l\'arco della giornata. La vicinanza alle attività di quartiere, a tutti i mezzi pubblici offrono un\'ottima opportunità a chi abbia voglia di migliorare la qualità della propria vita. Ottimo anche come uso investimento.', '€ 379.000', NULL, '3 locali', '96 m2', '2 bagni', '3 piano', 'area-re agenzia appio', '06 7047 4087', 'AR002969', '20/09/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(112, '76620308', 'Trilocale via Cerveteri, Roma', 'https://www.immobiliare.it/annunci/76620308/', 'San Giovanni, precisamente in via Cerveteri, proponiamo in vendita un appartamento molto luminoso e ben esposto, posto al secondo piano catastale di 92 mq di un signorile stabile d\'epoca con ascensore e servizio di portierato tutto il giorno a pochi passi dall\'ingresso della fermata metro A Piazza Re di Roma e ben collegato da tutti i servizi e le infrastrutture presenti nella zona. L\'appartamento è composto da ingresso, salone, cucina abitabile, 2 camere da letto, corridoio di disimpegno con piccola zona studio, un bagno con finestra ed un ampio ripostiglio finestrato dove è possibile realizzare un secondo bagno. Prezzo richiesto: € 345.000,00. L\'immobile è attualmente a reddito, affittato a persone referenziate con contratto di locazione in scadenza il 15/05/2022 ad un canone annuo di 10.800 €. Per ulteriori informazioni e visite contattare il +39 3930042666', '€ 345.000', NULL, '3 locali', '92 m2', '1 bagni', '2 piano', 'Ciacci Studio Immobiliare', '335 490 384', 'FB - Cerveteri', '22/10/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(113, '75822670', 'Quadrilocale via Ercolano 12, Roma', 'https://www.immobiliare.it/annunci/75822670/', 'Via Ercolano- In palazzo signorile anni Quaranta con servizio di ascensore,proponiamo la vendita di un appartamento situato al terzo piano in ottimo stato interno. La casa è composta da ingresso che ci introduce:sulla destra alle due camere con vista su Via Ercolano; sulla sinistra,il corridoio finestrato,ci accompagna in sequenza alla cucina abitabile,bagno e alle due camere da letto con esposizione su corte condominiale. Grazie alla tripla esposizione l\'appartamento beneficia di buona luminosità durante tutto il corso della giornata e di ottima silenziosità. Ubicata a pochi passi da aree ben servite da negozi, locali commerciali, mezzi di trasporto e scuole, la casa è ideale per famiglie e ad uso investimento.', '€ 349.000', NULL, '4 locali', '96 m2', '1 bagni', '3 piano', 'Affiliato Tecnorete: STUDIO IMMOBILIARE MERULANA SRL', '06 6936 6239,392 3432 243', 'EK-75822670', '20/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(114, '68407765', 'Trilocale via Enrico Toti 3, Roma', 'https://www.immobiliare.it/annunci/68407765/', 'Porta Maggiore via Enrico Toti Appartamento composto da ingresso, tre vani e bagno. Superficie catastale mq 80. Pavimenti originali, infissi esterni in legno, riscaldamento centralizzato con contabilizzatori di consumo. L\'immobile è sito al piano primo alto di un edificio di cinque, esposto a sud con vista sulle splendide rovine delle terme Eleniane parte in via Germano Sommelier, affaccio suggestivo. Lo Stabile d\'epoca del 1920 dotato di ascensore e cortile condominiale con posti auto non assegnati. La zona interessata è nella parte sud/est di Roma, nelle vicinanze di Piazza San Giovanni in Laterano, nell\'area urbana del Municipio I. Il quartiere è ricco di negozi di ogni genere, scuole, uffici postali, palestre, chiese, parchi e ospedali. Risulta inoltre ottimamente collegato con il resto della città grazie alla vicina metropolitana Linea A (stazione San Giovanni o Manzoni) e alla linea FS Stazione Roma Termini.', '€ 309.000', NULL, '3 locali', '95 m2', '1 bagni', '2 piano', 'ABACUS EVO IMMOBILIARE S.r.l.s', '06 9450 2060', 'San Giovanni via Enrico Toti', '07/10/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(115, '76644606', 'Trilocale largo Vercelli, 8, Roma', 'https://www.immobiliare.it/annunci/76644606/', 'Re di Roma - Precisamente a Largo Vercelli fronte metro A proponiamo la vendita di un luminoso appartamento di 110 mq circa composto da ampio ingresso, soggiorno, due ampie camere, cucina abitabile due bagni e un riipostiglio. Doppio affaccio sia su cortile interno che esterno su Largo Vercelli. L\'immobile si presenta da ristrutturare anche se recentemente oggetto di una ristrutturazione riguardante la pittura delle pareti. Il palazzo in cortina e tinta si presenta in ottimo stato ed è dotato di un ascensore d\'epoca recentemete ristrutturato. L\'immobile è situato in prossimità di piazza Re di Roma e poche centinaia di metri da Piazzale San Giovanni, in presenza della Metro A San Giovanni e Re di Roma, a poche fermate da Piazza di Spagna e Piazza della Repubblica, ma anche di numerose linee di autobus che lo collegano a tutte le zone della città e al centro storico di Roma Luminoso appartamento omposto da soggiorno due camere due bagni e ripostiglio da ristrutturare. € 350.000 Classe Energetica G (165 kWh/mqa). Per info R.E. di Roma immobiliare Tel. 348.45.26.685 - 06.700.09.09 info@rediromaimmobiliare.it', '€ 350.000', NULL, '3 locali', '110 m2', '2 bagni', '2 piano', 'R.E. di Roma Immobiliare', '06 9450 7250', 'T305', '19/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(116, '76488924', 'Trilocale via Caulonia, Roma', 'https://www.immobiliare.it/annunci/76488924/', 'San Giovanni - Via Caulonia, vi proponiamo in vendita un appartamento composto da: due camere da letto, matrimoniali, un ampio soggiorno ed una cucina semi abitabile, un bagno ed un comodo ripostiglio. L\'appartamento si presenta ristrutturato, in ottimo stato e gode di una doppia esposizione, si trova al secondo piano di nove ed ha un balcone. Ha inoltre un ottima posizione trovandosi vicinissimo a Pazza Zama, Via Satrico, Piazza Tuscolo a pochi passi da Piazza Re di Roma ed a tutti i servizi della zona. Ciò nonostante Via Caulonia rimane tranquilla e silenziosa, lontana dal traffico e lontana dal caos perché trattasi di una via chiusa. OTTIMO ANCHE COME USO INVESTIMENTO.', '€ 325.000', NULL, '3 locali', '80 m2', '1 bagni', '2 piano', 'Affiliato Tecnocasa: Studio Immobiliare Caffarella srl', '06 9450 2069', '40232893', '19/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
