	(119, '74603232', 'Quadrilocale via Domodossola 11, Roma', 'https://www.immobiliare.it/annunci/74603232/', 'San Giovanni Re di Roma, più precisamente in Via Domodossola, in uno stabile primi del 900 elegante e medio signorile con ascensore, proponiamo la vendita di un appartamento composto da ingresso, soggiorno con angolo cottura, disimpegno, tre camere, bagno e due piccoli balconi. Completa la proprietà un\'ampia cantina Descrizione dell\'appartamento a) Finiture I pavimenti sono rivestiti in gres . . i rivestimenti del bagno sono in ceramica; gli infissi esterni sono in legno e vetro con persiane e scuri in legno b) Impianti tecnici riscaldamento: Autonomo. acqua calda sanitaria: a gas centralizzato. L’appartamento è in ottimo stato manutentivo. L\'appartamento espone ad est con sole prettamente nella mattinata e nelle prime ore del pomeriggio è molto silenzioso.', '€ 380.000', NULL, '4 locali', '93 m2', '1 bagni', '4 piano', 'SGimmobiliare', '06 2780 1545,328 0507 993', 'EK-74603232', '22/11/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(120, '76381994', 'Trilocale via Etruria, Roma', 'https://www.immobiliare.it/annunci/76381994/', 'San Giovanni-Piazza Tuscolo, nei pressi della metro A San Giovanni, Re di Roma e metro C. In Via Etruria proponiamo, in stabile anni \'50, un immobile di 65 mq circa posto al secondo piano. L\'appartamento, che gode di una doppia esposizione, risulta essere luminoso ed è così composto: ingresso, corridoio, soggiorno, camera matrimoniale, cameretta, cucina semiabitabile, bagno, rispostiglio e 2 balconi. L\'immobile è termoautonomo. Locato fino a Dicembre 2019. Ottimo anche per uso investimento.', '€ 290.000', NULL, '3 locali', '64 m2', '1 bagni', '2 piano', 'Affiliato Tecnocasa: MEDIAZIONI SAN GIOVANNI S.R.L. SOCIO UNICO', '06 7720 6070', '40230584', '13/11/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(121, '71195442', 'Trilocale piazza Asti, Roma', 'https://www.immobiliare.it/annunci/71195442/', 'In zona Re Di Roma e con maggior precisione a Piazza Asti, la nostra agenzia promuove un trilocale di 105 mq, posto al terzo piano servito da ascensore. L\'unità abitativa si compone di un ampio ingresso finestrato, soggiorno, cucina abitabile, due camere da letto, ripostiglio e balcone. Dispone di riscaldamento autonomo che ottimizza fortemente i consumi e i relativi costi durante il periodo invernale. Si presente in generale buono stato. L\'immobile è ubicato in contesto caratterizzato dalla presenza di istituti bancari, negozi vari, supermercati e scuole; la posizione strategica nonchè i numerosi servizi rendono particolarmente interessante questa proposta immobiliare. Prezzo di richiesta euro 375.000 MEDIAZIONI IMMOBILIARI mette a vostra disposizione la sua esperienza nel settore immobiliare maturata nel corso degli anni, la sua cortesia e competenza. La nostra volontà di offrirvi servizi di livello sempre alto rendono semplice la compravendita e l\'affitto di immobili,guidandovi e consigliandovi con cura e trasparenza in tutte le fasi della trattativa fino alla realizzazione finale.', '€ 375.000', '€ 380.000', '3 locali', '105 m2', '1 bagni', '3 piano', 'MEDIAZIONI IMMOBILIARI', '06 9450 2335', 'EK-71195442', '16/12/2019', 'REJECTED fuori zona prescelta \nfuori zona prescelta', 0, 'DELETED'),
	(122, '73329658', 'Trilocale via Tracia, Roma', 'https://www.immobiliare.it/annunci/73329658/', 'Via Tracia, a pochi passi da Piazzale Metronio, in una zona ricca di attività commerciali, negozi, ristoranti, bar e parchi, immersi nel verde e nella tranquilla zona di Largo Pannonia, proponiamo in esclusiva la vendita di un appartamento posto al terzo piano con ascensore in un palazzo con servizio di portierato e curati giardini condominiali. L’immobile si presenta da ristrutturare, suddiviso internamente da un ampio ingresso, soggiorno, due camere, cucina, bagno e balcone. Doppia esposizione con affacci molto luminosi e ariosi nonché silenziosi. Vicine le importanti via Gallia, grazie alla quale è possibile raggiungere Via della Navicella e quindi il centro storico di Roma in pochissimi minuti, e Via Druso che vi condurrà alle Terme di Caracalla, al Parco di Porta Capena e ammirare le innumerevoli bellezze storiche della Capitale.', '€ 380.000', NULL, '3 locali', '85 m2', '1 bagni', '3 piano', 'Affiliato Tecnocasa: STUDIO SAN GIOVANNI METRONIO S.R.L.', '06 9450 2091', '40165168', '01/10/2019', 'fuori zona prescelta', 0, 'REJECTED'),
