	(124, '74203064', 'Appartamento via Ercolano, Roma', 'https://www.immobiliare.it/annunci/74203064/', '-Zona San Giovanni/Piazza Tuscolo-Via Ercolano- In palazzo signorile anni Trenta con servizio di ascensore,proponiamo la vendita di un appartamento situato al terzo piano in ottimo stato interno. La casa è composta da ingresso che ci introduce:sulla destra alle due camere con vista esterna su Via Ercolano; sulla sinistra,il corridoio finestrato,ci accompagna in sequenza alla cucina abitabile,bagno e alle due camere da letto con esposizione su corte condominiale.... Grazie alla tripla esposizione l\'appartamento beneficia di buona luminosità durante tutto il corso della giornata e di ottima silenziosità. Ubicata a pochi passi da aree ben servite da negozi, locali commerciali, mezzi di trasporto e scuole, la casa è ideale per famiglie e ad uso investimento...', '€ 349.000', NULL, '5 locali', '96 m2', '1 bagni', '3 piano', 'Affiliato Tecnorete: STUDIO IMMOBILIARE MERULANA SRL', '06 6936 6239,392 3432 243', '40184491', '20/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(125, '77058612', 'Trilocale via Albalonga 23, Roma', 'https://www.immobiliare.it/annunci/77058612/', 'Appia Nuova Piazza Re di Roma e precisamente in VIA ALBALONGA 23 vendesi appartamento situato al quinto piano con ascensore all\'interno di uno stabile d\'epoca appena risrutturato e con servizio di portineria. L\'appartamento è ubicato in un quartiere ricco di servizi di ogni genere, ogni tipo di negozio, mezzi di trasporto tra cui la Metropolitana fermata Re di Roma che pemettono di raggiungere qualsiasi parte dell città in poco tempo. Composizione interna: ingresso, 3 camere da letto, corridoio, cucina abitabile, bagno e due balconi, doppia esposizione, molto luminoso essendo esposto a Sud. L\'appartamento è da ristrutturare ed offre quindi la possibilità di personalizzare gli spazi interni a proprio gusto. L\'appartamento sarà libero dai primi di marzo 2020. Euro 379000. Per maggiori informazioni rivolgersi a CASAMIA IMMOBILIARE 06.91939145 - 342.8998873 - 3931972107', '€ 379.000', NULL, '3 locali', '90 m2', '1 bagni', '5 piano', 'CASAMIA IMMOBILIARE', '06 9193 9145,393 1972 107', 'Piazza Re di Roma Trilocale', '06/11/2019', 'fuori zona prescelta', 0, 'DELETED'),
