	(128, '77420730', 'Trilocale via Carlo Sigonio, Roma', 'https://www.immobiliare.it/annunci/77420730/', 'A pochi passi dalla fermata della metro linea A Furio Camillo, UniCredit Subito Casa propone in vendita un appartamento posto al secondo piano di uno stabile servito di ascensore. L’ immobile si compone di un ampio ingresso, un soggiorno con balcone ed affaccio molto aperto, una cucina abitabile, una camera da letto, una cameretta con finestra ed un servizio con finestra. Grazie alla doppia esposizione, su strada e su corte interna, l\'appartamento si presenta allo stesso tempo luminoso e silenzioso. Per valutare la proposta commerciale personalizzata sulle vostre esigenze, è possibile chiamare il numero verde di UniCredit Subito Casa 800.896.968', '€ 298.000', NULL, '3 locali', '75 m2', NULL, '2 piano', NULL, NULL, '(1997963)', '22/11/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(129, '76644934', 'Quadrilocale via APPIA NUOVA, 359, Roma', 'https://www.immobiliare.it/annunci/76644934/', 'Roma - Alberone - QUADRILOCALE IN CONTESTO STORICO A DUE PASSI DALLA METRO In Via Appia Nuova 359, in un contesto STORICO del 1927 realizzato dall\'Architetto Camillo Palmerini, Remax Maison presenta la vendita di un appartamento di circa 105mq. Posto al Quarto Piano, risulta così composto: INGRESSO, SALONE, CUCINA, BAGNO, 2 CAMERE E CAMERETTA. L\'ottima e TRIPLA ESPOSIZIONE garantisce luce ad ogni ora del giorno e l\'affaccio sugli ariosi GIARDINI condominiali, perfetti per lasciar giocare i bambini e ristorarsi sedendo all\'aria aperta. L\'appartamento è da ristrutturare e la presenza di un\'unica tramezzatura portante permette una ridistribuzione ottimale degli ambienti. La posizione è davvero strategica: metropolitana a 150m, centro commerciale Happio a 180m, stazione Tuscolana a 500m, più ogni genere di servizio, dalle scuole alle banche passando attraverso il parco di Villa Lazzaroni. A pochi passi dall\'Alberone e dal mercato. la casa è perfetta per chi desidera un QUARTIERE vivo ed AUTENTICO. Alcune parti del complesso sono state valutate di interesse artistico/architettonico e sono sotto tutela dei Beni Culturali. L\'immobile è in categoria catastale A/4, pertanto si può usufruire delle agevolazioni Prima Casa. A completare la proprietà troviamo una cantina di pertinenza.', '€ 370.000', NULL, '4 locali', '120 m2', NULL, '4 piano', 'RE/MAX Maison', '06 6228 6670', 'T426', '17/12/2019', 'costoso', 0, 'DELETED'),
