	(131, '77403104', 'Trilocale via Taranto, Roma', 'https://www.immobiliare.it/annunci/77403104/', 'San Giovanni, Appartamento in Vendita, adiacente Piazza Re di Roma. In comprensorio nel verde piano alto libero tranquillo luminoso ottimo stato. Soggiorno con cucina a vista due camere e bagno. Dilazioni - Permute. Rif. 1338S - Tel. 06.69353612 Apartment for sale, adjacent to Piazza Re di Roma. In the green area free high floor quiet bright excellent condition. Living room with open kitchen two bedrooms and bathroom. Appartement à vendre, adjacent à la Piazza Re di Roma. Dans la zone verte libre étage élevé calme brillant excellent état. Séjour avec cuisine ouverte deux chambres et salle de bain. Apartamento en venta, junto a la Piazza Re di Roma. En la zona verde libre piso alto tranquilo luminoso excelente estado. Salón comedor con cocina abierta de dos dormitorios y baño.', '€ 359.000', NULL, '3 locali', '80 m2', '1 bagni', '5 piano', 'Bovi RE', '06 8396 4019', '1338S', '19/11/2019', 'fuori zona prescelta', 0, 'REJECTED'),
