	(165, '77746300', 'Quadrilocale via Enea, Roma', 'https://www.immobiliare.it/annunci/77746300/', 'Via Enea - OCCUPATO - Nelle immediate vicinanze di Via Appia, proponiamo in vendita ampio Quadrilocale di 116 mq affittato con scadenza contratto il 31/08/2022. L\'immobile è posto al primo piano di una palazzina in tinta ed è composto da ingresso, soggiorno, tre camere da letto, cucina abitabile, bagno, ripostiglio e tre balconi. Collegato con ogni tipo di servizio come la metro linea \'A\' di Furio Camillo che dista quattro minuti a piedi, inoltre è vicino a locali commerciali e supermercati.', '€ 259.000', NULL, '4 locali', '116 m2', '1 bagni', '1 piano', 'AFFILIATO TECNOCASA: STUDIO SMA UNO SRL', '06 7803 661,06 7825 790', '40254719', '20/12/2019', 'primo piano', 0, 'DELETED'),
