	(169, '71818484', 'Trilocale via delle Cave, Roma', 'https://www.immobiliare.it/annunci/71818484/', 'COLLI ALBANI (Via delle Cave) A due passi dalla Metro A Colli Albani abbiamo il piacere di proporvi la vendita di un immobile posto al sesto di sette piani di una palazzina anni ’50 in ottimo stato di manutenzione di 75 mq composto da: ampio ingresso, 3 camere da letto matrimoniali, cucinotto, tre bagni con accesso esclusivo dalle camere, 2 balconi. Esposizione: doppio affaccio sia esterno che interno. Riscaldamento: autonomo. Rifiniture: impianto di climatizzazione. Ottimo uso investimento. Note: la distribuzione degli ambienti rende questa soluzione ancora più adatta per strutture ricettive. Spese condominiali 50 euro mensili. Informazioni Catastali: Classe A/3, rendita € 620,00 Per informazioni e visite rivolgersi alla Consulente Immobiliare Dalila Urbano cell. 328.2826118 – 329.4930445', '€ 290.000', NULL, '3 locali', '75 m2', '3 bagni', '6 piano', 'Urbano Immobiliare', '06 9450 6712', 'EK-71818484', '19/11/2019', 'bilocale', 0, 'REJECTED'),
