	(176, '77716378', 'Trilocale via Cividale del Friuli 13, Roma', 'https://www.immobiliare.it/annunci/77716378/', 'Appia Nuova - Ponte Lungo vicinissimo alla metropolitana e ai tantissimi negozi e servizi che questo centrale quartiere può offrire, vi proponiamo in vendita un appartamento sito al 3°piano di una palazzina con ascensore e con regolare licenza di costruzione e certificato di agibilità. Le spese condominiali insieme a quelle del riscaldamento ammontano a soli €35 mensili perchè c\'è un appartamento condominiale affittato che riduce di molto le spese di gestione condominiali. Composizione e caratteristiche dell\'appartamento: ampio ingresso, 3 ampie camere matrimoniali, cucina abitabile, bagno, balcone, rispostiglio, grande armadio a muro, soppalco, infissi con doppi vetri a taglio termico, climatizzatori, porta blindata con cilindro europeo, luminoso e silenzioso. APE CLASSE F Riscaldamento centralizato con caldaia a condensazione e dotato di valvole contabilizzatori dei consumi. L\'immobile è ubicato in un quartiere caratterizzato dalla presenza di supermercati, negozi vari, parchi, scuole e a pochi passi dal Nuovo Centro Commerciale HAPPIO e molto vicino anche la stazione ferroviaria Tuscolana. La posizione strategica nonchè i numerosi servizi rendono particolarmente interessante questa proposta immobiliare. Prezzo proposto in vendita Euro 359.000. Per maggiori informazioni ed eventuale appuntamento sul posto rivolgersi a CASAMIA IMMOBILIARE 06.91939145 - 349.6776290 - 393.1972107.', '€ 359.000', NULL, '3 locali', '85 m2', '1 bagni', '3 piano', 'CASAMIA IMMOBILIARE', '06 9193 9145,393 1972 107', 'Appia Nuova Trilocale vicino la Metro', '02/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(177, '74335830', 'Trilocale via via della stazione tuscolana 0, Roma', 'https://www.immobiliare.it/annunci/74335830/', 'Rif: 2019 - Villa Fiorell:i in palazzo restaurato, proponiamo appartamento al quarto piano da ristrutturare composto da: grande soggiorno open-space due camere matrimoniali, grande cucina abitabile, bagno e balcone. L\'appartamento gode di due esposizioni una esterna e l\'altra in un cortile interno. E\' possibile realizzare un secondo bagno di servizio e un grande ripostiglio.L\'appartamento e\' silenzioso gode di una bella vista , a due minuti dall\'isola pedonale di Villa Fiorelli e adiacente via della Stazione Tuscolana dove si parcheggia con facilita\'. Non ha affacci sulla ferrovia e non risente del rumore del passaggio treni. Il quartiere resta un fiore all\'occhiello di tutta la zona e pur essendo residenziale e schermato dal caos cittadino e\' servitissimo e a pochi passi dal centro storico. DA VEDERE!', '€ 320.000', NULL, '3 locali', '85 m2', '1 bagni', '4 piano', 'Taloni Immobiliare di Alfredo Taloni', '06 9450 6586', '2019 (1892635)', '17/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
