	(180, '77646612', 'Trilocale via Germano Sommeiller, Roma', 'https://www.immobiliare.it/annunci/77646612/', 'Rif: MF2811 - Santa Croce in Gerusalemme, in Via Germano Sommelleir, a 650 metri dalla metro di Manzoni e San Giovanni, in una zona ben servita da ogni tipo di attività commerciale, proponiamo la vendita di un appartamento posto al 2°piano di 5 in una palazzina d\'epoca del 1914 con ascensore. L’appartamento, completamente da ristrutturare, è di circa 80 mq con tripla esposizione e soffitti alti 3,60 metri. L\'immobile è composto da un lungo corridoio, soggiorno di 19 mq con doppio affaccio angolare, due camere rispettivamente di 16 mq e 11 mq (con soppalco), cucina di 10 mq (con un secondo piccolo soppalco), un bagno. Il riscaldamento è autonomo le spese condominiali ammontano a € 60,00 mensili. Cl en G La richiesta è di € 299.000,00 Rif MF2811 Tel. 0677250085 Cell. 3891944975 www.gruppomd.com', '€ 299.000', NULL, '3 locali', '80 m2', '1 bagni', '2 piano', 'GruppoMD srl', '06 7725 0085,389 1944 975', 'MF2811 (2617469)', '19/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(181, '77733026', 'Trilocale via Appia Nuova 801, Roma', 'https://www.immobiliare.it/annunci/77733026/', 'TRILOCALI DI 110 MQ, BILIVELLI, con terrazzo di 25 mq e cantina, inoltre possibilità di posto auto scoperto e box auto, ad € 299.000,00 trattabili ed interamente mutuabili. APPIA NUOVA: a 2 km dalla Metro Colli Albani e a 5 km dal GRA, proponiamo in vendita Appartamenti Nuova Costruzione ANTISISMICA, in classe "B" in vari tagli e tipologie, in complesso residenziale appena realizzato immerso nel verde, di fronte al Rome Golf Club. Il complesso immobiliare beneficia di: * Pannelli solari e caldaia centralizzata di ultima generazione per il riscaldamento e la produzione di acqua calda sanitaria. * Pannelli fotovoltaici per la produzione di energia elettrica a servizio degli spazi condominiali (scale, androne, illuminazione garage, illuminazione esterna, etc.). Tutti gli appartamenti, inoltre, dispongono di: * Portoncino d\'ingresso blindato. * Infissi esterni in doppio vetro camera e persiane di sicurezza esterne in ferro. * Infissi interni Scrigno. * Impianto di climatizzazione inverter classe A in tutti gli ambienti. * Barbecue e presa d\'acqua sul terrazzo. * Videocitofono ed impianto d\'allarme antintrusione con rilevatore di gas. * Pavimentazioni, rivestimenti e tutti i materiali impiegati sono di prima scelta. Per info e visite sul loro, contattateci. Tel. 06 7020300, cell. 333 9353152, email: roma.appio@grimaldifranchising.it, sito web: www.grimaldiappio.it . Ci presentiamo ed illustriamo la professionalità del nostro modus operandi che da 60 anni ci contraddistingue consentendoci di essere la Società Immobiliare leader del mercato. L\'agenzia Grimaldi di Roma sita in via Appia Nuova 227 opera, da 30 anni, esclusivamente nelle zone dell\'Appio sviluppando competenze e servizi finalizzati alla piena soddisfazione del cliente, con un approccio specialistico e personalizzato che lo accompagna in tutte quelle che sono le tappe necessarie per l\'acquisto del Suo immobile tra cui: • Consulenza Immobiliare "ad personam"; • Consulenza Tecnico-Legale in base alle Sue necessità; • Specialisti dedicati alla consulenza finanziaria; • Notaio in sede; Grazie alla perfetta conoscenza della zona abbiamo recentemente concluso con successo diverse intermediazioni immobiliari continuando ad evidenziare un portafoglio appartamenti di varie metrature. Qualora Lei decidesse di affidarsi alla nostra professionalità e competenza per l\'acquisto del Suo immobile saremmo lieti di offrirLe la nostra consulenza gratuita e senza impegno per illustrarle come l\'organizzazione Grimaldi possa concludere l\'operazione con il miglior risultato e la Sua piena soddisfazione.', '€ 299.000', NULL, '3 locali', '110 m2', '1 bagni', '2 piano', 'Grimaldi Roma Appio', '06 7020 300,333 9353 152', 'VIA.APPIA.NUOVA.BILIVELLI.2019', '03/12/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(182, '77863918', 'Trilocale via Casilina 87, Roma', 'https://www.immobiliare.it/annunci/77863918/', 'LODI-LABICANO / TRILOCALE CON BALCONE Nel primo tratto di Via Casilina, adiacente all’attivissimo quartiere di San Giovanni, a pochi passi dalla nuovissima stazione metropolitana Linea C , con estrema precisione in Via Casilina 87, CONCEPT HOME cura la vendita di un trilocale da ristrutturare posto al terzo piano di una graziosa palazzina in tinta sviluppata su 6 livelli. Il medesimo internamente si presenta composto da : Ingresso, salone, cucina abitabile, camera matrimoniale, cameretta, servizio e balcone con affaccio interno sul distacco condominiale. - Riscaldamento centralizzato L’immobile data la regolarità della sua planimetria si presta a una diversa distribuzione degli spazi interni, in base alle necessità dell’ipotetico acquirente. La posizione dell’immobile risulta essere strategica sia sotto il punto di vista del trasporto pubblico, sia per quanto concerne i collegamenti viari, il medesimo infatti si trova vicino alla Tangenziale a via Castrenze , tramite le quali è possibile raggiungere con estrema facilità qualsiasi punto della città. La zona è eccellentemente servita da ogni esercizio di prima necessità, con scuole, farmacie, supermercati a pochi passi dall’unità immobiliare in oggetto. Acquistare questo immobile potrebbe inoltre rappresentare un ottimo investimento, grazie alle numerose richieste di locazione in zona da parte di studenti e lavoratori. Qualunque sia la Vostra esigenza immobiliare, inviateci una e-mail all’indirizzo sanpaolo@concepth.it o visitate il nostro sito https://www.concepth.it. CONCEPT HOME Sentirsi di Casa.', '€ 275.000', NULL, '3 locali', '95 m2', '1 bagni', '3 piano', 'Concept Home San Paolo', '06 9450 2406', 'T364', '09/12/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(183, '77877458', 'Trilocale via Pordenone, 21, Roma', 'https://www.immobiliare.it/annunci/77877458/', 'Roma - San Giovanni - Re di Roma - Luminoso piano terzo affacci aperti. In ottimo stabile proponiamo in vendita ampio trilocale ristrutturato composto da Ingresso, Soggiorno, Cucina, 2 Camere, 1 Servizio e 1 Balcone. Termo autonomo, infissi nuovi doppio vetro con ribalta, impianti a norma e certificati. assolutamente da vedere. REMAX MAISON Perchè VENDERE LA TUA CASA CON RE/MAX? Non importa se vuoi vendere il tuo appartamento, la tua casa, un immobile commerciale o terreni: abbiamo l\'agente giusto per te! Più di 111.000 agenti in 100 paesi di tutto il mondo, di cui ben 2.000 in Italia, ti aiuteranno a vendere la tua proprietà al miglior prezzo possibile e nel più breve periodo di tempo. 96 clienti su 100 si dichiarano soddisfatti dei servizi offerti dagli Agenti RE/MAX. TUTTI I VANTAGGI DI AFFIDARTI A RE/MAX 1. AGENTI ESPERTI TI SUPPORTERANNO DALL\'INIZIO ALLA FINE E, ADDIRITTURA, DOPO IL PROCESSO DI VENDITA Non è assolutamente facile vendere una casa. Ci sono molti aspetti da considerare che il proprietario di un immobile può trascurare poiche’ manca l\'esperienza adeguata. Scegliere RE/MAX, significa avvalersi dell\'esperienza di un Agente altamente professionale che ti supporterà durante l\'intero processo di vendita, garantendoti il massimo risultato. A partire dal prezzo corretto cui proporre al mercato il tuo immobile, alla gestione di tutta la documentazione e di tutte le pratiche burocratiche per ottemperare alla legge, l\'Agente RE/MAX renderà più semplice possibile il processo di vendita. Inoltre RE/MAX offre una vasta gamma di servizi pre e post vendita, in grado di soddisfare ogni tipo di esigenza. 2. INIZIATIVE DI MARKETING DI PROVATA EFFICACIA Gli Agenti RE/MAX metteranno in pratica il giusto mix tra una vasta gamma di iniziative e pubblicità , selezionando gli strumenti più efficaci per vendere la tua casa. Il tutto capitalizzando la forza di un marchio che attira acquirenti qualificati non solo dall\'Italia, ma da ogni parte del mondo. Grazie al nostro innovativo modello di vendita fondato sulla collaborazione tra Agenti, la tua casa non solo avrà massima visibilità all\'interno del Network RE/MAX, ma anche tra tutti i professionisti del settore immobiliare, riducendo cosi in modo significativo i tempi di vendita. 3. UNA RETE INTERNAZIONALE DI PROFESSIONISTI ALTAMENTE QUALIFICATI DEL SETTORE IMMOBILIARE LOCALE RE/MAX è il più grande network immobiliare di tutto il mondo e beneficia della grande collaborazione tra Agenzie che hanno Agenti esperti del mercato locale dedicati a soddisfare le esigenze dei clienti del mercato di riferimento. L\'Agente RE/MAX ha la giusta esperienza per lavorare in diverse dinamiche di mercato ed è in grado di consigliarti il giusto prezzo per massimizzare il profitto. L\'Agente RE/MAX può negoziare per tuo conto, facilitare il superamento delle barriere logistiche e legali, nonchà© velocizzare i tempi di vendita. 4. OLTRE 40 ANNI DI ESPERIENZA E DI ECCELLENZA Da oltre 40 anni, noi di RE/MAX', '€ 359.000', NULL, '3 locali', '75 m2', '1 bagni', '3 piano', 'RE/MAX Maison', '06 6228 6670', 'T340', '17/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(184, '74925420', 'Trilocale via Giovanni Botero, Roma', 'https://www.immobiliare.it/annunci/74925420/', 'Nel quartiere Appio Latino, adiacente alla metropolitana Colli Albani, proponiamo in vendita esclusiva un appartamento sito al quinto piano con ascensore in una palazzina in cortina di sette. La proprietà è situata in posizione luminosa e silenziosa e vanta un’ottima distribuzione degli spazi interni. L’appartamento attualmente si compone di un ingresso molto ampio con ripostiglio che apre sul salone, in seguito tramite un comodo disimpegno troviamo due camere da letto, una cucina abitabile, un bagno con vasca e un balcone. L’immobile risulta già ristrutturato con pavimenti in gres porcellanato, infissi in PVC doppio vetro, aria condizionata, il riscaldamento è termoautonomo con la presenza della caldaia posizionata nel balcone. Un’ottima soluzione per le famiglie che apprezzano il silenzio e la luminosità di un appartamento situato al piano alto. Le presenti informazioni e planimetrie sono meramente indicative e non costituiscono elementi contrattuali. Rif. W-02FAZY - Leonard Cervischi - Tel. +39 06 45 54 81 20', '€ 360.000', NULL, '3 locali', '90 m2', '1 bagni', '5 piano', 'Engel & Völkers Roma • Market Center', '06 4554 8120', 'W-02FAZY - S11', '20/12/2019', 'costosa', 0, 'REJECTED'),
