e l\'organizzazione Grimaldi possa concludere l\'operazione con il miglior risultato e la Sua piena soddisfazione.', '€ 369.000', NULL, '4 locali', '130 m2', '1 bagni', '2 piano', 'Grimaldi Roma Appio', '06 7020 300,333 9353 152', 'VIA.GELA', '14/11/2019', 'no balconi', 0, 'REJECTED'),
	(186, '76471022', 'Trilocale via Numitore, Roma', 'https://www.immobiliare.it/annunci/76471022/', 'Rif: G137 - NEL CUORE DELL\'APPIO LATINO, in Via Numitore, in palazzina signorile, proponiamo la vendita di un appartamento al piano intermedio, luminoso, completamente e finemente ristrutturato, composto di ingresso, salone, due camere matrimoniali, cucina abitabile con balconcino, bagno, comodo ripostiglio e un terrazzino vivibile. L’immobile si presenta in ottimo stato interno, porta blindata, predisposizione antifurto, infissi in alluminio ultima generazione con doppi vetri, inferriate, impianto di condizionamento aria calda / fredda. L’immobile gode di una particolare luminosità e si trova in una zona servitissima e ben collegata, sia al centro storico che alla periferia, grazie a diverse linee bus e alla metro A Colli Albani. Eccellente posizione a pochi passi dal bellissimo ed attrezzato parco della Caffarella, da Villa Lazzaroni e dal nuovo centro commerciale Happio. Euro 379.000,00 Rif. G137 Tel. 06/700.88.92 www.ferrariemeriziola.it', '€ 379.000', NULL, '3 locali', '90 m2', '1 bagni', '4 piano', 'FEM SRL', '06 7008 892', 'G137 (2595341)', '15/10/2019', 'costosa', 0, 'DELETED'),
	(187, '77523648', 'Trilocale via di Vigna Fabbri, Roma', 'https://www.immobiliare.it/annunci/77523648/', 'In zona Appio Latino, Via di Vigna Fabbri, in palazzina degli anni \'50 di 4 piani in tinta con ascensore, proponiamo la vendita di un trilocale di 72 metri quadri circa, sito al II piano. Internamente si compone di ingresso, soggiorno, cucina abitabile, camera da letto matrimoniale, cameretta, doppi servizi e due balconi di 6 e 2 metri quadri circa (con accessi dalle camere da letto). L\'appartamento è completamente ristrutturato, con pavimenti in parquet, infissi in alluminio con doppi vetri e porta blindata. Climatizzato. L\'esposizione è ad Est/Ovest. Il riscaldamento è termoautonomo. Le spese condominiali sono di Euro 195 trimestrali. Classe Energetica G - IPE 175', '€ 349.000', NULL, '3 locali', '72 m2', '2 bagni', '2 piano', 'Aureli Immobiliare', '06 7834 7464', 'CE-1918', '18/12/2019', 'costosa', 0, 'DELETED'),
	(188, '75027834', 'Trilocale via Eurialo 64, Roma', 'https://www.immobiliare.it/annunci/75027834/', 'Via Eurialo Abbiamo il piacere di proporre la vendita di questo esclusivo Appartamento situato tra i due polmoni dell\'Appia : Villa Lais e Villa Lazzaroni e a 10 minuti a piedi dalla stazione metropolitana linea A fermata Furio Camillo. Siamo collocati a ridosso del centro storico, quartiere Residenziale, ma anche particolarmente ricco di attività commerciali. L\'appartamento si trova ad un quarto piano di una palazzina ristrutturata recentemente, di sei piani , con ascensore. Si sviluppa per 90 mq ed è composto da un Ingresso, Soggiorno, due Camere, Cucina Abitabile, servizio e Balcone con affaccio riservato e tranquillo. Possibilità di acquistare a parte un Box Auto singolo di 16 mq a 900 metri dalla casa. Grazie al piano di elevazione e ad un ottima esposizione sud-ovest, l\'immobile gode di riservatezza e luminosità. La posizione logistica strategica e gli spazi comodi costituiscono i punti di forza di questa Casa che si presta perfettamente ad accogliere coloro che amano avere tutti i servizi a portata di mano. Cosa aspetti, prenota la tua visita!!', '€ 349.000', NULL, '3 locali', '90 m2', '1 bagni', '4 piano', 'RE/MAX Property', '06 9480 3040', 'Via Eurialo 64', '14/11/2019', 'costeggia la ferrovia - fuori zona prescelta', 0, 'DELETED'),
	(189, '76258926', 'Trilocale via di Villa Aquari, Roma', 'https://www.immobiliare.it/annunci/76258926/', 'In zona Appio Latino, Via di Villa Aquari, in palazzina di 5 piani del 1960 con ascensore, proponiamo la vendita di un trilocale di 100 metri quadri circa, sito al IV piano. Internamente si compone di un\'ampia zona relax con finestra, soggiorno, due camere da letto matrimoniali, cucina abitabile, doppi servizi, ripostiglio ed un balcone di 3 metri quadri circa. L\'appartamento si presenta in buono stato. Ha un\'esposizione a Sud/Est, con affaccio sul distacco condominiale. Il riscaldamento è centralizzato con termocontabilizzatori, con predisposizione per l\'autonomo. Le spese condominiali sono di Euro 66 mensili circa, quelle di riscaldamento sono di Euro 400 annui. Classe Energetica G - IPE 175', '€ 380.000', NULL, '3 locali', '100 m2', '2 bagni', '4 piano', 'Aureli Immobiliare', '06 7834 7464', 'CE-1881', '17/10/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(190, '77648496', 'Trilocale via Albalonga 23, Roma', 'https://www.immobiliare.it/annunci/77648496/', 'Appia Nuova Piazza Re di Roma e precisamente in VIA ALBALONGA 23 vendesi appartamento situato al quinto piano con ascensore all\'interno di uno stabile d\'epoca appena risrutturato e con servizio di portineria. L\'appartamento è ubicato in un quartiere ricco di servizi di ogni genere, ogni tipo di negozio, mezzi di trasporto tra cui la Metropolitana fermata Re di Roma che pemettono di raggiungere qualsiasi parte dell città in poco tempo. Composizione interna: ingresso, 3 camere da letto, corridoio, cucina abitabile, bagno e due balconi, doppia esposizione, molto luminoso essendo esposto a Sud. L\'appartamento è da ristrutturare ed offre quindi la possibilità di personalizzare gli spazi interni a proprio gusto. L\'appartamento sarà libero dai primi di marzo 2020. Euro 379000 TRATTABILI. Per maggiori informazioni rivolgersi a CASAMIA IMMOBILIARE 06.91939145 - 342.8998873 - 3931972107', '€ 379.000', NULL, '3 locali', '90 m2', '1 bagni', '5 piano', 'CASAMIA IMMOBILIARE', '06 9193 9145,393 1972 107', 'Appia Nuova Piazza Re di Roma trilocale vicino la Metro', '29/11/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(191, '77865068', 'Trilocale via Mesopotamia, Roma', 'https://www.immobiliare.it/annunci/77865068/', 'L\'agenzia immobiliare di Barbara Scafi gestisce la vendita di delizioso trilocale sito in via mesopotamia a 200 metri dal parco della caffarella e ad 1 km dalla fermata metro ponte lungo.L\'appartamento e\' sito al terzo piano di una palazzina in cortina con ascensore composto da ingresso con armadio a muro soggiorno a vista cucina abitabile due camere da letto un bagno. Completa la proprietà due balconcini uno in camera da letto e l\'altro in soggiorno. L\'appartamento ha parquet in tutti gli ambienti tranne cucina e bagno. Molto comoda l\'ubicazione visto al vicinanza a negozi di ogni genere, bus e a 200 metri dal bellissimo parco della caffarella. Prezzo richiesto € 260000,00 Per info e appuntamenti 3331709439 oppure inviare mail barbarascafi@gmail.com', '€ 260.000', '€ 280.000', '3 locali', '73 m2', '1 bagni', '3 piano', 'Immobiliare Barbara Scafi', '333 1709 439', 'Via mesopotamia', '11/12/2019', 'REJECTED fuori zona prescelta \nfuori zona prescelta', 0, 'REJECTED'),
	(192, '76472400', 'Trilocale ottimo stato, sesto piano, Roma', 'https://www.immobiliare.it/annunci/76472400/', 'Via Astura: Nel cuore del quartiere di San Giovanni, a due passi da Piazza Re di Roma e da Piazza Tuscolo, luminoso e funzionale trilocale completamente ristrutturato in comprensorio d\'epoca dotato di servizio di portierato e con un accogliente cortile caratterizzato da ampie aree verdi. L\'appartamento, posto ad un sesto piano, è composto da un ampio ingresso, un soggiorno con angolo cottura , 2 camere da letto, bagno con doccia ed un ripostiglio. L\'immobile, che è stato completamente ristrutturato nel 2015/2016, presenta le seguenti finiture/dotazioni: infissi con doppio vetro, persiane in alluminio con lamelle orientabili, pavimenti in gres porcellanato effetto parquet, porta blindata e caldaia per l\'acqua calda. Il riscaldamento è centralizzato con contabilizzatori di calore. Il comprensorio in cui è ubicato l\'immobile è stato edificato negli anni 1932-1938 ed oggi è annoverato tra quei complessi di edifici del Comune di Roma di rilevante interesse architettonico. Inoltre la zona è ottimamente servita sia per quanto riguarda i trasporti pubblici (le fermate della Metro A \'San Giovanni\'\' o \'Re di Roma\' sono facilmente raggiungibile a piedi ) che per quanto riguarda le attività commerciali (in particolare quelle di Via Appia Nuova). Ottima soluzione anche uso investimento (l\'immobile è stato adibito a struttura ricettiva con regolare autorizzazione per casa vacanza). L\'immobile sarà disponibile da Giugno 2020. Classe Energetica G - Indice Prestazione Energetica (IPE) : >175 Kwh/m2/anno', '€ 355.000', NULL, '3 locali', '78 m2', '1 bagni', '6 piano', 'Affiliato Tecnocasa: STUDIO RE DI ROMA S.R.L.', '06 7759 1919', '40232450', '16/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
