	(194, '77322722', 'Quadrilocale via La Spezia, Roma', 'https://www.immobiliare.it/annunci/77322722/', 'Nel cuore di San Giovanni in Via La Spezia appartamento al 4piano con doppia esposizione, ingresso corridoio, cucina abitabile, 2 stanze e bagno. Ottimo investimento e dotata di ottimi servizi di collegamento (Metro A e C) Rivoli Immobiliare 06/483456', '€ 325.000', '€ 330.000', '4 locali', '81 m2', '1 bagni', '4 piano', 'RIVOLI IMMOBILIARE SAS', '06 483 456,339 5803 757', 'EK-77322722', '20/12/2019', 'REJECTEDfuori zona prescelta\nfuori zona prescelta', 0, 'REJECTED'),
	(195, '76883614', 'Trilocale via del Velodromo, Roma', 'https://www.immobiliare.it/annunci/76883614/', 'COLLI ALBANI, precisamente in via del Velodromo, proponiamo la vendita di un appartamento in stabile signorile in ottimo stato all\'interno di un comprensorio residenziale con servizio di portineria. L\'immobile, in ottimo stato e molto luminoso, è composto da un ingresso, ampio salone, due camere, cucina abitabile, bagno, ripostiglio e due balconi. Possibilità di ricavare un secondo servizio. Possibilità cantina. Dilazioni e Permute. Uemme immobiliare è una società leader nel settore della compravendita d\'immobili, è un gruppo formato da consulenti specializzati che con entusiasmo, passione e volontà hanno costruito giorno dopo giorno un metodo vincente, basato sostanzialmente su valori chiari e assoluti: professionalità, efficienza e trasparenza, caratteristiche che le hanno permesso negli anni di diventare una solida certezza del mercato immobiliare. La cura che Uemme presta nello svolgimento del proprio lavoro, garantisce un prodotto e un servizio di qualità superiore, sempre più completo e personalizzato, volto a soddisfare le esigenze del cliente, seguendolo attentamente nelle varie fasi della compravendita e della locazione di immobili, divenendo consulenti di fiducia e vero punto di riferimento nel complesso mercato immobiliare.', '€ 299.000', NULL, '3 locali', '85 m2', '1 bagni', '3 piano', 'UEMME immobiliare srl', '06 8718 0470', '2185', '21/11/2019', 'prezzo e planimetria buona. Sembra essere ristrutturato da poco ma bisogna di rinnovo. Possibile abuso edilizio tra salone e corridoio (altezza termosifone) manca porta che c\'è in pianta', 0, 'SELECTED'),
	(196, '75584776', 'Trilocale piazza dell\'Alberone, Roma', 'https://www.immobiliare.it/annunci/75584776/', 'In zona Appia Nuova- Alberone, Piazza dell\'Alberone, a due minuti dalla metro Ponte Lungo, in stabile d\'epoca di 6 piani con ascensore in fase di ristrutturazione, IV piano di circa 100 mq, piu\' 2 balconi di 3 mq e 7 mq. Ingresso, 3 camere, cucina tinello, bagno e armadi a muro. Ottimo stato. I pavimenti sono in parquet, gli infissi in alluminio con doppi vetri, porte in noce e persiane. Doppia esposizione. Luminoso. Riscaldamento da rifare (Impianto riscaldamento autonomo nel palazzo) . Spese condominiali € 85,00 mensili. CL G 175 IPE.', '€ 379.000', NULL, '3 locali', '100 m2', '1 bagni', '4 piano', 'Aureli Immobiliare', '06 7107 7001', 'TU-417', '06/11/2019', 'costoso', 0, 'REJECTED'),
	(197, '76632738', 'Trilocale via Enea, Roma', 'https://www.immobiliare.it/annunci/76632738/', 'Appia Nuova-Ad.ze villa Lazzaroni. A pochi passi dalla splendida Villa Lazzaroni e dalla fermata metro "A" Furio Camillo, in uno stabile in cortina proponiamo, ad un prezzo davvero interessante, appartamento con doppia esposizione da ristrutturare composto da ampio ingresso, soggiorno, 2 camere, ampia cucina abitabile, bagno, ripostiglio, balcone. L\'ottima disposizione degli spazi interni offre la possibilità di creare un 2° piccolo servizio ed una 3° camera da letto. € 299.000 Rif. A15/19 tel. 06-78393965 Whastapp 334-1207397. Roma Gruppo Immobiliare è una società di intermediazione nata con un preciso obiettivo: quello di essere il punto di riferimento del cliente per risolvere qualsiasi problema di natura immobiliare nella città di Roma e Provincia, dalla semplice idea di acquisto, vendita o locazione, fino alla consegna delle chiavi! E\' formato da un team di professionisti qualificati e dinamici con esperienza pluriennale nel settore che sapranno trovare la giusta soluzione per ogni tipo di necessità, instaurando un rapporto di reale complicità con il cliente aiutandolo a realizzare il vero obiettivo e soddisfarlo in pieno. La nostra sede è in Via Enea n. 51, orari da lunedì al venerdì dalle 9.00 alle 19.00 e il sabato dalle 9.00 alle 12.45.', '€ 299.000', NULL, '3 locali', '97 m2', '1 bagni', '2 piano', 'Roma Gruppo Immobiliare', '06 7839 3965,334 1207 397', 'A15/19', '11/11/2019', 'REJECTED lo stabile ha un danno strutturale che fu risanato anni fa. Ma non ce la sentiamo di rischiare.\n[DA RISTRUTTURARE PROFONDAMENTE] planimetria assente e ricostruita dalle foto, quindi dubbia. Scaldabagno con poche possibilità di riposizionamento (anche in caso di caldaia). Riscaldamento centralizzato od autonomo?. Un solo balcone e forse piccolo.', 0, 'REJECTED'),
