	(199, '70500868', 'Trilocale via Coriolano 30, Roma', 'https://www.immobiliare.it/annunci/70500868/', 'Tuscolana - Furio Camillo, via Coriolano 30. A 500 m dalla Metro Furio Camillo, a 300 m dal parco verde di Villa Lazzaroni Immobiliare Roma Prati propone in vendita appartamento di 91 mq sito al piano 4 in stabile dotato di ascensore. Ingresso, corridoio, cucina abitabile, 3 camere, bagno, ripostiglio e 2 balconi (uno su via Coriolano). Cl En E. Euro 329.000. Per informazioni e per fissare un appuntamento potete contattare Immobiliare Roma Prati al numero telefonico 342 3335569 o scrivere all’indirizzo mail immobiliareromaprati@gmail.com. Se hai deciso di vendere il tuo immobile non esitare a contattarci! Immobiliare Roma Prati è la tua agenzia immobiliare per trovare e vendere casa a Roma. Cordialità, serietà, efficienza ed il rispetto di principi etici e professionali sono da sempre le prerogative del nostro brand e del nostro team. Uno staff composto da esperti del settore immobiliare che ti guiderà in tutte le fasi della compravendita e che ti permetterà in modo sereno di realizzare il tuo sogno!', '€ 329.000', '€ 365.000', '3 locali', '91 m2', '1 bagni', '4 piano', 'IMMOBILIARE ROMA PRATI', '06 9450 2081', 'Coriolano329', '16/04/2019', 'SELECTED diminuzione del prezzo, metratura e planimetria interessante\nREJECTEDcostoso\ncostoso', 0, 'SELECTED'),
	(200, '76186384', 'Trilocale via Mario Menghini, Roma', 'https://www.immobiliare.it/annunci/76186384/', 'rif: d207 - nelle immediate vicinanze della fermata metro a colli albani, e precisamente in via mario menghini, proponiamo la vendita di un trilocale (90 mq. circa) composto di un ampio ingresso, soggiorno con balcone, cucina, due camere da letto, bagno.', '€ 335.000', NULL, '3 locali', '90 m2', '1 bagni', '3 piano', 'RE/MAX Urbest', '06 9480 3186', 'D207 (2588640)', '17/12/2019', 'Planimetria mancante ma facilmente ricostruibile dalle foto. Immobile costoso e quindi da monitorare. Balconi su Appia. Stile antico quindi da ristrutturare molto.', 0, 'SELECTED'),
	(201, '77808282', 'Trilocale via Appia Nuova, Roma', 'https://www.immobiliare.it/annunci/77808282/', 'Rif: G160 - NEL CUORE DELL\'APPIO LATINO, adiacente a Piazza Cantù, a pochi passi dal Parco della Caffarella, in palazzina signorile, proponiamo la vendita di un appartamento molto luminoso e silenzioso, piano alto con suggestivo scorcio sul parco della Caffarella, composto di ampio ingresso, tre camere, cucina abitabile con annessa zona pranzo, bagno, disimpegno, un balcone ed un comodo terrazzino. Completa la proprietà un’ampia cantina. L’immobile, che gode di una particolare luminosità, presenta una pianta con due esposizioni e si presta agevolmente a diverse soluzioni abitative pratiche e funzionali. L’appartamento si trova in una zona servitissima e ben collegata, sia al centro storico che alla periferia, grazie a diverse linee bus e alla metro A Colli Albani. Eccellente posizione sulla via Appia, a pochi passi dal bellissimo ed attrezzato parco della Caffarella, da Villa Lazzaroni, dal nuovo centro commerciale Happio e dalla Stazione Tuscolana. € 359.000,00 Rif.G160 Tel.06/700.88.92 www.ferrariemeriziola.it', '€ 359.000', '€ 379.000', '3 locali', '90 m2', '1 bagni', '6 piano', 'FEM SRL', '06 7008 892', 'G160 (2620486)', '06/12/2019', 'REJECTEDcostoso\ncostoso', 0, 'REJECTED'),
