	(203, '75566920', 'Trilocale via Appia Nuova 503, Roma', 'https://www.immobiliare.it/annunci/75566920/', 'Vendo appartamento sito in via Appia Nuova nei pressi di via delle cave fronte villa Lazzaroni,Quartiere Appio Latino. Composto da cameretta, ampio salone, cucina, tinello, ingresso, corridoio, camera da letto matrimoniale, bagno, più due balconi uno in cucina l\'altro in camera matrimoniale. Il tutto per un totale di metri quadrati 95 più la cantina di 5 metri quadrati. A chi interessa mi può chiamare dopo le ore 17. Grazie', '€ 370.000', NULL, '3 locali', '95 m2', '1 bagni', '6 piano', '', 'https://media.immobiliare.it/text/tel_75566920_18753.jpg?k=f264d7ee746b9580907e8fa09cb18aef', 'EK-75566920', '05/12/2019', 'costoso', 0, 'DELETED'),
	(204, '76939804', 'Trilocale via delle cave, Roma', 'https://www.immobiliare.it/annunci/76939804/', 'via delle cave a due passi da tutti i principali servizi fermata metro A colli albani e capolinea ATAC raggiungibili a piedi circa 300 mt. supermercati banche e negozi di vario genere proprio sotto casa proponiamo in palazzina in buone condizioni con servizio di portineria appartamento posto al secondo piano in medie condizioni doppio affaccio est ed ovest luminoso cosi\' composto ampio ingresso salone due camere da letto studio/ampio ripostiglio cucina abitabile bagno due balconi gli infissi sono in doppio vetro pavimenti in marmo nell\'ingresso salone e camere cucina e bagno in ceramica portoncino blindato aria condizionata nel salone euro 279.000,00 per informazioni Rosario Incarbone 3927650804', '€ 279.000', NULL, '3 locali', '100 m2', '1 bagni', '2 piano', 'RoyalHouse', '06 9480 2343', '(2604453)', '31/10/2019', 'Via delle cave 34, Planimetria mancante ricostruibile dalle foto ma non precisa. Da ristrutturare. Appartamento in stile come via delle cave 70', 0, 'SELECTED'),
	(205, '74396002', 'Trilocale piazza Cesare Cantù 4, Roma', 'https://www.immobiliare.it/annunci/74396002/', 'Via Appia ad. via Delle Cave - Proponiamo in vendita Trilocale al secondo piano in stabile con giardino condominiale. L\'immobile sviluppa una superficie catastale totale di 76 mq ed è composto da ingresso, soggiorno, due camere da letto, cucina e bagno. Il tutto è ben collegato a ogni tipo di servizio come la metro linea \'A\' di colli albani che dista cinque minuti a piedi dall\'abitazione, inoltre vicina a locali commerciali, supermercati e istituti scolastici primari e superiori. Discreto stato.', '€ 289.000', NULL, '3 locali', '76 m2', '1 bagni', '2 piano', 'AFFILIATO TECNOCASA: STUDIO SMA UNO SRL', '06 7803 661,06 7825 790', '40189201', '20/12/2019', 'piccola', 0, 'DELETED'),
	(206, '70753318', 'Trilocale via Appia Nuova 572, Roma', 'https://www.immobiliare.it/annunci/70753318/', 'Nel complesso residenziale "La Palmetta", completamente ed elegantemente ristrutturato nelle parti comuni, si propone un appartamento al 5° piano, divisibile in ampio ingresso, soggiorno, angolo cottura, 1 camera matrimoniale, 1 camera singola, bagno con finestra, ripostiglio, balconata di mq.15. Classe energetica G.', '€ 374.000', NULL, '3 locali', '87 m2', '1 bagni', '5 piano', 'ASI Agency e Servizi Immobiliari S.R.L.', '06 9480 9869', 'EK-70753318', '28/09/2019', 'costosa', 0, 'DELETED'),
	(207, '77075384', 'Quadrilocale via Manlio Torquato, Roma', 'https://www.immobiliare.it/annunci/77075384/', 'Rif: COLLI ALBANI QUADRILOCALE - Via Manlio Torquato stabile in cortina secondo piano proponiamo in vendita appartamento con doppia esposizione composto da ingresso soggiorno tre camere cucina servizio due balconi. Euro 310.000,00 GABETTI AG. COLLI ALBANI Via Valerio Publicola 29 CONTATTI ANCHE AL NUMERO W.A. 3203762128', '€ 310.000', NULL, '4 locali', '105 m2', '1 bagni', '2 piano', 'GABETTI Agenzia Colli Albani Tuscolana', '', 'COLLI ALBANI QUADRILOCALE (2535148)', '07/11/2019', 'Planimetria mancante. Prezzo buono ma necessita assoulutamente di visita.', 0, 'SELECTED'),
	(208, '77951948', 'Quadrilocale via Colfelice, Roma', 'https://www.immobiliare.it/annunci/77951948/', 'Colli Albani - via Colfelice: vendesi nuda proprietà anni 82 piano alto con ascensore, ampia metratura, da ristrutturare, ingresso, salotto, tre camere da letto matrimoniali, ripostiglio/studio, doppi servizi, balcone, soffitta. Lo stabile è ubicato in una via eccezionalmente servita esercizi commerciali di ogni genere, vicina ad un centro commerciale ed in prossimità della fermata della metropolitana linea A (Colli Albani). € 340.000 Santoro Classe Energetica G (180 kWh/mqa)', '€ 340.000', NULL, '4 locali', '125 m2', '2 bagni', '5 piano', 'SANTORO IMMOBILIARE', '06 5806 036,346 3839 437', 'T408', '19/12/2019', 'costoso - nuda proprietà', 0, 'REJECTED'),
