	(210, '73798802', 'Trilocale via Gela, Roma', 'https://www.immobiliare.it/annunci/73798802/', 'In prossimità della fermata metro e della Stazione Tuscolana, proponiamo in vendita un trilocale posto al settimo piano di uno stabile con servizio di portineria. Internamente è composto da salone, due camere da letto, cucina con tinello, doppi servizi di cui uno con finestra e vasca ed uno cieco, e balcone. L\'immobile si presenta in ottimo stato con infissi in alluminio e doppi vetri, porta blindata e armadio a muro. Il piano alto e la doppia esposizione lo rendono luminoso e panoramico. Completa la proprietà una doppia cantina di pertinenza.', '€ 365.000', NULL, '3 locali', '95 m2', '2 bagni', '7 piano', 'Affiliato Tecnocasa: APPIA NUOVA MEDIAZIONI SRLS', '06 7030 2906,06 7030 1564', '40175326', '20/12/2019', 'costosa', 0, 'REJECTED'),
	(211, '72227118', 'Trilocale via Genzano 87, Roma', 'https://www.immobiliare.it/annunci/72227118/', 'Via Genzano - Galleria Belli - In contesto Signorile e ben curato costruito verso la fine degli anni cinquanta, per tanto tra i palazzi più recenti della zona, proponiamo in vendita un trilocale con superficie catastale totale di 90 mq.ca.. L\'immobile è composto da cucina abitabile, ampio soggiorno, due camere da letto e bagno. L\'appartamento gode di doppia esposizione, una con terrazzino di 6 mq.ca. che espone su Via Castel Colonna e la seconda, con un altro balcone di 4 mq.ca. che espone nella parte interna che risulta la più silenzione della palazzina. La zona è ottimamente servita con locali commericli e uffici postali proprio sotto casa, nonchè diverse attività di prima necessità. A 250 mt.ca. c\'è la fermata metro linea \'A\' di Colli Albani. Ogni agenzia ha un proprio titolare ed e\' autonoma - Le presenti informazioni non costituiscono elemento contrattuale.', '€ 319.000', NULL, '3 locali', '89 m2', '1 bagni', '4 piano', 'AFFILIATO TECNOCASA: STUDIO SMA UNO SRL', '06 7803 661,06 7825 790', '40140406', '20/12/2019', 'Planimetria non in scala. Scaldabagno e parquet in una stanza. Riscaldamento centralizzato. Da capire quale balcone è verandato', 0, 'DELETED'),
	(212, '75631938', 'Quadrilocale via Evandro, Roma', 'https://www.immobiliare.it/annunci/75631938/', 'Zona : Colli Albani \\Furio Camillo - Adiacente P.zza S Maria Ausiliatrice e Furio Camillo , appartamento Mq. 110 al piano sesto di un fabbricato con ascensore di N. 7 piani , composto da ingresso\\corridoio, soggiorno, cucina abitabile, 3 ampie camere da letto ,bagno, balcone L\'Immobile da ristrutturare trovasi a pochi passi dal parco della Caffarellla , dalle fermate Metro Furio Camillo e Colli Albani e a pochi passi dalla stazione FS Tuscolana. Luminosissimo, Esposizione EST\\OVEST. ottimo anche ad uso investimento EURO 309.000,00 trattabili.', '€ 309.000', NULL, '4 locali', '110 m2', '1 bagni', '6 piano', 'Schild & Co. Immobiliare S.R.L.', '06 6190 5874,06 6190 5876', '3333', '20/12/2019', '[DA RISTRUTTURARE COMPLETAMENTE] Planimetria buona ma con camera triangolare. Riscaldamento centralizzato. Un solo balcone sul cortile interno.', 0, 'SELECTED'),
	(213, '77480674', 'Trilocale via Veturia, Roma', 'https://www.immobiliare.it/annunci/77480674/', 'Furio Camillo - Proponiamo in via Veturia appartamento posto al 3° piano di una palazzina anni \'40 con servizio di portineria composto da: ingresso, soggiorno, camera da letto matrimoniale, seconda camera singola/studio con balcone, cucina abitabile, bagno. L\'appartamento si presenta molto luminoso con doppi affacci: cucina, bagno e studio affacciano sul cortile condominiale mentre il soggiorno e la camera da letto affacciano su via Veturia, strada molto silenziosa. L\'appartamento è in buono stato da rimodernare. Riscaldamento autonomo, impianto di aria condizionata, porta blindata, doppi infissi alle finestre. Le spese condominiali comprendono la quota acqua. La zona è ottimamente servita dal trasporto pubblico, fermata Metro A Furio Camillo a 200 metri. La richiesta è di € 280.000 Grimaldi Immobiliare Agenzia Parioli Classe Energetica G (175 kWh/mqa)', '€ 280.000', NULL, '3 locali', '75 m2', '1 bagni', '3 piano', 'GRIMALDI ROMA PARIOLI', '06 8069 0562,328 6639 730', 'T345', '26/11/2019', 'Planimetria buona ma forse le camere sono piccole. Un solo balcone sul cortile interno. La terza camera sembra molto piccolo, da indagare se il muro è stato spostato', 0, 'DELETED'),
	(214, '76669290', 'Trilocale via CASTEL COLONNA, Roma', 'https://www.immobiliare.it/annunci/76669290/', 'Rif: CASTEL COLONNA - Colli Albani, Via Castel Colonna, appartamento posto al piano 2°, su stabile di 7, con ascensore, appartamento composto da: zona living , tre camere, bagno, ripostiglio, balconcino. Riscaldamento centralizzato, acqua a gas metano, no portiere. L\'immobile gode di una duplice esposizione, una su via Castel Colonna, l\'altra sul cortile interno, pertanto gode di molta silenziosità. L\'immobile è stato utilizzato come b & b per diversi anni, ora è affittato a camera 450,00 euro, può comunque essere venduto libero, in relazione alle necessità dell\'acquirente. La ristrutturazione globale è avvenuta circa 8 anni fa, ogni camera è dotata di bagno privato.', '€ 279.000', NULL, '3 locali', '80 m2', '3 bagni', '2 piano', 'CLODIACASE servizi immobiliari', '06 9480 5110', 'CASTEL COLONNA (2599268)', '24/10/2019', 'eventuali troppi lavori da fare', 0, 'DELETED'),
	(215, '77966422', 'Quadrilocale piazza Ragusa 12, Roma', 'https://www.immobiliare.it/annunci/77966422/', 'tuscolano/piazza ragusa e precisamente a piazza ragusa, 12 adiacente alla stazione tuscolana e villa fiorelli , in area con tutti i servizi quali: ospedale /mercato/trasporti, ecc. vendiamo, in edificio ben mantenuto un appartamento sito al 4° piano con ascensore senza barriere architettoniche. l\'appartamento e\' composto da ingresso, una prima camera singola a sx, poi a seguire un salottino, un\'altra camera singola, un bel bagno comodo e grande con vasca, in fondo una cucina abitabile con balcone, tutti questi ambienti affacciano all\'interno. a seguire sulla destra troviamo uno stanzino ideale per cabina armadio ed attigua una camera matrimoniale molto grande che affaccia su via mirandola. l\'immobile si presenta in stato di normale manutenzione. il prezzo richiesto e\' di euro 357.000,00 per informazioni e visite chiamateci allo 06/638.00.00 oppure ai cellulari tania 335.7151967, roberto 339.3527914 le immagini sono fornite al solo scopo illustrativo e non costituiscono elemento contrattuale.', '€ 357.000', NULL, '4 locali', '102 m2', '1 bagni', '4 piano', 'RASSENA Immobiliare', '06 9480 4808', 'Ragusa2019', '12/12/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(216, '76096322', 'Trilocale via Ivrea, Roma', 'https://www.immobiliare.it/annunci/76096322/', 'In zona Ponte Lungo, Via Ivrea, a pochi passi dalla Metro A "Ponte Lungo" in palazzina in cortina del 1950 di 10 piani con ascensore ed un piacevole giardino condominiale alberato, proponiamo la vendita di un trilocale di 92 metri quadri circa, sito al III piano. Internamente si compone di un ingresso, ampio salone, cucina abitabile, due camere da letto, bagno, ripostiglio ed un balcone di 5 metri quadri circa (con accesso dal salone e con un piacevole affaccio sul giardino interno). Completa la proprietà un\'ampia cantina di 18 metri quadri circa posta al piano seminterrato. L\'appartamento è da ristrutturare (con porta blindata e climatizzatori). Possibilità di ricavare un quadrilocale con secondo bagno. Il riscaldamento è termocentralizzato. Ha un\'esposizione ad Est/Ovest e nonostante l\'immediata vicinanza ai servizi pubblici quali Metro ed autobus, i negozi della Via Appia e scuole, risulta molto silenzioso visti gli affacci interni sul piacevole giardino condominiale e su altri distacchi interni. Classe Energetica E - IPE 125', '€ 325.000', NULL, '3 locali', '92 m2', '1 bagni', '3 piano', 'Aureli Immobiliare', '06 7834 7464', 'CE-1874', '09/11/2019', 'costeggia la ferrovia - fuori zona prescelta', 0, 'REJECTED'),
	(217, '78100352', 'Trilocale via Michele Amari 74, Roma', 'https://www.immobiliare.it/annunci/78100352/', 'APPIO LATINO - RARA OPPORTUNITA\' proponiamo in vendita in Via Michele Amari angolo Via Tabarrini, in esclusivo palazzetto storico, appartamento di c.a. 75 mq posto al secondo piano composto da: ingresso, soggiorno, camera matrimoniale con annesso studiolo, cucina semi-abitabile, bagno. L\'appartamento è completamente da ristrutturare e versatile a diverse soluzioni abitative. Soffitti alti con possibilità di soppalcare; Infissi in legno. Riscaldamento autonomo. Tripla esposizione; Molto Luminoso. Prezzo richiesto € 320.000,00. Per info e appuntamenti contattare Rossella 3282463415 ‘’LA IMMOBILIARE’’, nasce da un progetto che vanta un\'esperienza decennale nell’ ambito della intermediazione,partita con la LUNA RE IMMOBILIARE nel 2008. Il ruolo del mediatore ha assunto negli anni un importanza fondamentale per la compravendita di immobili,per questo il nostro gruppo è composto da agenti immobiliari qualificati,e proprio per la complessità e competitività che il mercato sta vivendo in questo periodo storico, LA IMMOBILIARE offre a tutti i suoi clienti un servizio completo affiancandoli con figure professionali quali Notai,Architetti e Legali,con lo scopo di fornire la più ampia trasparenza e sicurezza a chi oggi ha necessità di vendere o acquistare un immobile I nostri punti di forza sono professionalità,trasparenza e competenza. ’’La vostra casa è la nostra casa’’', '€ 320.000', NULL, '3 locali', '75 m2', '1 bagni', '2 piano', 'LA IMMOBILIARE', '347 9448 617', 'RC0076', '20/12/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(218, '78100510', 'Trilocale via Domodossola, Roma', 'https://www.immobiliare.it/annunci/78100510/', 'Vendita trilocale, nelle vicinanze di Piazza Re di Roma, in via Domodossola, al secondo piano, costituito da ingresso, tre camere un bagno, cucina abitabile. L\'immobile non presenta balconi, ed ha di pertinenza una cantina. Il riscaldamento è centralizzato, ed è presente l\'aria condizionata.', '€ 268.000', NULL, '3 locali', '83 m2', '1 bagni', '2 piano', 'Dnd Immobiliare srl', '06 9021 4898,347 9841 886', 'Vendita trilocale Via Domodossola', '20/12/2019', 'fuori zona prescelta', 0, 'DELETED'),
	(219, '78106230', 'Trilocale via Casilina, Roma', 'https://www.immobiliare.it/annunci/78106230/', 'Rif: VG336 - Adiacente Piazza Lodi, più precisamente Via Casilina 95 proponiamo la vendita di un appartamento sito al secondo piano composto da: ingresso, soggiorno, due camere, cucina abitabile con dispensa, servizio, ripostiglio, balcone vivibile e cantina. L\'immobile si presenta in buono stato ed essendo composto esclusivamente da muri tramezzi si presta ad una diversa distribuzione degli spazi interni con la possibilità di ricavare un doppio servizio ed una terza camera. Per ulteriori informazioni potete contattare i seguenti recapiti telefonici: Tel. 06.69372782 cel. 346.3826383 oppure potete inviare una email al seguente indirizzo: info@immobiliarecoppede.it Gruppo Immobiliare Coppedè Srl Via Ombrone 3 00198 Roma.', '€ 295.000', NULL, '3 locali', '104 m2', '1 bagni', '2 piano', 'Gruppo Immobiliare Coppedè Srl', '06 6937 2782,346 3826 383', 'VG336 (2625428)', '20/12/2019', 'fuori zona prescelta', 0, 'REJECTED'),
	(221, '78116004', 'Trilocale via Cerreto Sannita, Roma', 'https://www.immobiliare.it/annunci/78116004/', 'SAN GIOVANNI: Via Cerreto Sannita : nello storico quartiere di Villa Fiorelli, a pochi passi da Piazza Re di Roma, proponiamo soluzione immobiliare al piano primo, in stabile degli anni 40 di cinque piani con ascensore. L\'immobile si colloca in una via privata, tranquilla e riservata e si compone di sala a vista con cucina e balcone, due camere da letto e due bagni, di cui uno in camera. L\'immobile si presenta completamente ristrutturato, la ristrutturazione ha meno di due anni, con impianti nuovi dotati di certificazioni. Impianto termo autonomo, con caldaia. Luminoso, con esposizione doppia. La vicinanza ad attività commerciali, mezzi di trasporto e scuole rende la proprietà un punto strategico per abitare e/o investire, in un quartiere che collega sia storia che vita quotidiana. A completare la proprietà un posto auto condominiale a rotazione. La metropolitana Re di roma dista soltanto 450 metri a piedi, a 700 metri la stazione tuscolana e 800 metri Piazza Lodi. Euro 279.000. PER INFORMAZIONI OLIMPOCASA 06.69. 31.62. 62 Altre disponibilità in zona, per maggiori informazioni contattaci ai seguenti recapiti telefonici: 06/69.31. 62.62 o 339/8566399, o visita il nostro sito internet: WWW. OLIMPOCASA. IT, o inviaci una mail al nostro indirizzo di posta elettronica sarai ricontattato al più presto. Vi ricordiamo inoltre, che è possibile usufruire dei nostri servizi di: consulenza finanziaria e valutazione gratuita degli immobili. Tutti i dati e le informazioni contenute e indicate nel presente annuncio non costituiscono elemento contrattuale.', '€ 279.000', NULL, '3 locali', '69 m2', '2 bagni', '1 piano', 'Olimpo Casa s.r.l.s.', '06 6931 6262', 'EK-78116004', '21/12/2019', 'primo piano', 0, 'DELETED'),
	(222, '74147948', 'Trilocale via Virginia 39, Roma', 'https://www.immobiliare.it/annunci/74147948/', 'RE DI ROMA SAN GIOVANNI - NO AGENZIE, APPARTAMENTO 75 MQ POSTO AL 3° PIANO Re di Roma / San Giovanni - Via Virginia 39- Panoramico - Fermata metro "A" Furio Camillo 120 metri - Stazione Ferroviaria Tuscolana 80 metri è così composto: - Ingresso salotto - Salone ampio - Camera da letto arredata con balcone - Cucina abitabile (di recente ristrutturazione) con balcone - Bagno (di recente ristrutturazione) - Ripostiglio - 2 Terrazzi, uno di 6 mq e uno di 3 mq - doppio affaccio - Luminoso - Silenzioso NO AGENZIE', '€ 295.000', NULL, '3 locali', '75 m2', '1 bagni', '3 piano', '', 'https://media.immobiliare.it/text/tel_74147948_d233e.jpg?k=f09254a06dc88d2c46a9cc84e3c752a1', 'EK-74147948', '25/11/2019', 'ingresso grande come un salone ma senza finestre', 0, 'REJECTED'),
	(223, '77377582', 'Trilocale via Muzio Scevola, Roma', 'https://www.immobiliare.it/annunci/77377582/', 'Appartamento di 75 mq. posto al secondo piano rialzato sito in Roma Via Muzio Scevola, vicino a Viale Furio Camillo, tra la Via Appia e la Via Tuscolana, ben servito e collegato. L\'immobile è composto da un ingresso, soggiorno con angolo cottura, due camere matrimoniali, bagno e balcone.', '€ 295.000', NULL, '3 locali', '75 m2', '1 bagni', '2 piano', '', '', 'EK-77377582', '19/11/2019', 'piccola', 0, 'DELETED'),
	(224, '78094812', 'Trilocale via Pallante, Roma', 'https://www.immobiliare.it/annunci/78094812/', 'Codice ITI 001: Appartamento in vendita a Roma, zona Furio Camillo e più precisamente ubicato in via Pallante. In zona centralissima, a pochi passi da via Appia Nuova e dalla Metro, proponiamo la vendita di un appartamento di ampia metratura posto al quinto piano con ascensore di una palazzina in cortina in ottimo stato di 8 piani. L\'immobile ha una superficie di circa mq. 92 ed è composto da un ampio ingresso, un grande soggiorno con porta finestra che affaccia su di un primo balcone di circa mq. 10, due ampie camere matrimoniali, una cucina abitabile ed un servizio con finestra. Inoltre la casa dispone di un comodo ripostiglio e due armadi a muro. Il secondo balcone, anch\'esso di buone dimensioni espone direttamente su via Pallante. Completa la proprietà una comoda ed asciutta soffitta provvista di finestra di circa m.6. L\'appartamento, visto la sua ampia metratura e la disposizione degli ambienti, si presta facilmente a poter essere modificato e diventare un quadrilocale. Inoltre il piano alto e la doppia esposizione est ovest lo rendono particolarmente luminoso. Vi consigliamo di visionare l\'immobile di Via Pallante poiché molto valido ed ottimo anche ad uso investimento. Per avere ulteriori informazioni sull\'appartamento in vendita in zona Furio Camillo potete chiamare il numero fisso durante gli orari di ufficio oppure chiamare il nostro funzionario di zona in qualsiasi momento al 3339192817.', '€ 309.000', NULL, '3 locali', '101 m2', '1 bagni', '5 piano', 'ISTITUTO TORINESE IMMOBILIARE NETWORK S.R.L.', '06 9450 2102', 'ITI 001-SI12/3', '20/12/2019', 'Planimetria buona. Presenza di scaldabagno ma sembra essere possibile il riposizionamento.', 0, 'DELETED'),
	(225, '78102452', 'Quadrilocale via Enea, Roma', 'https://www.immobiliare.it/annunci/78102452/', 'Rif: Via Enea 3p - Nelle immediate vicinanze della metro Furio Camillo, a pochi metri dall\'ingresso di Villa Lazzaroni, e più precisamente in via Enea, proponiamo la vendita di un immobile posto al 3° piano di uno stabile recentemente ristrutturato. L\'appartamento, di circa 100 mq commerciali, si compone di un ingresso, un soggiorno, tre ampie camere da letto, cucina, un servizio, un ampio ripostiglio e due balconi. Il soggiorno, con accesso ad un balcone, ed una camera da letto espongono su Via Enea verso sud/est; le altre due camere da letto, di cui una con accesso al 2° balcone, la cucina e il servizio affacciano su un cortile ampio e curato. L\'immobile si presenta in discreto stato di manutenzione, la pavimentazione è rivestita in marmittoni, gli infissi sono i pvc con doppi vetro e le porte sono in legno. L\'appartamento risulta estremamente luminoso con una buona apertura di visuale verso Villa Lazzaroni.', '€ 319.000', NULL, '4 locali', '100 m2', '1 bagni', '3 piano', 'ABITHA - San Giovanni immobiliare S.r.l.', '06 9480 5701', 'Via Enea 3p (2625400)', '20/12/2019', 'planimetria dubbia - K triangolare', 0, 'DELETED'),
	(226, '78100046', 'Trilocale via Camilla, Roma', 'https://www.immobiliare.it/annunci/78100046/', 'Rif: Via Camilla - Nelle immediate vicinanze della Metro Furio Camillo, a pochi metri da Via Appia Nuova, e precisamente in Via Camilla, proponiamo la vendita di un immobile posto al 2° piano di uno stabile in discreto stato di manutenzione. L\'appartamento vanta una superficie di circa 88 mq commerciali, è molto luminoso e si compone di un ingresso, un soggiorno, due ampie camere da letto, una cucina con tinello, un servizio ed un ampio ripostiglio. Il soggiorno espone ad est su Via Camilla mentre le due camere da letto, la cucina ed il servizio affacciano su un ampio e luminoso cortile. L\'immobile si presenta in discreto stato di manutenzione, la pavimentazione è rivestita in ceramica, gli infissi sono in alluminio bianco con doppi vetri, le porte in legno e la porta d\'ingresso è blindata.', '€ 265.000', NULL, '3 locali', '88 m2', '1 bagni', '2 piano', 'ABITHA - San Giovanni immobiliare S.r.l.', '06 9480 5701', 'Via Camilla (2625348)', '20/12/2019', 'no balconi', 0, 'REJECTED'),
	(227, '72324846', 'Trilocale via Enea 36, Roma', 'https://www.immobiliare.it/annunci/72324846/', 'Vendesi appartamento libero , di Mq. 72 piano alto, con ascensore in palazzo con facciate appena ristrutturate nel 2018, sito in Via Enea zona Appia Nuova , adiacente a Villa Lazzaroni, a 10 minuti da San Giovanni e a tutti i servizi immaginabili, ben collegato con la metro linea A fermate di Furio Camillo e Colli Albani, centro commerciale , stazione ferroviaria Roma/Tuscolana,scuole, fermate autobus etc. L\'immobile è cosi composto: ingresso con salone a vista, ampia camera da letto di circa 18 Mq, altra camera da letto , cucinotto , servizi con doccia, soppalco, due balconi, doppia esposizione est-ovest, luminosissimo , ristrutturato completamente circa 18 anni fa con tutti gli impianti nuovi a norma sia elettrico che termico , fibra ottica che arriva all\'interno dell\'appartamento, climatizzato caldo/freddo , riscaldamento autonomo, parquet ,infissi in alluminio con vetro camera, ottimo stato ,abitabile da subito, nella rata condominiale è compreso il consumo dell\'acqua, la planimetria dell\'immobile si presta qualora si voglia modificare per creare un angolo cottura nel salone e ricavare un ulteriore stanzino, bagno o altro locale etc.. vi sono tre progetti per ridistribuzione degli spazi, attualmente l\'immobile è completamente arredato e completo di elettrodomestici nuovi, se interessa arredato per uso investimento affitto, B&B, casa vacanze etc. essendo molto richiesti nella zona ,vi sarà lasciato tutto il mobilio e gli arredi completi di elettrodomestici senza nessun sovrapprezzo. A.P.E. classe G in corso di validità ,possibilità di posto auto in autorimessa video sorvegliata adiacente allo stabile con personale e aperta h24 anche festivi con canone mensile a secondo la tipologia dell\'auto. Non ci sono provvigioni in quanto è una trattativa tra privati. NON VOGLIO ESSERE CONTATTATO DA AGENZIE O MEDIATORI IMMOBILIARI.', '€ 315.000', NULL, '3 locali', '80 m2', '1 bagni', '7 piano', '', 'https://media.immobiliare.it/text/tel_72324846_41ddd.jpg?k=c3422c3cd381f4ef49272d413f24375a', 'EK-72324846', '16/12/2019', 'piccola', 0, 'REJECTED'),
	(228, '78132628', 'Trilocale via Ceneda, Roma', 'https://www.immobiliare.it/annunci/78132628/', 'appartamento al primo piano, cosi\' composto salone, camera da letto, cameretta, cucina, bagno, balcone', '€ 355.000', NULL, '3 locali', '72 m2', '1 bagni', '1 piano', 'Gruppo Immobil Rome di D. di Lorenzo', '06 9450 2424', 'CANEDA', '23/12/2019', 'primo piano', 0, 'DELETED'),
	(229, '78156522', 'Trilocale via Ceneda, Roma', 'https://www.immobiliare.it/annunci/78156522/', 'Re di Roma ad.te Piazza Tuscolo - Via Ceneda - In zona ben collegata, proponiamo in vendita un appartamento ristrutturato posto al primo piano catastale in un comprensorio anni 30, servito da portierato. L\'ingresso da direttamente sul soggirono che comprende una zona cucina dedicata. A dividere questo 1° ambiente dalla zona notte c\'è un comodo disimpegno dal quale si ha accesso al primo bagno senza finestra. La zona notte è composta da uno spazioso e comodo ripostiglio, due camere da letto di cui una servita da bagno privato con finestra e cabina armadio. L\'immobile che vi abbiamo appena descritto è un ottima opportunità per chi vuole vivere in un contesto silenzioso nel cuore della città, oppure per chi vorrebbe investire in una soluzione chiavi in mano. La zona è ottimamente servita sia per quanto riguarda i trasporti pubblici (le fermate della Metro A \'San Giovanni\'\' o \'Re di Roma\' sono facilmente raggiungibile a piedi ) che per quanto riguarda le attività commerciali.', '€ 340.000', NULL, '3 locali', '78 m2', '2 bagni', '1 piano', 'Affiliato Tecnorete: IMMOBILIARE RE DI ROMA SRLS', '06 8777 6553', '40260309', '28/12/2019', 'REJECTED primo piano \nprimo piano', 0, 'REJECTED'),
	(230, '78165220', 'Trilocale via Saluzzo, Roma', 'https://www.immobiliare.it/annunci/78165220/', 'APPIA - RE DI ROMA e più precisamente Via Saluzzo la RV IMMOBILIARE affiliata FRIMM propone la vendita di un luminosissimo appartamento trilocale posto al nono e ultimo piano di un palazzo in cemento armato e rifinito a intonaco. La posizione geografica lo colloca a pochi passi da Piazza Re di Roma, San Giovanni, alle fermate metro linea "A" Pontelungo - Re di Roma al centro commerciale "APPIO", tutte mete raggiungibili a piedi e a pochi chilometri dall\'Università "La Sapienza". L\'immobile è da ristrutturare, ha il riscaldamento centralizzato con i contabilizzatori di consumo; internamente è composto da: ingresso, piccolo studio, due ampie camere matrimoniali, soggiorno, cucina abitale, bagno con doccia. Gli affacci sono panoramici, l\'esposizione verte verso est-sud e ovest. La nostra agenzia mette a disposizione dei clienti consulenze gratuite con professionisti come architetto e consulente finanziario, per aiutarvi a realizzare il vostro progetto immobiliare. Per ulteriori informazioni e appuntamenti chiamateci allo 06/51957186 oppure al 335/7554429.', '€ 360.000', NULL, '3 locali', '85 m2', '1 bagni', '9 piano', 'Rv immobiliare', '06 9480 0990', 'Saluzzo', '30/12/2019', 'no balcone', 0, 'REJECTED'),
