	(235, '77963338', 'Trilocale via Caio Lelio 1, Roma', 'https://www.immobiliare.it/annunci/77963338/', 'Tra le fermate metro A Giulio agricola e Subaugusta nel quartiere di Cinecittà, proponiamo in vendita un appartamento finemente ristrutturato, posto al piano secondo di uno stabile di 6 piani. L\'immobile è composto da una comoda e luminosa zona giorno, con angolo cottura, che affaccia su un\'ampia vetrata portafinestra. La zona notte si compone di una comoda camera da letto doppia con bagno in camera e una seconda camera. L\'affaccio dell\'intero appartamento è su via caio leio chiusa al traffico. L’ appartamento di circa 91 mq commerciali è completamente ristrutturato impianti a norma con certificazione di conformità e interamente predisposto per la climatizazione. IL palazzo è in cortina è l\'appartamento è termoautonomo con spesa condominiale di euro 40 mensile. Lunità immobiliare, ottimamente esposta a sud/est, gode di una posizione vicina a tutti i servizi della zona ( mercato supermercati ecc). Ottima zona, tranquilla di sera e piena di negozi nelle vicinanze con diversi locali raggiungibili a piedi.il prezzo non è trattabile possibilità di vendita ammobiliato.', '€ 295.000', NULL, '3 locali', '92 m2', '2 bagni', '2 piano', '', 'https://media.immobiliare.it/text/tel_77963338_899ab.jpg?k=d4f8740b54b968ee3b2dd34a591289bf', 'EK-77963338', '13/12/2019', 'fuori zona', 0, 'DELETED'),
