	(237, '72783676', 'Quadrilocale via Tommaso Fortifiocca 9, Roma', 'https://www.immobiliare.it/annunci/72783676/', 'Appio Latino precisamente Via Tommaso Fortifiocca privato vende appartamento luminoso sito al primo piano in palazzina di 4 piani.Doppia esposizione composto da 4 stanze, doppi servizi e cucina,terrazzo con gazebo di 20 mq.Dotato di riscaldamento autonomo e climatizzatori. E\' ubicato nelle immediate vicinanze di ogni tipo di servizi , negozi e a pochi minuti dalla metropolitana linea A : Furio Camillo.Ottimo investimento.Privato vende ad 375.000= escluse Agenzie ed intermediari', '€ 375.000', NULL, '4 locali', '80 m2', '2 bagni', '1 piano', '', '', 'EK-72783676', '03/01/2020', 'primo piano', 0, 'DELETED'),
	(238, '78182462', 'Quadrilocale via Ferdinando Ughelli 20, Roma', 'https://www.immobiliare.it/annunci/78182462/', '"Vendesi appartamento in via Ughelli a due passi dal parco della caffarella, l\'immobile è ristrutturato con ottime rifiniture, composto da ingresso, salone, cucina arredata su misura, due camere da letto, due bagni, soppalco due balconcini, tutte le zone sono climatizzate, infissi nuovi di legno e grate di sicurezza.', '€ 365.000', NULL, '4 locali', '92 m2', '2 bagni', '1 piano', '', 'https://media.immobiliare.it/text/tel_78182462_2723a.jpg?k=69a7ba82fc730f80e787878cfa5772ee', 'EK-78182462', '02/01/2020', 'primo piano', 0, 'DELETED'),
	(239, '78221286', 'Trilocale via Alba 34, Roma', 'https://www.immobiliare.it/annunci/78221286/', 'DB case vende appartamento sito nel cuore di Ponte Lungo - Re Di Roma, precisamente in Via Alba, zona strategica a metà tra Via Appia Nuova e Via Tuscolana, servitissima da ogni mezzo di trasporto come autobus, linea ferroviaria stazione Tuscolana che raggiunge l\'aeroporto di Fiumicino e la Metro A fermata “Ponte Lungo” e dalle molteplici attività commerciali della zona quali bar, farmacie,supermercati, negozi ecc ecc che consentono di vivere a pieno il quartiere. La casa è posta al primo piano ed è composta da ingresso, soggiorno con doppia finestra angolare, cucina abitabile, 2 camere da letto, servizio e balcone. Internamente è da ristrutturare, presenta la pavimentazione dell\'epoca in tutte le camere ad eccezione del servizio e della cucina che hanno la ceramica. Gli infissi sono in alluminio anodizzato, l\' esposizione è tripla ed interna, quindi molto silenziosa ma allo stesso tempo garantisce un ottimo ricircolo d\'aria. L\'appartamento gode di grande luminosità. Il palazzetto, di soli 2 piani è stato edificato nei primi anni del 900\' ed è in tinta. Ideale come casa vacanze, B&B o ufficio. Ottimo uso investimento. € 249.000,00 Classe energetica G 132,4 kwh/m2 anno Per info e visite 06/70614285 o www.dbcase.it RICHIEDI LA VALUTAZIONE DI CASA TUA GRATUITAMENTE. DB CASE VIA CASORIA 48 / 50 ( METRO RE DI ROMA )', '€ 249.000', NULL, '3 locali', '76 m2', '1 bagni', '1 piano', 'DB case', '06 7061 4285', 'VIA ALBA', '07/01/2020', 'primo piano', 0, 'REJECTED'),
	(240, '78220944', 'Trilocale via Tuscolana 55, Roma', 'https://www.immobiliare.it/annunci/78220944/', 'DB case Vende appartamento ad ottimo uso investimento sito nel cuore di Piazza Re Di Roma, precisamente in Via Tuscolana , distante 100 mt ( 2 minuti a piedi) dalla fermata della Metro A (Re di Roma) , a 5 minuti dalla Metro C (Lodi) e a 10 minuti dalla stazione ferroviaria Tuscolana e da tutte le attività commerciali di Via Appia come bar, supermercati, farmacie, banche ecc… L’immobile, posto al primo piano si compone di ingresso, soggiorno, 2 camere da letto, cucina abitabile, servizio e una grande cantina di 15 MQ c.a. Internamente si presenta in buone condizioni ad eccezione della cucina che è rimasta da ristrutturare. La pavimentazione è in Veneziana d’epoca in tutta casa ad eccezione del servizio, che è stato ristrutturato nel 2017 con i relativi impianti, in cui è presente un gress porcellanato. Porte e finestre sono nuove (2018); Gli infissi sono in PVC bianco, tutti con doppio vetro, garanzia di un ottimo isolamento, sia termico che acustico. Ottimo uso investimento. € 299.000,00 Classe energetica G 132,4 kwh/m2 anno Per info e visite 06/70614285 o www.dbcase.it RICHIEDI LA VALUTAZIONE DI CASA TUA GRATUITAMENTE. DB CASE VIA CASORIA 48 / 50 ( METRO RE DI ROMA )', '€ 299.000', NULL, '3 locali', '90 m2', '1 bagni', '1 piano', 'DB case', '06 7061 4285', 'VIA TUSCOLANA', '07/01/2020', 'primo piano', 0, 'DELETED'),
