	(242, '78196402', 'Trilocale via degli Orti Variani 35, Roma', 'https://www.immobiliare.it/annunci/78196402/', 'Appartamento a 300 metri da metro lodi, 5 vani , ottimo ristrutturato con strada privata e parcheggio con sbarra NO AGENZIA tratto solo con privati INTERESSATI GRAZIE', '€ 249.000', NULL, '3 locali', '80 m2', '1 bagni', '2 piano', '', 'https://media.immobiliare.it/text/tel_78196402_75c75.jpg?k=c915f68d45f5deb6a89db560e864a0ef', 'EK-78196402', '07/01/2020', 'zona sopraelevata tang.est', 0, 'DELETED'),
	(243, '78085602', 'Trilocale via Pasquale Tola, Roma', 'https://www.immobiliare.it/annunci/78085602/', 'VIA PASQUALE TOLA- In una via tranquilla, a pochi passi dalla piazza \'Scipione Ammirato\', fulcro importante del nostro quartiere, proponiamo l\'acquisto di un grazioso trilocale, posto ad un piano intermedio. Entrando nell\'appartamento, vi troverete accolti in uno spazioso disimpegno, dal quale avrete la possibilità di accedere ai diversi ambienti della casa. Girando alla vostra destra, entrerete nel luminoso salone dove sarà possibile posizionare un comodo divano angolare. Proseguendo verso sinistra del disimpegno, troverete un\'ampia camera da letto matrimoniale ed il bagno finestrato. Un secondo disimpegno, divide la cucina abitabile dalla cameretta. Essendo da ristrutturare, la distribuzione degli spazi interni potrà facilmente essere modificata, a seconda delle vostre esigenze. Libero subito.', '€ 350.000', NULL, '3 locali', '80 m2', '1 bagni', '2 piano', 'Affiliato Tecnorete: IMMOBILIARE RE DI ROMA SRLS', '06 8777 6553', '40260444', '20/12/2019', 'planimetria dubbia', 0, 'DELETED'),
	(244, '78205050', 'Trilocale via acqua donzella, Roma', 'https://www.immobiliare.it/annunci/78205050/', 'Rif: 5/5 - appia nuova colli albani in via acqua donzella in una palazzina con portiere proponiamo un appartamento al quarto piano composto da ampio ingresso salone con balcone grande camera matrimoniale piccola cameretta ampia cucina abitabile e ripostiglio info 0677208000 -3356357393', '€ 265.000', NULL, '3 locali', '85 m2', '1 bagni', '4 piano', 'Asso Programma Casa srl', '06 9480 0626', '5/5 (2626927)', '04/01/2020', 'planimetria mal proporzionata', 0, 'DELETED'),
	(245, '78197346', 'Trilocale via Orazio Coclite 12, Roma', 'https://www.immobiliare.it/annunci/78197346/', 'Nelle immediate adiacenze della metro A di Furio Camillo, e precisamente in via Orazio Coclite, proponiamo la vendita di un immobile ristrutturato e arredato composto da: ingresso, soggiorno con angolo cottura, due camere da letto, servizio e ripostiglio. La casa ha una doppia esposizione esterna e quindi risulta molto luminosa e ariosa. E\' dotata di un impianto elettrico a norma e certificato ed è anche climatizzata in ogni suo ambiente. Il quartiere dove è posizionato l\'appartamento è ricco di ogni tipo di servizio e mezzo pubblico, ed è vicino anche a molte zone verdi quali villa Lazzaroni o il Parco della Caffarella.', '€ 300.000', '€ 309.000', '3 locali', '75 m2', '1 bagni', '5 piano', 'area-re agenzia appio', '06 7047 4087', 'AR003508', '03/01/2020', 'REJECTED cucina in salone \ncucina in salone', 0, 'REJECTED'),
