	(251, '78307291', 'Trilocale via Appia Nuova,, 465, Roma', 'https://www.immobiliare.it/annunci/78307291/', 'Roma - San Giovanni - Re di Roma - Davanti al Parco di Villa Lazzaroni - Appia Nuova a 100 metri dalla Metro A Furio Camillo, Proponiamo la vendita di un favoloso appartamento all\'OTTAVO PIANO di circa 110mq. L\'appartamento è composto da: Ingresso, Cucina abitabile, Una grande e comoda sala con balcone (affaccio sul parco), due camere matrimoniali e un altro balcone, bagno e ripostiglio. L\'appartamento è in buono stato, mentre il palazzo è in ottime condizioni. Riscaldamento centralizzato con i contabilizzatori, silenzioso e luminoso. Servizio di portineria dalle 7.00 alle 13.00 e dalle 16.00 alle 19.00. L\' appartamento è affittato a lavoratori e studenti con contratto in scadenza dicembre 2021. OTTIMO INVESTIMENTO CON RENDITA MENSILE DI EURO 1.100,00 escluse utenze e condominio. Condominio 100 euro mese circa. Ottimo uso investimento con rendita di circa 1100 euro al mese, escluse spese di condominio e utenze. Adatto a coppie con figli. Ottimo per B&B o affitta camere. Furio Camillo, rappresenta una delle principali connessioni trasversali del quartiere. Aree industriali dismesse sono presenti lungo la ferrovia e in via della Marrana, dove l\'esistenza di un piccolo corso d\'acqua, oggi coperto, fece sorgere insediamenti artigianali e manifatturieri tra cui alcuni mulini e la fabbrica Eridania. Architetture scolastiche Liceo Classico Sperimentale "Bertrand Russell" Liceo Ginnasio Statale Augusto, su via Gela. Edificio del XX secolo (1956). Istituto Professionale Statale per l\'Industria e l\'Artigianato "Duca D\'Aosta" Istituto Tecnico Turistico Charles Darwin, su via Tuscolana. Istituto paritario Salesiano Pio XI, su via Umbertide. Edificio del XX secolo (1927-29). Scuola Giovanni Cagliero (scuola primaria), su largo Volumnia. Scuola Albio Tibullo (scuola secondaria di primo grado), su via Amulio. Scuola Gianni Rodari (scuola dell\'infanzia), su via Norcia. Scuola Media Statale Francesco Petrarca (scuola secondaria di primo grado), su via Camilla La stazione di Furio Camillo è una stazione sotterranea a due binari, che in tale tratto corrono in due distinte gallerie, serviti da due banchine centrali. Il piano binari, scavato a foro cieco, è collegato al mezzanino superficiale, scavato a cielo aperto, attraverso rampe di scale e scale mobili[5]. Metropolitana di Roma A è raggiungibile dalla stazione Furio Camillo. Architetture religiose Basilica di Santa Maria Ausiliatrice, su piazza di Santa Maria Ausiliatrice. Chiesa del XX secolo (1931-38). Chiesa del Santissimo Corpo e Sangue di Cristo, su via Narni. Chiesa del XX secolo (1991). Chiesa Cristiana Evangelica Cinese, su via Assisi (Unione cristiana evangelica battista d\'Italia). Acquedotti Acqua Marcia, arcate lungo via del Mandrione. Acquedotto Felice Aree naturali Villa Lais alla Marrana, da piazza Giovanni Cagliero REMAX MAISON', '€ 320.000', NULL, '3 locali', '110 m2', '1 bagni', '8 piano', 'RE/MAX Maison', '06 6228 6670', 'T312', '10/01/2020', 'Metratura interessante. Casa affittata libera da dicembre 2021 (capire tipo di contratto), manca foto di una camera, ', 0, 'SELECTED'),
