	(265, '78315327', 'Trilocale via Cividale del Friuli 13, Roma', 'https://www.immobiliare.it/annunci/78315327/', 'Appia Nuova - Ponte Lungo vicinissimo alla metropolitana e ai tantissimi negozi e servizi che questo centrale quartiere può offrire, vi proponiamo in vendita un appartamento sito al 3°piano di una palazzina con ascensore e con regolare licenza di costruzione e certificato di agibilità. Le spese condominiali insieme a quelle del riscaldamento ammontano a soli €35 mensili perchè c\'è un appartamento condominiale affittato che riduce di molto le spese di gestione condominiali. Composizione e caratteristiche dell\'appartamento: ampio ingresso, 3 ampie camere matrimoniali, cucina abitabile, bagno, balcone, rispostiglio, grande armadio a muro, soppalco, infissi con doppi vetri a taglio termico, climatizzatori, porta blindata con cilindro europeo, luminoso e silenzioso. APE CLASSE F Riscaldamento centralizato con caldaia a condensazione e dotato di valvole contabilizzatori dei consumi. L\'immobile è ubicato in un quartiere caratterizzato dalla presenza di supermercati, negozi vari, parchi, scuole e a pochi passi dal Nuovo Centro Commerciale HAPPIO e molto vicino anche la stazione ferroviaria Tuscolana. La posizione strategica nonchè i numerosi servizi rendono particolarmente interessante questa proposta immobiliare. Prezzo proposto in vendita Euro 358.000. Per maggiori informazioni ed eventuale appuntamento sul posto rivolgersi a CASAMIA IMMOBILIARE 06.91939145 - 393.1972107 - 3496776290.', '€ 358.000', NULL, '3 locali', '87 m2', '1 bagni', '3 piano', 'CASAMIA IMMOBILIARE', '06 9193 9145,393 1972 107', 'EK-78315327', '10/01/2020', 'fuori zona prescelta', 0, 'REJECTED'),
