	(283, '78433499', 'Trilocale via di Santa Maria Ausiliatrice, Roma', 'https://www.immobiliare.it/annunci/78433499/', 'APPIO TUSCOLANO VIA DI SANTA MARIA AUSILIATRICE ADIACENZE CHIESA VENDIAMO LUMINOSISSIMO QUINTO PIANO CON DOPPIA ESPOSIZIONE MQ 70 IN OTTIME CONDIZIONI INTERNE COMPOSTO DA CUCINA ALL\'AMERICANA DUE CAMERE DOPPI SERVIZI DI CUI UNO IN CAMERA E PICCOLO BALCONE IN CUCINA - RISCALDAMENTO CENTRALIZZATO A CONSUMO - CONDOMINIO EURO 60,00 CIRCA AL MESE - CLASSE G IPE 175 - NB: TUTTE LE INFORMAZIONI IVI CONTENUTE COMPRESE LE METRATURE SONO DA INTENDERSI PURAMENTE A TITOLO INDICATIVO E NON COSTITUISCONO ELEMENTO CONTRATTUALE. La Topcasa Immobiliare srl ha la propria sede a Roma in via Raffaele de Cesare 87/91, è presente sull\'intero territorio nazionale tramite partners associati f. i. a. i. p. "federazione italiana agenti immobiliari professionali"; si avvale della collaborazione di personale altamente qualificato che dal 1983 opera nel settore immobiliare delle compravendite. VALUTAZIONI: valutazione gratuita in 48 ore se finalizzata alla vendita o alla locazione dell\'immobile. STIME: perizia estimativa scritta, legalmente valida, e visura ipocatastale. SERVIZI: assistenza tecnico legale. La professionalità degli agenti immobiliari della Topcasa Immobiliare, tutti regolarmente iscritti, permette di fronteggiare sempre ogni situazione per fornire ai clienti una mirata assistenza in tutte le fasi dell\'alienazione o locazione dell\'immobile. LOCAZIONI: locazioni rispondenti alle leggi 431/98 e 392/78 ed alle recenti normative, per non incorrere in pesanti sanzioni o trovarsi in problematici conflitti con il conduttore. La Topcasa Immobiliare, costantemente attenta alle esigenze della clientela, si avvale della collaborazione di professionisti esterni avvocati, notai, architetti, commercialisti, geometri, visuristi. Promozione immobili sulle più importanti testate del settore e portali internet di rilevanza nazionale. Database clienti costantemente aggiornato. Clienti istituzionali interessati nell\'acquisizione di interi stabili, in seguito venduti frazionatamente dopo eventuali interventi di ristrutturazione. Sottoscritto, tramite la f. i. a. i. p. una convenzione operativa con primari istituti bancari."', '€ 285.000', NULL, '3 locali', '70 m2', '2 bagni', '5 piano', 'TOPCASA IMMOBILIARE SRL', '06 9480 1444', 'MARIA AUSILIATRICE', '16/01/2020', 'bilocale', 0, 'REJECTED'),
	(284, '78416659', 'Quadrilocale via Mirandola, Roma', 'https://www.immobiliare.it/annunci/78416659/', 'Adiacente piazza di Villa Fiorelli, più precisamente in via Mirandola, proponiamo in vendita esclusiva un appartamento situato al secondo piano, all\'interno di un condominio degli anni\'30 in ottime condizioni interne e dotato di ascensore. All\'immobile si accede da un ampio ingresso adiacente la sala da pranzo collegata alla cucina abitabile. Un comodo corridoio conduce a 3 ampie stanze, di cui una con balcone angolare, e a un bagno con finestra. L\'appartamento rimane silenzioso e luminoso grazie agli alti soffitti (3,3 mt) e alla tripla esposizione. L\'immobile, da ristrutturare, si presta ad una diversa distribuzione interna degli spazi. Sarà ceduta anche una quota di proprietà relativa all\'appartamento dell\'ex-portiere. L’appartamento è situato in un punto della città sicuramente strategico. La zona silenziosa e poco trafficata offre un buona vivibilità, senza però rinunciare alle comodità del vivere in una metropoli come Roma. Infatti i collegamenti sono garantiti da varie linee Autobus; dalla fermata della Metro A, Ponte Lungo, e della metro C, Lodi; si raggiunge benissimo a piedi anche la stazione ferroviaria Tuscolana. Inoltre nelle vicinanze è presente la Tangenziale Est che mette in collegamento la parte Nord-Est di Roma e il G.R.A. Nei dintorni troviamo varie attività commerciali, bar, farmacia, supermercati, palestra, nonché scuole e chiese. Le presenti informazioni e planimetrie sono meramente indicative e non costituiscono elementi contrattuali. Rif. W-02HNJZ - Leonard Cervinschi - Tel. +39 06 45 54 81 20', '€ 370.000', NULL, '4 locali', '102 m2', '1 bagni', '2 piano', 'Engel & Völkers Roma • Market Center', '06 4554 8120', 'W-02HNJZ - S11', '16/01/2020', 'planimetria dubbia', 0, 'REJECTED'),
	(285, '78453633', 'Trilocale viale Furio Camillo, Roma', 'https://www.immobiliare.it/annunci/78453633/', 'Rivolta vende all\'asta nel quartiere Tucolano e piu\' precisamente in Via Furio Camillo, appartamento di mq 73 sito al terzo piano di una palzzina con ascensore, composto da: ingresso, salone, camera da letto, cucinotto, bagno ed un balcone. L\'immobile è da ristrutturare. La zona in cui si trova è ricca di servizi e negozi di ogni genere ed è ottimamente servita dal trasporto pubblico. Offerta minima € 150.000. Data asta 11/03/2020. COMPRA ALL’ ASTA CON NOI. TI ASSISTIAMO FINO AL DECRETO DI TRASFERIMENTO E ALLA CONSEGNA DELLE CHIAVI. AVVOCATO, ARCHITETTO, COMMERCIALISTA E NOTAIO IN SEDE. CON RIVOLTA IMMOBILIARE DAL 1956 SOLO ACQUISTI SICURI AL 100%. PRIMA CONSULENZA GRATUITA, MUTUO ASTA 100%. POSSIBILITÀ\' DI VISITARE L\'IMMOBILE.', '€ 150.000', NULL, '3 locali', '73 m2', '1 bagni', '3 piano', 'Rivolta Immobiliare dal 1956', '06 8115 0370', 'EK-78453633', '17/01/2020', 'asta', 0, 'REJECTED'),
	(286, '78458197', 'Trilocale ottimo stato, quarto piano, Roma', 'https://www.immobiliare.it/annunci/78458197/', 'ALBERONE APPIA FURIO CAMILLO - VIA VETURIA - Appartamento RISTRUTTURATO posto al quarto piano di un prestigioso PALAZZO D\'EPOCA (anni \'30); composto di : ingresso,soggiorno,2 camere,cucina abitabile,bagno e balcone. L\'immobile è molto luminoso e gode di una doppia esposizione. Nel corridoio, con faretti sul soffitto, troviamo un ampio e comodo SOPPALCO con doppio accesso. La porta è blindata e gli infissi sono in alluminio con doppi vetri. Ubicato in zona centrale con tutti i servizi nelle immediate vicinanze, tra cui : la fermata Metro, linea A, Furio Camillo, la Stazione Tuscolana, il Centro Commerciale Happio.', '€ 360.000', NULL, '3 locali', '92 m2', '1 bagni', '4 piano', 'Affiliato Tecnocasa: STUDIO APPIO ALBERONE S.R.L.', '06 7821 531', '40269898', '17/01/2020', 'planimetria dubbia', 0, 'REJECTED'),
	(287, '77535472', 'Trilocale quarto piano, Roma', 'https://www.immobiliare.it/annunci/77535472/', 'ALBERONE APPIA FURIO CAMILLO - VIA VETURIA - Appartamento di ampia metratura posto al quarto piano di un PALAZZETTO D\'EPOCA, di soli cinque piani, del 1930; composto di : ingresso, soggiorno, 2 camere, cucina abitabile, bagno ed un balcone. Capiente soppalco,con doppio accesso, nel corridoio con faretti. L\'immobile gode di una DOPPIA ESPOSIZIONE che lo rende particolamente luminoso. Altezza dei soffitti m. 3.30. Ubicato in zona centrale con tutti i servizi nelle immediate vicinanze tra cui la fermata della Metro, linea A, Furio Camillo, la Stazione Tuscolana ed il Centro Commerciale Happio.', '€ 359.000', NULL, '3 locali', '94 m2', '1 bagni', '4 piano', 'Affiliato Tecnocasa: STUDIO APPIO ALBERONE S.R.L.', '06 7821 531', '40251523', '17/01/2020', 'planimetria dubbia', 0, 'REJECTED'),
	(288, '78465073', 'Trilocale via di Vigna Fabbri, Roma', 'https://www.immobiliare.it/annunci/78465073/', 'A pochi passi da Villa Lazzaroni e da Via Fortifiocca e dalla metro A Furio Camillo, vendesi Appartamento di 75 mq sito al piano primo in stabile di sette piani con ascensore, composto da : salone, cucina a vista ( nuova compresa nel prezzo di Vendita) , camera matrimoniale con cabina armadio fatta su misura compresa nel prezzo di vendita, cameretta, bagno con doccia, ripostiglio, soppalco e balcone. Ottime condizioni interne Prezzo di vendita Euro 320.000,00 trattabili + Euro 50,00 di spese Condominiali mensili', '€ 320.000', NULL, '3 locali', '75 m2', '1 bagni', '1 piano', 'Domus Intermedia', '06 5560 879,327 7062 122', 'FMC CANTU', '17/01/2020', 'primo piano', 0, 'DELETED'),
	(289, '78234257', 'Appartamento via Licia, Roma', 'https://www.immobiliare.it/annunci/78234257/', 'San Giovanni, ad Via Gallia precisamente in Via Licia ,cedesi attività di affittacamere ad uso turistico ,posta al 5° piano ,di 5 stanze con servizi, con oltre 20 posti letto. Le camere sono ristrutturate ,con impianti a norma. Contratto di locazione 8*8 con scadenza nel 2034,canone mensile 2.000 € Finemente arredate,con mobilio Le Fablier,materiale di arredo ignifugo. SERVIZI OFFERTI: Ascensore, Reception 24 h, Riscaldamento, Pulizie Giornaliere, Wi-Fi,Check In Automatico, Deposito Bagagli, Aria Condizionata, Questa deliziosa struttura offre il fascino di soggiornare nel cuore di Roma, ad 1 km dal Colosseo,dalla Basilica di San Giovanni in Laterano e dal Rione Monti . Tutti i servizi principali di Metro , linea bus , attività alimentari e shopping. sono adiacenti. Per info e appuntamenti contattare 3770823945', '€ 230.000', NULL, '5 locali', '200 m2', '3+ bagni', '5 piano', 'Domina.RE', '011 1962 3019', 'AL1678911', '09/01/2020', 'attività di fitta camere', 0, 'DELETED'),
