	(291, '78495935', 'Trilocale via SEGESTA, Roma', 'https://www.immobiliare.it/annunci/78495935/', 'Rif: gruppo immobiliare - Appio Latino adiacente Parco Caffarella ampia metratura doppia esposizione ingresso soggiorno due camere matrimoniali cucina abitabile servizio e ripostiglio € 259.000 Classe Energetica G (178 kWh/mqa) Potete contattarci telefonicamente dal lunedi al venerdi dalle 9.00 alle 13.00 e dalle 15.30 alle 19.30 ed il sabato dalle 9.00 alle 13.00 al seguente numero 06/5593685 o 06/5593687,via E-mail al seguente indirizzo info@gruppoimmobiliare.net oppure consultare tutte le nostre offerte sul sito internet www.gruppoimmobiliare.net', '€ 259.000', NULL, '3 locali', '87 m2', '1 bagni', '1 piano', 'GRUPPO IMMOBILIARE SRL', '06 9450 2249', 'gruppo immobiliare (2633483)', '20/01/2020', 'primo piano', 0, 'REJECTED'),
	(292, '78496009', 'Trilocale via di Santa Maria Ausiliatrice, Roma', 'https://www.immobiliare.it/annunci/78496009/', 'A pochi passi dalla fermata della metro A Furio Camillo, in via S. Maria Ausiliatrice, abbiamo appena messo in vendita un delizioso immobile completamente ristrutturato posto al 5° piano. L\'appartamento, di ca.65 mq, è composto da un soggiorno con angolo cottura, due camere da letto e bagno. Completa la proprietà un comodo balcone. L\'immobile si distingue per l\'eccellente ristrutturazione: in tutti gli ambienti possiamo notare il totale rifacimento dell\'impiantistica certificata a norma di legge, sono stati sostituiti tutti gli infissi con finestre di ottimo taglio termico che garantiscono silenziosità e risparmio energetico. L\'intera pavimentazione è in gres porcellanato. La posizione strategica e l\'ottima ristrutturazione rendono davvero interessante questa proposta immobiliare.', '€ 279.000', NULL, '3 locali', '65 m2', '1 bagni', '5 piano', 'Gruppo Capital', '06 7049 2448', '2/143', '20/01/2020', 'piccolo', 0, 'REJECTED'),
	(293, '78467883', 'Trilocale via Pasquale Tola, Roma', 'https://www.immobiliare.it/annunci/78467883/', 'VIA PASQUALE TOLA- In una via tranquilla, a pochi passi dalla piazza \'Scipione Ammirato\', fulcro importante del nostro quartiere, proponiamo l\'acquisto di un grazioso trilocale, posto ad un piano intermedio. Entrando dalla porta di ingresso sareti accolti in uno spazioso disimpegno, dal quale avrete la possibilità di accedere ai diversi ambienti della casa. Girando alla vostra destra, entrerete nel luminoso salone dove sarà possibile posizionare un comodo divano angolare. Proseguendo verso sinistra del disimpegno, troverete un\'ampia camera da letto matrimoniale ed il bagno finestrato. Un secondo disimpegno, divide la cucina abitabile dalla cameretta. Essendo da ristrutturare, la distribuzione degli spazi interni potrà facilmente essere modificata, a seconda delle vostre esigenze. Libero subito.', '€ 310.000', '€ 350.000', '3 locali', '80 m2', '1 bagni', '2 piano', 'Affiliato Tecnorete: STUDIO CIRCONVALLAZIONE APPIA S.R.L.', '06 8115 7925,366 4259 743', '40266821', '18/01/2020', 'REJECTEDplanimetria dubbia\nplanimetria dubbia', 0, 'REJECTED'),
	(294, '71125024', 'Appartamento via Magnagrecia, Roma', 'https://www.immobiliare.it/annunci/71125024/', 'In zona centrale, e più precisamente nel Quartiere San Giovanni, servita da numerosi locali commerciali e mezzi pubblici, proponiamo la vendita di un appartamento da ristrutturare, sito al 2° piano del palazzo, dotato di ascensore. L\'immobile, è così sviluppato: - ingresso; - soggiorno; - tre camere da letto; - cucina; - doppi servizi; - ripostiglio; - balcone. L\'appartamento, gode di una doppia esposizione sia interna che esterna su via Magna Grecia. La fermata della Metro "San Giovanni", dista circa 10 min (550 mt) a piedi dall\'immobile, e numerose le linee Bus che servono la zona. Per informazioni, contattare: - Tel: 06.78.34.41.01; - Mail: info@istudiodue.it.', '€ 365.000', NULL, '5 locali', '112 m2', '2 bagni', '2 piano', 'Immobiliare Studio Due S.R.L.', '06 7834 4101', 'EK-71125024', '20/07/2019', 'costoso', 0, 'DELETED'),
	(295, '78497305', 'Trilocale via Caio Lelio 1, Roma', 'https://www.immobiliare.it/annunci/78497305/', 'Tra le fermate metro A Giulio agricola e Subaugusta nel quartiere di Cinecittà, si propone in vendita un appartamento finemente ristrutturato, posto al piano secondo di uno stabile di 6 piani. L\'immobile è composto da una comoda e luminosa zona giorno, con angolo cottura, che affaccia su un\'ampia vetrata portafinestra. La zona notte si compone di una comoda camera da letto doppia con bagno in camera e una seconda camera. L\'affaccio dell\'intero appartamento è su via caio leio chiusa al traffico. L’ appartamento di circa 91 mq commerciali è completamente ristrutturato impianti a norma con certificazione di conformità e interamente predisposto per la climatizzazione. IL palazzo è in cortina è l\'appartamento è termoautonomo con spesa condominiale di euro 40 mensile. L\'unità immobiliare, ottimamente esposta a sud/est, gode di una posizione vicina a tutti i servizi della zona ( mercato supermercati ecc). Ottima zona, tranquilla di sera e piena di negozi nelle vicinanze con diversi locali raggiungibili a piedi. possibilità di vendita ammobiliato.', '€ 295.000', NULL, '3 locali', '92 m2', '2 bagni', '2 piano', '', 'https://media.immobiliare.it/text/tel_78497305_ebec4.jpg?k=dd2442f3ea9c5fe4f545b51ae1245056', 'EK-78497305', '21/01/2020', 'fuori zona prescelta', 0, 'DELETED'),
	(296, '78576589', 'Trilocale via Orti variani, Roma', 'https://www.immobiliare.it/annunci/78576589/', 'Casilina( Via Orti Variani) In via privata proponiamo delizioso trilocale in ottimo stato sito al quinto piano composto da salone, cucina, camera, cameretta, servizio e balcone. € 229.000,00. Prestazione energetica G. Tel. 3383278408', '€ 229.000', NULL, '3 locali', '75 m2', '1 bagni', '5 piano', 'UNIONE IMMOBILIARE ROMA', '06 4567 4768', '(2635739)', '23/01/2020', 'fuori zona prescelta', 0, 'REJECTED'),
	(297, '78554309', 'Trilocale via Caio Lelio 1, Roma', 'https://www.immobiliare.it/annunci/78554309/', 'Tra le fermate metro A Giulio agricola e Subaugusta nel quartiere di Cinecittà, il proprietario,quindi senza spese d\'intermediazione, propone in vendita un appartamento finemente ristrutturato, posto al piano secondo di uno stabile di 6 piani. L\'immobile è composto da una comoda e luminosa zona giorno, con angolo cottura, che affaccia su un\'ampia vetrata portafinestra. La zona notte si compone di una comoda camera da letto doppia con bagno in camera e una seconda camera. L\'affaccio dell\'intero appartamento è su via caio leio chiusa al traffico. L’ appartamento di circa 92 mq commerciali è completamente ristrutturato impianti a norma con certificazione di conformità e interamente predisposto per la climatizazione. Il palazzo è in cortina e l\'appartamento è termoautonomo con spesa condominiale di euro 40 mensile. L\'unità immobiliare, ottimamente esposta a sud/est, gode di una posizione vicina a tutti i servizi della zona ( mercato supermercati ecc). Ottima zona, tranquilla di sera e piena di negozi nelle vicinanze con diversi locali raggiungibili a piedi.il prezzo non è trattabile possibilità di vendita ammobiliato.', '€ 295.000', NULL, '3 locali', '92 m2', '2 bagni', '2 piano', '', 'https://media.immobiliare.it/text/tel_78554309_800d6.jpg?k=5ad8962bd1198d2e15980bc903fbc517', 'EK-78554309', '23/01/2020', 'fuori zona prescelta', 0, 'DELETED'),
	(298, '78520035', 'Trilocale via Montefalco, Roma', 'https://www.immobiliare.it/annunci/78520035/', 'Furio Camillo/ Via Montefalco Ingresso, salone, cucina a vista, disimpegno, studio, bagno finestrato, camera da letto soppalcata con cabina armadio, ripostiglio e due balconi. Adiacente alle fermate della Metro A "Furio Camillo" e "Ponte Lungo" nelle immediate vicinanze di tutti i principali servizi, proponiamo in vendita una soluzione trilocale posta la primo piano di una palazzina in tinta di cinque piani totali dotata di ascensore. La soluzione si presenta in ottimo stato in quanto ristrutturata finemente di recente. Il trilocale, rifinito nel dettaglio, deve la sua particolarità all\'ampia camera matrimoniale soppalcata con annessa cabina armadio e, dispone di: termo-valvole digitali, porta e cancelletti blindati, sistema di antifurto, infissi doppio vetro PVC, tende da sole, condizionatori, parete in vetro ceramica e scala in legno/ ferro battuto. L\'appartamento risulta molto luminoso grazie alla sua doppia esposizione. Collegamenti: La Metropolitana di Roma è raggiungibile dalle stazioni San Giovanni, Re di Roma, Ponte Lungo, Furio Camillo, Colli Albani, Arco di Travertino, Porta Furba/Quadraro e Numidio Quadrato. La Metropolitana di Roma C è raggiungibile dalle stazioni San Giovanni e Lodi. La Ferrovia Roma-Giardinetti è raggiungibile dalle stazioni: Ponte Casilino, Sant\'Elena, Villini, Alessi, Filarete, Tor Pignattara e Balzani. Il quartiere è servito dalla stazione di: Roma Tuscolana. Referente: Rita: 377.52.40.808', '€ 219.000', NULL, '3 locali', '73 m2', '1 bagni', '1 piano', 'Homeplace Group', '06 9785 9821,338 4163 367', 'montefalco219', '22/01/2020', 'cucina in salone', 0, 'REJECTED'),
	(299, '78562915', 'Trilocale via Cittaducale, Roma', 'https://www.immobiliare.it/annunci/78562915/', 'VILLA FIORELLI Via Cittaducale, proponiamo la vendita di un immobile di circa 80mq in buono stato, composto da ingresso, soggiorno, due camere, cucina abitabile, servizio, balcone. Completa la proprietà una cantina. Libero subito.', '€ 240.000', NULL, '3 locali', '80 m2', '1 bagni', '1 piano', 'Frimm Exclusive', '06 9480 0743', '(2635497)', '23/01/2020', 'primo piano', 0, 'DELETED'),
	(300, '78597867', 'Trilocale via Camilla 3, Roma', 'https://www.immobiliare.it/annunci/78597867/', 'Nel cuore del quartiere Appio, più precisamente in Via Camilla, Area-Re cura la vendita di un appartamento molto luminoso posto al primo piano. L\'appartamento è composto da un ampio ingresso, soggiorno, cucina, due camere ed un servizio. La zona dove è situato l\'immobile è servita da tutti i mezzi pubblici di trasporto, la metro Furio Camillo è raggiungibile in pochi minuti a piedi, e da ogni tipo di attività commerciale. Sempre nelle immediate vicinanze si può godere della tranquillità di spazi verdi come Villa Lazzaroni ed il Parco della Caffarella. AR003579 380.000 € TEL. 06 6780498', '€ 380.000', NULL, '3 locali', '80 m2', '1 bagni', '1 piano', 'AREA-RE centro storico', '06 6780 498', 'AR003579', '24/01/2020', 'primo piano', 0, 'DELETED'),
	(301, '78600293', 'Trilocale via di Vigna Fabbri, Roma', 'https://www.immobiliare.it/annunci/78600293/', 'A pochi passi da Villa Lazzaroni e da Via Fortifiocca e dalla metro A Furio Camillo, vendesi Appartamento di 75 mq sito al piano primo in stabile di sette piani con ascensore, composto da : salone, cucina a vista ( nuova compresa nel prezzo di Vendita) , camera matrimoniale con cabina armadio fatta su misura compresa nel prezzo di vendita, cameretta, bagno con doccia, ripostiglio, soppalco e balcone. Ottime condizioni interne Prezzo di vendita Euro 320.000,00 trattabili + Euro 50,00 di spese Condominiali mensili', '€ 320.000', NULL, '3 locali', '72 m2', '1 bagni', '1 piano', 'Domus Intermedia', '06 5560 879,327 7062 122', 'FMC CANTU', '24/01/2020', 'primo piano', 0, 'DELETED'),
	(302, '75806970', 'Trilocale piazza dei Re di, Roma', 'https://www.immobiliare.it/annunci/75806970/', 'Da privato a privato si vende in stabile recentemente ristrutturato appartamento ingresso, salone e due camere, bagno, grande cucina, ripostiglio, armadio a muro, 2 soppalchi; ottime condizioni, impianti a norma. Piano intermedio con ascensore. Parquet ovunque. Porta blindata. Triplo affaccio, luminoso, tranquillo, immediate vicinanze metro Re di Roma. Libero da persone e cose al rogito. Appartamento ex-portiere di proprietà condominiale a reddito. NEL RAMMENTARE CHE LA DICHIARAZIONE MENDACE È PUNITA DALLA LEGGE, SI PREGA DI PRECISARE CHE SI VUOLE ACQUISTARE COME PRIVATI. INTERMEDIARI/AGENZIE TASSATIVAMENTE ASTENERSI. € 379.000', '€ 379.000', NULL, '3 locali', '94 m2', '1 bagni', '3 piano', '', '', 'EK-75806970', '22/01/2020', 'REJECTED fuori zona prescelta \nfuori zona prescelta', 0, 'REJECTED'),
	(303, '78587235', 'Trilocale via Caulonia 13, Roma', 'https://www.immobiliare.it/annunci/78587235/', 'All\'interno del celeberrimo quartiere di San Giovanni, nel centro storico di Roma, nelle adiacenze di Piazza Zama e più precisamente in Via Caulonia, CONCEPT HOME cura la vendita di un ampio trilocale posto al quinto piano in un’elegante stabile in tinta recentemente ristrutturato. Entrando nell’appartamento ci troviamo in un lungo corridoio che ci consente l’accesso a tutti gli ambienti. Per prima incontriamo una comoda camera da letto matrimoniale, proseguendo abbiamo la cucina, il servizio con vasca e finestra, il soggiorno con porta finestra che ci fa uscire sul primo balcone ed una seconda camera matrimoniale balconata. L’immobile si presenta completamente da ristrutturare. Gode di una doppia esposizione opposta che lo rende molto luminoso e arioso. La zona è servitissima essendo uno dei quartieri principali e nevralgici della Capitale. Siamo a ridosso di Piazza Zama, dove c’è uno dei più grandi capolinea autobus della città; raggiungibili a piedi anche le fermate della metropolitana linea A San Giovanni e Re di Roma. Nelle vicinanze abbiamo il famoso mercato di Via Satrico e tutte le principali attività commerciali quali farmacie, scuole, supermercati e negozi di ogni genere. Qualunque sia la Vostra esigenza immobiliare, inviateci una e-mail all\'indirizzo sangiovanni@concepth.it. o visitate il nostro sito http://www.concepth.it. CONCEPT HOME - Sentirsi di Casa. RIF T 372', '€ 320.000', NULL, '3 locali', '90 m2', '1 bagni', '5 piano', 'CONCEPT HOME SAN GIOVANNI', '06 9785 7971', 'T372', '24/01/2020', 'fuori zona prescelta', 0, 'REJECTED'),
	(304, '78579641', 'Trilocale piazza Zama 3, Roma', 'https://www.immobiliare.it/annunci/78579641/', 'Al secondo piano della caratteristica palazzina anni 50, ubicata al civico 3 di Piazza Zama, l\'agenzia immobiliare Zona X, propone la vendita di un appartamento trilocale di circa 95 mq, con doppio affaccio. L\'appartamento attualmente si compone di: ingresso con cucina a vista, ampio salone munito di balcone con affaccio su Piazza Zama, due camere, di cui una con cabina armadio ed un balcone. prezzo di richiesta euro 380000,00 per info ed appuntamenti nicola 3382659369', '€ 380.000', NULL, '3 locali', '95 m2', '1 bagni', '2 piano', 'Zona X Immobiliare', '338 2659 369', 'L30', '24/01/2020', 'fuori zona prescelta', 0, 'REJECTED'),
	(305, '78546407', 'Trilocale buono stato, secondo piano, Roma', 'https://www.immobiliare.it/annunci/78546407/', 'San giovanni, precisamente in via Cerveteri, proponiamo in vendita un appartamento molto luminoso e ben esposto posto al secondo piano catastale di 92 mq all\'interno di uno stabile d\'epoca signorile, dotato di ascensore e servizio di portierato tutto il giorno, a pochi passi dall\'ingresso della fermata metro A piazza Re di Roma e ben servito da tutti i servizi e le infrastrutture presenti nella zona. L\'appartamento è composto da ingresso, salone, cucina abitabile, due camere da letto, corridoio di disimpegno con piccola zona studio, un bagno con finestra ed un ampio ripostiglio finestrato. Il prezzo richiesto è di € 329.000,00; l\'immobile è attualmente a reddito, affittato a persone referenziate con contratto di locazione in scadenza il 15/05/2022 ad un canone annuo di 10.800 €. Per ulteriori informazioni e visite contattare il +39 3930042666', '€ 329.000', NULL, '3 locali', '92 m2', '1 bagni', '2 piano', 'Ciacci Studio Immobiliare', '335 490 384', 'FB - Cerveteri', '22/01/2020', 'fuori zona prescelta', 0, 'DELETED'),
	(306, '73866980', 'Trilocale via Mesopotamia 10, Roma', 'https://www.immobiliare.it/annunci/73866980/', 'Nel quartiere San Giovanni, in via Mesopotamia ,in palazzo signorile ,offriamo in vendita un delizioso appartamento di circa 90 mq, balcone con vista panoramica,sala, ,2 camere da letto, cucina abitabile con 2 bagni.L\' appartamento è ristrutturato ed è situato in una zona ben servita da mezzi di trasporto e vari negozi.€369.000', '€ 369.000', NULL, '3 locali', '90 m2', '1 bagni', '4 piano', 'Maddalena Ladisa', '06 9480 5207', 'EK-73866980', '13/01/2020', 'costoso', 0, 'REJECTED'),
	(307, '78519919', 'Trilocale via Volterra, Roma', 'https://www.immobiliare.it/annunci/78519919/', 'San Giovanni, via Volterra, poco distante dalla Metro "A" e "C", appartamento al terzo piano con ascensore, luminoso e silenzioso, 110 mq, composto da ingresso, soggiorno, 2 camere da letto matrimoniali, cucina abitabile, bagno, balcone e cantina. Euro 360.000 . Tel. 06-37512126.', '€ 360.000', NULL, '3 locali', '110 m2', '1 bagni', '3 piano', 'Immobiliare di S.R.', '06 3615 6278', 'EK-78519919', '22/01/2020', 'costoso', 0, 'DELETED'),
	(308, '78514299', 'Trilocale via Tarquinio Prisco, Roma', 'https://www.immobiliare.it/annunci/78514299/', 'FURIO CAMILLO - Via Tarquinio Prisco, all\'interno di uno stabile in cortina, proponiamo la vendita di un appartamento di 100 mq ca., posto al 4^ piano, composto da ingresso, salone, cucina abitabile, due camere, servizio, ripostiglio, due ampi balconi. Luminoso.', '€ 365.000', NULL, '3 locali', '105 m2', '1 bagni', '4 piano', 'Frimm Exclusive', '06 9480 0743', '(2633920)', '22/01/2020', 'costoso', 0, 'REJECTED'),
	(309, '78506363', 'Trilocale via Giacomo Costamagna 52, Roma', 'https://www.immobiliare.it/annunci/78506363/', 'Vendo appartamento in prossimità di Villa Lais posto al 2° piano di una palazzina in cortina. Composto da ampio ingresso con armadio a muro, soggiorno, 2 camere matrimoniali, cucina abitabile, bagno, completano la proprietà due balconi. L\'appartamento necessità di una parziale ristrutturazione e si presta a diverse modifiche nonché una terza camera o secondo bagno. Termocentralizzato. Euro 355.000 NO AGENZIE Per foto ed ulteriori informazioni contattarmi in privato', '€ 355.000', NULL, '3 locali', '98 m2', '1 bagni', '2 piano', 'Antonella Catania', '', 'EK-78506363', '22/01/2020', 'costoso', 0, 'REJECTED'),
	(310, '78613319', 'Trilocale via Caio Lelio 1, Roma', 'https://www.immobiliare.it/annunci/78613319/', 'Tra le fermate metro A Giulio agricola e Subaugusta nel quartiere di Cinecittà, il proprietario,quindi senza spese d\'intermediazione, propone in vendita un appartamento finemente ristrutturato, posto al piano secondo di uno stabile di 6 piani. L\'immobile è composto da una comoda e luminosa zona giorno, con angolo cottura, che affaccia su un\'ampia vetrata portafinestra. La zona notte si compone di una comoda camera da letto doppia con bagno in camera e una seconda camera. L\'affaccio dell\'intero appartamento è su via caio leio chiusa al traffico. L’ appartamento di circa 92 mq commerciali è completamente ristrutturato impianti a norma con certificazione di conformità e interamente predisposto per la climatizazione. Il palazzo è in cortina e l\'appartamento è termoautonomo con spesa condominiale di euro 40 mensile. L\'unità immobiliare, ottimamente esposta a sud/est, gode di una posizione vicina a tutti i servizi della zona ( mercato supermercati ecc). Ottima zona, tranquilla di sera e piena di negozi nelle vicinanze con diversi locali raggiungibili a piedi. Possibilità di vendita ammobiliato, assolutamente astenersi agenti o agenzie immobiliari grazie', '€ 295.000', NULL, '3 locali', '92 m2', '2 bagni', '2 piano', '', 'https://media.immobiliare.it/text/tel_78613319_97a2d.jpg?k=900429d8b47a7956da608af2d7bdfd2b', 'EK-78613319', '27/01/2020', 'fuori zona prescelta', 0, 'DELETED'),
	(311, '78624371', 'Quadrilocale via Ettore Ciccotti, Roma', 'https://www.immobiliare.it/annunci/78624371/', 'Nel quartiere Colli Albani, a 300 m. dal Parco Della Caffarella e a 400 m dalla fermata della metropolitana linea "A", proponiamo al terzo piano di uno stabile con servizio di portierato sito in via Ettore Ciccotti, un appartamento di 110 mq, così composto: ingresso, salone, cucina abitabile, due camere matrimoniali, una cameretta, ripostiglio ed un piccolo balconcino di 3 mq. L\'appartamento è situato in un contesto silenzioso e allo stesso tempo è ben servito da supermercati, banche, negozi per ogni necessità. Essendo da ristrutturare, è possibile cambiare la disposizione interna dell\'appartamento adattandola alle proprie esigenze. I render pubblicati rappresentano una proposta di ristrutturazione. Siamo convenzionati con una ditta specializzata che può ristrutturare totalmente l\'immobile (comprensivo di rifacimento impianti) al prezzo a partire da € 30.000. Prezzo di vendita € 359.000', '€ 359.000', NULL, '4 locali', '110 m2', '2 bagni', '3 piano', 'italgest 93 sas di marcantonio am & c', '06 5200 915,335 6573 716', 'ETTORE CICCOTTI', '27/01/2020', 'costosa', 0, 'REJECTED'),
	(312, '78638817', 'Trilocale via Lidia 5, Roma', 'https://www.immobiliare.it/annunci/78638817/', 'Nel cuore dell\'Appio Latino, nelle immediate vicinanze del Parco della Caffarella, più precisamente in via Lidia, in stabile in tinta ristrutturato, proponiamo un appartamento composto da: ampio ingresso, salone, due camere, cucina abitabile, servizio e due balconi. Il piano alto, la doppia esposizione e l\'affaccio aperto rendono l\'immobile luminoso e arioso. La zona è ottimamente servita da diversi mezzi pubblici, quali metro A e autobus e da servizi al cittadino come scuole, banche, ristoranti, posta, palestre e farmacie.', '€ 309.000', '€ 339.000', '3 locali', '80 m2', '1 bagni', '3 piano', 'area-re agenzia appio', '06 7047 4087', 'AR003581', '28/01/2020', 'REJECTED fuori zona prescelta \nfuori zona prescelta', 0, 'DELETED'),
	(313, '78639385', 'Trilocale via Genzano, Roma', 'https://www.immobiliare.it/annunci/78639385/', 'colli albani in via genzano nei pressi della metro A e parco caffarella proponiamo trilocale posto al piano alto luminoso e silenzioso composto da soggiorno cucina abitabile due camere matrimoniali bagno balcone ascensore .', '€ 259.000', NULL, '3 locali', '85 m2', '1 bagni', '5 piano', 'immobilsci evolution srl', '06 9480 4927', 'EK-78639385', '28/01/2020', ' diminuzione del prezzo, non ci convinceva il bagno e manca la planimetria, però lo visioneremo', 0, 'SELECTED'),
	(314, '78659605', 'Trilocale via Caio Lelio 1, Roma', 'https://www.immobiliare.it/annunci/78659605/', 'Tra le fermate metro A Giulio agricola e Subaugusta nel quartiere di Cinecittà, il proprietario,quindi senza spese d\'intermediazione, propone in vendita un appartamento finemente ristrutturato, posto al piano secondo di uno stabile di 6 piani. L\'immobile è composto da una comoda e luminosa zona giorno, con angolo cottura, che affaccia su un\'ampia vetrata portafinestra. La zona notte si compone di una comoda camera da letto doppia con bagno in camera e una seconda camera. L\'affaccio dell\'intero appartamento è su via caio leio chiusa al traffico. L’ appartamento di circa 92 mq commerciali è completamente ristrutturato impianti a norma con certificazione di conformità e interamente predisposto per la climatizazione. Il palazzo è in cortina e l\'appartamento è termoautonomo con spesa condominiale di euro 40 mensile. L\'unità immobiliare, ottimamente esposta a sud/est, gode di una posizione vicina a tutti i servizi della zona ( mercato supermercati ecc). Ottima zona, tranquilla di sera e piena di negozi nelle vicinanze con diversi locali raggiungibili a piedi. Possibilità di vendita ammobiliato, assolutamente astenersi agenti o agenzie immobiliari grazie', '€ 295.000', NULL, '3 locali', '92 m2', '2 bagni', '2 piano', '', 'https://media.immobiliare.it/text/tel_78659605_4e452.jpg?k=0ee95b1e9db9688cf9e9fb32f1335b59', 'EK-78659605', '29/01/2020', 'fuori zona prescelta', 0, 'DELETED'),
	(315, '78662651', 'Trilocale ottimo stato, secondo piano, Roma', 'https://www.immobiliare.it/annunci/78662651/', 'Via Rimini: a due passi dalla centralissima Via Appia Nuova e dalla fermata delle Metro A e C \'\' San Giovanni\'\' trilocale completamente ristrutturato posto ad un piano medio all\'interno di uno piccolo stabile d\'epoca degli anni 20 di soli 4 piani e dotato di ascensore. L\'appartamento è composto da ingresso, soggiorno con angolo cottura (che attualmente è stato suddiviso in due stanze con un muro in cartongesso facilmente rimovibile) due camere da letto , ripostiglio, un vano a scomparsa per la lavatrice ed un bagno. Inoltre l\'appartamento è dotato di una comoda soffitta di pertinenza. L\'immobile presenta finiture quali, parquet nella zona notte, porte in legno massello e nelle stanze sono ancora presenti gli stucchi originali. Inoltre l\'appartamento è dotato infissi termoisolanti con doppio vetro, condizionatori, tre soppalchi, porta blindata, cassaforte, antifurto e riscaldamento autonomo. L\'immobile ha un esposizione assolata , gli ambienti sono confortevoli e ben distribuiti ed inoltre, visto l\'ottimo stato interno, l\'appartamento può essere abitato da subito evitando nell\'immediato ulteriori spese di lavori di ristrutturazione (il ripristino del soggiorno con angolo cottura sarebbe a carico dell\'attuale proprietario).', '€ 370.000', NULL, '3 locali', '82 m2', '1 bagni', '2 piano', 'Affiliato Tecnocasa: STUDIO RE DI ROMA S.R.L.', '06 7759 1919', 'EK-78662651', '29/01/2020', 'costoso', 0, 'DELETED'),
	(316, '78655111', 'Trilocale via Tuscolana 1120, Roma', 'https://www.immobiliare.it/annunci/78655111/', 'Privato vende appartamento luminoso con affaccio su via Tuscolana altezza metro Giulio Agricola, 5° piano con ascensore e portiere, ampio ingresso con soppalco, camera da letto, cameretta con balcone, salone doppio con ampia zona cottura facilmente divisibile in due ambienti, bagno, finestre e caldaia nuove, predisposizione riscaldamento autonomo, impianto luce a norma, fibra ottica, antenna tv e Sky. NO AGENZIE. Possibilità arredo. 90 mq + 10 mq balcone', '€ 289.000', NULL, '3 locali', '90 m2', '1 bagni', '5 piano', '', 'https://media.immobiliare.it/text/tel_78655111_d15a8.jpg?k=0bedf27577f4fab46a961b3c4c86bbb1', 'EK-78655111', '29/01/2020', 'fuori zona prescelta', 0, 'DELETED'),
	(317, '78660577', 'Trilocale piazza Armenia, Roma', 'https://www.immobiliare.it/annunci/78660577/', 'Nel quartiere storico di San Giovanni, a pochi passi dalla metro A San Giovanni, Re di Roma e la fermata della linea C, proponiamo in vendita un ampio trilocale in palazzina anni \'30 posto al terzo piano di 80 mq ca. . L\'immobile, ristrutturato e luminoso, è ubicato nella centrale e ben servita Piazza Armenia, e si presenta così composto: ampio ingresso, soggiorno, camera, cameretta, cucina, bagno e balcone accessibile da cucina e cameretta. L\'immobile è in ottimo stato.', '€ 359.000', NULL, '3 locali', '80 m2', '1 bagni', '3 piano', 'Affiliato Tecnocasa: MEDIAZIONI SAN GIOVANNI S.R.L. SOCIO UNICO', '06 7720 6070', 'EK-78660577', '29/01/2020', 'fuori zona prescelta', 0, 'DELETED'),
	(318, '78673405', 'Quadrilocale via Ettore Ciccotti, Roma', 'https://www.immobiliare.it/annunci/78673405/', 'APPIO LATINO e più precisamente in Via Ettore Ciccotti - All\' interno di uno stabile in semi cortina, signorile e con servizio di portineria, vi proponiamo l\'acquisto di un ampio QUADRILOCALE. La sua distribuzione interna è ottimale, infatti, la casa è già suddivisa in una comoda zona giorno all\'entrata e una funzionale zona notte. L\'abitazione, che gode di doppia esposizione, è comoda in ogni suo ambiente ed è così composta: entrando vi troverete in una zona di ingresso con ripostiglio che vi accompagna in un ampio ed accogliente salone. Adiacente al salone abbiamo una funzionale cucina abitabile. Proseguendo nel disimpegno della casa, troverete tre camere da letto e doppi servizi. Il tutto viene completato da un altro comodo e ampio ripostiglio. L\'abitazione risulta da ristrutturare, il riscaldamento è centralizzato ed è libera subito. L\'immobile è situato nel quartiere Colli Albani a pochi metri dall\'omonima fermata Metro, vicinissimo al Parco della Caffarella e nell\'immediata vicinanza di tutti i servizi commerciali e di trasporto pubblico. Non sono presenti barriere architettoniche. E\' ideale sia per uso ufficio che per famiglie con bambini vista la vicinanza di scuole, parchi e negozi per ogni necessità. Per ulteriori informazioni e per fissare un appuntamento contattare il numero: 06.45.77.63.10', '€ 355.000', NULL, '4 locali', '115 m2', '2 bagni', '1 piano', 'Affiliato Tecnorete: IMMOBILIARE COLLI ALBANI SRL', '06 4577 6310,375 6337 212', 'EK-78673405', '30/01/2020', 'primo piano', 0, 'REJECTED'),
	(319, '78674531', 'Trilocale via Camilla 3, Roma', 'https://www.immobiliare.it/annunci/78674531/', 'Nel cuore del quartiere Appio, più precisamente in Via Camilla, Area-Re cura la vendita di un appartamento molto luminoso posto al primo piano. L\'appartamento è composto da un ampio ingresso, soggiorno, cucina, due camere ed un servizio. La zona dove è situato l\'immobile è servita da tutti i mezzi pubblici di trasporto, la metro Furio Camillo è raggiungibile in pochi minuti a piedi, e da ogni tipo di attività commerciale. Sempre nelle immediate vicinanze si può godere della tranquillità di spazi verdi come Villa Lazzaroni ed il Parco della Caffarella. AR003579 380.000 € TEL. 06 6780498', '€ 380.000', NULL, '3 locali', '80 m2', '1 bagni', '1 piano', 'AREA-RE centro storico', '06 6780 498', 'AR003579', '30/01/2020', 'primo piano', 0, 'DELETED'),
