	(327, '78719799', 'Quadrilocale via Ettore Ciccotti, Roma', 'https://www.immobiliare.it/annunci/78719799/', 'APPIO LATINO e più precisamente in Via Ettore Ciccotti - All\' interno di uno stabile in semi cortina, signorile e con servizio di portineria, vi proponiamo l\'acquisto di un ampio QUADRILOCALE. La sua distribuzione interna è ottimale, infatti, la casa è già suddivisa in una comoda zona giorno all\'entrata e una funzionale zona notte. L\'abitazione, che gode di doppia esposizione, è comoda in ogni suo ambiente ed è così composta: entrando vi troverete in una zona di ingresso con ripostiglio che vi accompagna in un ampio ed accogliente salone. Adiacente al salone abbiamo una funzionale cucina abitabile. Proseguendo nel disimpegno della casa, troverete tre camere da letto e doppi servizi. Il tutto viene completato da un altro comodo e ampio ripostiglio. L\'abitazione risulta da ristrutturare, il riscaldamento è centralizzato ed è libera subito. L\'immobile è situato nel quartiere Colli Albani a pochi metri dall\'omonima fermata Metro, vicinissimo al Parco della Caffarella e nell\'immediata vicinanza di tutti i servizi commerciali e di trasporto pubblico. Non sono presenti barriere architettoniche. E\' ideale sia per uso ufficio che per famiglie con bambini vista la vicinanza di scuole, parchi e negozi per ogni necessità. Per ulteriori informazioni e per fissare un appuntamento contattare il numero: 06.45.77.63.10', '€ 355.000', NULL, '4 locali', '115 m2', '2 bagni', '1 piano', 'Affiliato Tecnorete: IMMOBILIARE COLLI ALBANI SRL', '06 4577 6310,375 6337 212', '40273496', '01/02/2020', 'primo piano', 0, 'REJECTED'),
