	(337, '78823297', 'Trilocale ottimo stato, secondo piano, Roma', 'https://www.immobiliare.it/annunci/78823297/', 'Via Rimini: a due passi dalla centralissima Via Appia Nuova e dalla fermata delle Metro A e C \'\' San Giovanni\'\' trilocale completamente ristrutturato posto ad un piano medio all\'interno di uno piccolo stabile d\'epoca degli anni 20 di soli 4 piani e dotato di ascensore. L\'appartamento è composto da ingresso, soggiorno con angolo cottura (che attualmente è stato suddiviso in due stanze con un muro in cartongesso facilmente rimovibile) due camere da letto , ripostiglio, un vano a scomparsa per la lavatrice ed un bagno. Inoltre l\'appartamento è dotato di una comoda soffitta di pertinenza. L\'immobile presenta finiture quali, parquet nella zona notte, porte in legno massello e nelle stanze sono ancora presenti gli stucchi originali. Inoltre l\'appartamento è dotato infissi termoisolanti con doppio vetro, condizionatori, tre soppalchi, porta blindata, cassaforte, antifurto e riscaldamento autonomo. L\'immobile ha un esposizione assolata , gli ambienti sono confortevoli e ben distribuiti ed inoltre, visto l\'ottimo stato interno, l\'appartamento può essere abitato da subito evitando nell\'immediato ulteriori spese di lavori di ristrutturazione (il ripristino del soggiorno con angolo cottura sarebbe a carico dell\'attuale proprietario).', '€ 370.000', NULL, '3 locali', '82 m2', '1 bagni', '2 piano', 'Affiliato Tecnocasa: STUDIO RE DI ROMA S.R.L.', '06 7759 1919', 'EK-78823297', '04/02/2020', 'fuori zona prescelta', 0, 'DELETED'),
	(338, '78823155', 'Trilocale via Paolo Paruta, Roma', 'https://www.immobiliare.it/annunci/78823155/', 'RIF 149 - APPIO LATINO - Adiacente via Baccarini e a pochi passi dalla fermata della metropolitana linea A \'Ponte Lungo\' e \'Furio Camillo\' e più precisamente in via Paolo Paruta, all\'interno di una palazzina degli anni 50 in ottimo stato, Supreme House propone la vendita di un luminoso e silenzioso secondo piano di sei con ascensore, in buono stato manutentivo. L\'immobile ha una superficie di 70 mq così distribuiti: ingresso, soggiorno, due camere matrimoniali, cucina abitabile, servizio e balcone. Gode di doppia esposizione a Sud Est. Le presenti informazioni non costituiscono elemento contrattuale. Per ulteriori informazioni vi invitiamo a contattarci al numero 06/45652397 o al 373/7554568. REF 149 - APPIO LATINO - Adjacent to via Baccarini and a few steps from the metro stop line A \'Ponte Lungo\' and \'Furio Camillo\' and more precisely in via Paolo Paruta, inside a building from the 50s in excellent condition, Supreme House offers the sale of a bright and quiet second floor of six with lift, in a good state of repair. The property has an area of ??70 square meters distributed as follows: entrance, living room, two double bedrooms, kitchen, bathroom and balcony. It enjoys double exposure to the South East. This information does not constitute a contractual element. For more information, please contact us at 06/45652397 or 373/7554568.', '€ 245.000', NULL, '3 locali', '70 m2', '1 bagni', '2 piano', 'Supreme House', '373 7554 178,06 4565 2397', '149', '04/02/2020', 'fuori zona prescelta', 0, 'REJECTED'),
	(339, '78860369', 'Trilocale via Mistretta, Roma', 'https://www.immobiliare.it/annunci/78860369/', 'Proponiamo in vendita a pochi passi da Piazza Lodi e dalla Fermata Metro LODI, in un palazzo d’epoca in ottimo stato di 2 piani, un immobile posto al primo piano, composto da ampio soggiorno, cucina abitabile, 2 camere da letto e bagno. L’appartamento grazie alla sua tripla esposizione, è molto luminoso.', '€ 249.000', NULL, '3 locali', '70 m2', '1 bagni', '1 piano', 'Tema group one', '06 8765 5321', 'EK-78860369', '05/02/2020', 'primo piano', 0, 'DELETED'),
	(340, '78870749', 'Trilocale via Etruria 27, Roma', 'https://www.immobiliare.it/annunci/78870749/', 'Siamo lieti di proporre un quinto piano completamente ristrutturato,integralmente, circa 4 anni fa. Entrambe le esposizioni sono aperte e gradevoli e conferiscono alla casa un\'estrema luminosità. Appena entriamo c è una zona ingresso che consente l\'accesso comodo al salone, alla cucina e al disimpegno che raccorda le 2 camere da letto e al bagno. Lo spazio esterno consta di un comodo balcone che collega sia la sala, sia la camera padronale. Completa la proprietà una cantina ( anch\'essa ristrutturata ) di circa 12 mq. Sono presenti 2 climatizzatori ( caldo /freddo ) , infissi doppio vetro, zanzariere fatte su misura e armadi a muro ricavati dagli incavi naturali dell\'immobile. Parte degli arredi , qualora fossero di gradimento ( tipo la cucina, armadio a 9 ante, etc ) verrebbero lasciati dalla proprietà. E\' possibile parcheggiare motorini /scooter all\'interno del condominio. Per gli appuntamenti, ci si accorda di volta in volta ( non ci sono giorni e orari prestabiliti ).', '€ 360.000', NULL, '3 locali', '93 m2', '1 bagni', '5 piano', 'enjoy immobiliare', '06 9480 0883', 'Etruria', '05/02/2020', 'costosa', 0, 'DELETED'),
	(341, '78884825', 'Trilocale via Tuscolana 652, Roma', 'https://www.immobiliare.it/annunci/78884825/', 'ARCO DI TRAVERTINO: TRILOCALE RESTAURATO Arco di Travertino: trilocale restaurato Arco di Travertino/Via Tuscolana Ingresso, ampio soggiorno, cucina abitabile, due camere da letto matrimoniali, bagno finestrato, due spaziosi ripostigli e posto auto condominiale. In un comprensorio riservato, a 500m dalla metro A “Arco di travertino” proponiamo in vendita un trilocale ristrutturato, posto al primo piano, di una palazzina di quattro piani totali in cortina. L\'appartamento si presenta in ottimo stato interno, poiché la ristrutturazione è stata effettuata cinque anni fa. Grazie alla sua disposizione interna è possibile creare un\'ampia zona giorno/living con cucina a vista. L\'appartamento gode di una buona luminosità, nonostante sia un primo piano. Per info e / o appuntamenti contattare il numero: 392.43. 96.399 (anche whatsapp) Servizi e mezzi: Il quartiere Arco di Travertino, si estende da via Tuscolana e la via Appia Nuova. Nell\'area sud della zona, a ridosso di via Appia Nuova, si trova il parco archeologico delle Tombe di via Latina, Completa in ogni servizio per il pubblico. Ben collegata grazie al capolinea degli autobus ad Arco di Travertino e la metro A (Arco di Travertino).', '€ 260.000', NULL, '3 locali', '90 m2', '1 bagni', '1 piano', 'Mecenate Immobiliare', '392 4396 399', 'tuscolana260', '06/02/2020', 'primo piano', 0, 'DELETED'),
