	(344, '78906215', 'Trilocale via Caio Lelio 1, Roma', 'https://www.immobiliare.it/annunci/78906215/', 'Tra le fermate metro A Giulio agricola e Subaugusta nel quartiere di Cinecittà, il proprietario,quindi senza spese d\'intermediazione, propone in vendita un appartamento finemente ristrutturato, posto al piano secondo di uno stabile di 6 piani. L\'immobile è composto da una comoda e luminosa zona giorno, con angolo cottura, che affaccia su un\'ampia vetrata portafinestra. La zona notte si compone di una comoda camera da letto doppia con bagno in camera e una seconda camera. L\'affaccio dell\'intero appartamento è su via caio leio chiusa al traffico. L’ appartamento di circa 92 mq commerciali è completamente ristrutturato impianti a norma con certificazione di conformità e interamente predisposto per la climatizazione. Il palazzo è in cortina e l\'appartamento è termoautonomo con spesa condominiale di euro 40 mensile. L\'unità immobiliare, ottimamente esposta a sud/est, gode di una posizione vicina a tutti i servizi della zona ( mercato supermercati ecc). Ottima zona, tranquilla di sera e piena di negozi nelle vicinanze con diversi locali raggiungibili a piedi. Possibilità di vendita ammobiliato, assolutamente astenersi agenti o agenzie immobiliari grazie', '€ 295.000', NULL, '3 locali', '92 m2', '2 bagni', '2 piano', '', 'https://media.immobiliare.it/text/tel_78906215_4451a.jpg?k=5918449ca3aedac0155a734265c62761', 'EK-78906215', '07/02/2020', 'fuori zona prescelta', 0, 'DELETED'),
	(345, '78911073', 'Trilocale via Magnagrecia, Roma', 'https://www.immobiliare.it/annunci/78911073/', 'SAN GIOVANNI in VIA MAGNA GRECIA Appartamento al piano 2° composto da ingresso, 3 camere, cucina, bagno e balcone. Cantina. Libero da subito BASE D\'ASTA € 303.264 ASTA IMMOBILIARE FOTO INTERNE - DOCUMENTAZIONE AGGIORNATA DISPONIBILE IN SEDE Lo Studio Aste Immobili Roma offre una REALE Assistenza Legale per Immobili Acquisibili tramite ASTA GIUDIZIARIA dalla fase di ricerca sino all\'immissione in possesso dell\'immobile con la consegna delle chiavi. In caso di mancata aggiudicazione nulla è dovuto in termini di onorario. La partecipazione all\'asta per i nostri clienti è TOTALMENTE GRATUITA e non prevede costi o rimborsi per il Legale rappresentante in caso di NON Aggiudicazione. GLI IMMOBILI ALL\'ASTA SONO: - Mutuabili al 100% - Visionabili prima dell\'acquisto - Acquistabili in totale sicurezza - Trasferiti senza oneri Notarili - Aggiudicabili con un risparmio che va dal 15 al 60% sul valore di mercato PER OGNI CLIENTE OFFRIAMO: - Consulenza ed assistenza legale in tutte le fasi dell\'acquisto - Ricerca personalizzata dell\'immobile - Prenotazione delle visite interne agli immobili - Intera documentazione dell\'immobile prima della partecipazione all\'asta - Valutazione dell\'offerta da presentare in Asta rispetto al reale valore commerciale - Predisposizione della partecipazione all\'asta con la redazione della Domanda di partecipazione - Esclusiva per la partecipazione all\'asta - Rappresentanza Legale gratuita il giorno dell\'Udienza di Vendita - Assistenza Legale dall\'aggiudicazione alla consegna dell\'immobile CONTATTACI per un appuntamento informativo e gratuito sulle procedure di acquisto in Asta.', '€ 303.264', NULL, '3 locali', '117 m2', '1 bagni', '2 piano', 'Aste Immobili Roma', '06 8892 0680,389 9441 009', 'MAGNA GRECIA', '07/02/2020', 'asta', 0, 'REJECTED'),
