	(347, '78512175', 'Trilocale via Alba, Roma', 'https://www.immobiliare.it/annunci/78512175/', 'Appia Nuova-Ad.ze Piazza Re di Roma.In uno stabile medio signorile in tinta a pochi passi dalla fermata della metro "A" Re di Roma proponiamo ad un prezzo molto interessante luminosissimo e silenzioso appartamento con doppia esposizione composto da ampio ingresso, soggiorno, 3 camere matrimoniali, cucina abitabile, bagno, balcone. L\'appartamento si trova in una zona centrale e nelle immediate vicinanze di via Appia Nuova ed è ben servito da diverse attività commerciali e mezzi pubblici, inoltre l\'ottima disposizione degli spazi, offre la possibilità di ricavare un secondo servizio. € 369.000 Rif. A1/20 tel. 06-78393965 Whastapp 334-1207397. Roma Gruppo Immobiliare è una società di intermediazione nata con un preciso obiettivo: quello di essere il punto di riferimento del cliente per risolvere qualsiasi problema di natura immobiliare nella città di Roma e Provincia, dalla semplice idea di acquisto, vendita o locazione, fino alla consegna delle chiavi! E\' formato da un team di professionisti qualificati e dinamici con esperienza pluriennale nel settore che sapranno trovare la giusta soluzione per ogni tipo di necessità, instaurando un rapporto di reale complicità con il cliente aiutandolo a realizzare il vero obiettivo e soddisfarlo in pieno. La nostra sede è in Via Enea n. 51, orari da lunedì al venerdì dalle 9.00 alle 19.30 e il sabato dalle 9.00 alle 12.45.', '€ 369.000', NULL, '3 locali', '102 m2', '1 bagni', '4 piano', 'Roma Gruppo Immobiliare', '06 7839 3965,334 1207 397', 'A1/20', '07/02/2020', 'fuori zona prescelta', 0, 'REJECTED'),
