	(353, '77793878', 'Trilocale via Ipponio, Roma', 'https://www.immobiliare.it/annunci/77793878/', 'Nel quartiere San Giovanni nelle adiacenze della stazione della metropolitana Amba Aradam/Ipponio di prossima apertura e più precisamente in Via Ipponio proponiamo un appartamento di circa 90 mq, con doppio affaccio, sito al primo piano di un palazzo con ascensore. L\'appartamento è composto da un ampio ingresso, un soggiorno, due camere, una cucina e due bagni. L\'immobile è inserito in un contesto residenziale molto tranquillo, a pochi minuti a piedi dalle Terme di Caracalla. La SAMO Italia S.r.l. è una agenzia immobiliare che opera su tutto il territorio nazionale attraverso un team di elevato livello professionale e grazie alle competenze acquisite in oltre 25 anni di attività ed ai processi di vendita adottati è divenuta oggi un punto di riferimento per moltissimi Proprietari di Immobili costituiti principalmente da Soggetti Privati, Enti Morali, Enti Religiosi, Istituti di Credito, Società Private, Enti Pubblici e Società di Costruzione.', '€ 375.000', NULL, '3 locali', '90 m2', '2 bagni', '1 piano', 'SAMO ITALIA S.r.l.', '06 3974 0909', '16861', '10/02/2020', 'primo piano', 0, 'REJECTED'),
