zione, sia nel settore residenziale che in quello commerciale.', '€ 339.000', NULL, '3 locali', '90 m2', '1 bagni', '5 piano', 'Metriquadri Network Immobiliare', '06 9450 6624', 'DC', '10/02/2020', 'planimetria interessante e prezzo interessante', 0, 'SELECTED'),
