	(366, '79030453', 'Quadrilocale via Tuscolana 463, Roma', 'https://www.immobiliare.it/annunci/79030453/', 'Rivolta vende all\'asta , in Via Tuscolana, appartamento di mq 105 sito al primo piano, composto da: ingresso, salone, due camere, bagno e terrazzo. La zona in cui si trova l\'immobile è ricca di servizi e negozi di ogni genere ed è ottimamente collegata con il trasporto pubblico urbano. Offerta minima € 168.300. Data Asta 18/05/2020. COMPRA ALL’ ASTA CON NOI. TI ASSISTIAMO FINO AL DECRETO DI TRASFERIMENTO E ALLA CONSEGNA DELLE CHIAVI. AVVOCATO, ARCHITETTO, COMMERCIALISTA E NOTAIO IN SEDE. CON RIVOLTA IMMOBILIARE DAL 1956 SOLO ACQUISTI SICURI AL 100%. PRIMA CONSULENZA GRATUITA, MUTUO ASTA 100%. POSSIBILITÀ\' DI VISITARE L\'IMMOBILE.', '€ 168.300', NULL, '4 locali', '105 m2', '1 bagni', '1 piano', 'Rivolta Immobiliare dal 1956', '06 8115 0370', 'EK-79030453', '13/02/2020', 'primo piano', 0, 'REJECTED'),
	(367, '79036241', 'Trilocale via di Vigna Fabbri, Roma', 'https://www.immobiliare.it/annunci/79036241/', 'Nelle adiacenze di Via Botero e a breve distanza dal parco della Caffarella proponiamo un immobile ristrutturato composto da ingresso, soggiorno, camera matrimoniale, cameretta, servizi e balcone. L\'appartamento presenta porta blindata, infissi con doppi vetri e grate di sicurezza, cucina arredata e cabina armadio nella camera matrimoniale, tenda da sole sul balcone. Prezzo richiesto € 319.000,00. Per maggiori informazioni e appuntamenti tel. 06.36382177- vignaclara@casaincontro.it . Visitate il nostro sito internet CASAINCONTRO.IT per seguire i nostri ANNUNCI in "VETRINA", le MIGLIORI novità sempre in evidenza. Specializzati in permute. Ciascun immobile da noi proposto può essere acquistato coordinando la vendita del vostro . Disponibilità sopralluogo per valutazione gratuita e consulenza. Su tutte le nostre offerte è possibile acquisire mutui con consulenze personalizzate per verificare la fattibilità e la migliore offerta bancaria.', '€ 319.000', NULL, '3 locali', '80 m2', '1 bagni', '2 piano', 'CASAINCONTRO SRL', '06 3638 2177,06 3975 4433', 'VCL29', '13/02/2020', 'primo piano', 0, 'REJECTED'),
	(368, '79034427', 'Quadrilocale via Appia Nuova 357, Roma', 'https://www.immobiliare.it/annunci/79034427/', 'Rif: vp 0820 - VIA APPIA NUOVA – AD. PIAZZA DELL’ALBERONE – PIAZZA RE DI ROMA nelle estreme vicinanze delle fermate Metro Furio Camillo e Ponte Lungo, si propone la vendita di un appartamento posto al quarto piano all’interno di un comprensorio con ampio giardino condominiale. Internamente l’appartamento si presenta da ristrutturare e si compone di un ampio ingresso con corridoio, una zona giorno, una cucina separata, due camere di cui una matrimoniale, una singola e una terza cameretta ed un bagno. La palazzina gode di un ascensore privato. Ottima l’ubicazione essendo servita da tutti i punti commerciali e di trasporto. Gli affacci sono tutti interni sul giardino condominiale. Questo garantisce all’immobile un contesto silenzioso tutto il giorno. Il piano alto e le buone esposizioni garantiscono all’immobile un’ottima luminosità. Il riscaldamento è termoautonomo e come pertinenza vi è una cantina. Per ulteriori informazioni contattate i seguenti numeri 06.39727817 - 366.6626001 o inviate una mail a ****** visitate il nostro sito ****** Desiderate comprare un immobile ma dovete ancora vendere il vostro? Contattateci per un’Analisi Comparativa di Mercato gratuita, sarò lieto di presentarvi una strategia di marketing mirata a soddisfare le vostre esigenze. Il centro di mediazione immobiliare RE/MAX Just offre ai propri clienti un servizio rapido ed efficiente, mirato a soddisfare al meglio esigenze ed aspettative di chi si affida alla nostra struttura; consulenze finanziarie gratuite con la scelta del mutuo più adatto alle vostre esigenze. Le presenti indicazioni fornite nell’annuncio non costituiscono elemento contrattuale.', '€ 350.000', NULL, '4 locali', '111 m2', '1 bagni', '4 piano', 'Remax Just', '06 9785 7699,366 6626 001', 'vp 0820 (2643617)', '13/02/2020', 'no balconi', 0, 'REJECTED'),
	(369, '76753534', 'Trilocale via Albalonga, Roma', 'https://www.immobiliare.it/annunci/76753534/', '(Piazza dei Re di Roma) In stabile d\'epoca con ascensore LUMINOSO PIANO ALTO ingresso,soggiorno, 2 camere, cucina, servizio e BALCONE. Ottima soluzione per studio professionale € 369.000 Rif. LZ/191 Tel.0669339108 www.leximmobiliare.it Adiacente Piazza dei Re di Roma e più precisamente in Via Albalonga, in stabile d\'epoca di cinque piani con ascensore, proponiamo un appartamento sito al quarto piano catastale. Internamente si compone di un ampio ingresso, salone, 2 camere, cucina e servizio. Completa la proprietà un comodo balcone. L\'appartamento risulta essere luminoso e silenzioso grazie alla doppia esposizione con affacci esterni su Via Albalonga ( salone) ed affacci aperti su una graziosa corte interna ( 2 camere, cucina, servizio e balcone) L\'immobile è in discrete condizioni interne ed in fase di ristrutturazione è possibile ridistribuire gli spazi. Ottima soluzione sia abitativa sia per studi professionali. "Le presenti informazioni e planimetrie sono meramente indicative e non costituiscono elementi contrattuali." (Piazza dei Re di Roma) In a period building with a LUMINOUS lift HIGH FLOOR entrance, living room, 2 bedrooms, kitchen, bathroom and BALCONY. Excellent solution for professional study € 369.000 Ref LZ / 191 Tel.0669339108 www.leximmobiliare.it Adjacent to Piazza dei Re di Roma and more precisely in Via Albalonga, in an old five-storey building with a lift, we offer an apartment on the fourth floor of the building. Internally it consists of a large entrance hall, lounge, 2 bedrooms, kitchen and service. The property includes a comfortable balcony. The apartment turns out to be bright and quiet thanks to the double exposure with external views on Via Albalonga (living room) and open views on a pretty inner courtyard (2 bedrooms, kitchen, bathroom and balcony). The property is in fair internal conditions and in phase of restructuring it is possible to redistribute the spaces. Excellent solution for both residential and professional studies. "This information and plans are merely indicative and do not constitute contractual elements."', '€ 369.000', NULL, '3 locali', '105 m2', '1 bagni', '4 piano', 'LEX Immobiliare', '06 6933 9108', 'LZ/191', '13/02/2020', 'fuori zona prescelta', 0, 'REJECTED'),
	(370, '79030931', 'Trilocale ottimo stato, secondo piano, Roma', 'https://www.immobiliare.it/annunci/79030931/', 'Via Rimini: a due passi dalla centralissima Via Appia Nuova e dalla fermata delle Metro A e C \'\' San Giovanni\'\' trilocale completamente ristrutturato posto ad un piano medio all\'interno di uno piccolo stabile d\'epoca degli anni 20 di soli 4 piani e dotato di ascensore. L\'appartamento è composto da ingresso, soggiorno con angolo cottura (che attualmente è stato suddiviso in due stanze con un muro in cartongesso facilmente rimovibile) due camere da letto , ripostiglio, un vano a scomparsa per la lavatrice ed un bagno. Inoltre l\'appartamento è dotato di una comoda soffitta di pertinenza. L\'immobile presenta finiture quali, parquet nella zona notte, porte in legno massello e nelle stanze sono ancora presenti gli stucchi originali. Inoltre l\'appartamento è dotato infissi termoisolanti con doppio vetro, condizionatori, tre soppalchi, porta blindata, cassaforte, antifurto e riscaldamento autonomo. L\'immobile ha un esposizione assolata , gli ambienti sono confortevoli e ben distribuiti ed inoltre, visto l\'ottimo stato interno, l\'appartamento può essere abitato da subito evitando nell\'immediato ulteriori spese di lavori di ristrutturazione (il ripristino del soggiorno con angolo cottura sarebbe a carico dell\'attuale proprietario).', '€ 370.000', NULL, '3 locali', '82 m2', '1 bagni', '2 piano', 'Affiliato Tecnocasa: STUDIO RE DI ROMA S.R.L.', '06 7759 1919', 'EK-79030931', '13/02/2020', 'fuori zona prescelta', 0, 'DELETED'),
	(371, '79095329', 'Trilocale via di Vigna Fabbri, Roma', 'https://www.immobiliare.it/annunci/79095329/', 'A pochi passi da Villa Lazzaroni e da Via Fortifiocca e dalla metro A Furio Camillo, vendesi Appartamento di 75 mq sito al piano primo in stabile di sette piani con ascensore, composto da : salone, cucina a vista ( nuova compresa nel prezzo di Vendita) , camera matrimoniale con cabina armadio fatta su misura compresa nel prezzo di vendita, cameretta, bagno con doccia, ripostiglio, soppalco e balcone. Ottime condizioni interne Prezzo di vendita Euro 320.000,00 trattabili + Euro 50,00 di spese Condominiali mensili', '€ 320.000', NULL, '3 locali', '75 m2', '1 bagni', '1 piano', 'Domus Intermedia', '06 5560 879,327 7062 122', 'FMC COCCO', '14/02/2020', 'primo piano', 0, 'REJECTED'),
	(372, '79101641', 'Trilocale via Camilla 3, Roma', 'https://www.immobiliare.it/annunci/79101641/', 'Nel cuore del quartiere Appio, più precisamente in Via Camilla, Area-Re cura la vendita di un appartamento molto luminoso posto al primo piano. L\'appartamento è composto da un ampio ingresso, soggiorno, cucina, due camere ed un servizio. La zona dove è situato l\'immobile è servita da tutti i mezzi pubblici di trasporto, la metro Furio Camillo è raggiungibile in pochi minuti a piedi, e da ogni tipo di attività commerciale. Sempre nelle immediate vicinanze si può godere della tranquillità di spazi verdi come Villa Lazzaroni ed il Parco della Caffarella. AR003579 380.000 € TEL. 06 6780498', '€ 380.000', NULL, '3 locali', '80 m2', '1 bagni', '1 piano', 'AREA-RE centro storico', '06 6780 498', 'AR003579', '14/02/2020', 'primo piano', 0, 'REJECTED'),
	(373, '79066583', 'Trilocale ottimo stato, secondo piano, Roma', 'https://www.immobiliare.it/annunci/79066583/', 'Via Rimini: a due passi dalla centralissima Via Appia Nuova e dalla fermata delle Metro A e C \'\' San Giovanni\'\' trilocale completamente ristrutturato posto ad un piano medio all\'interno di uno piccolo stabile d\'epoca degli anni 20 di soli 4 piani e dotato di ascensore. L\'appartamento è composto da ingresso, soggiorno con angolo cottura (che attualmente è stato suddiviso in due stanze con un muro in cartongesso facilmente rimovibile) due camere da letto , ripostiglio, un vano a scomparsa per la lavatrice ed un bagno. Inoltre l\'appartamento è dotato di una comoda soffitta di pertinenza. L\'immobile presenta finiture quali, parquet nella zona notte, porte in legno massello e nelle stanze sono ancora presenti gli stucchi originali. Inoltre l\'appartamento è dotato infissi termoisolanti con doppio vetro, condizionatori, tre soppalchi, porta blindata, cassaforte, antifurto e riscaldamento autonomo. L\'immobile ha un esposizione assolata , gli ambienti sono confortevoli e ben distribuiti ed inoltre, visto l\'ottimo stato interno, l\'appartamento può essere abitato da subito evitando nell\'immediato ulteriori spese di lavori di ristrutturazione (il ripristino del soggiorno con angolo cottura sarebbe a carico dell\'attuale proprietario).', '€ 370.000', NULL, '3 locali', '82 m2', '1 bagni', '2 piano', 'Affiliato Tecnocasa: STUDIO RE DI ROMA S.R.L.', '06 7759 1919', 'EK-79066583', '14/02/2020', 'fuori zona prescelta', 0, 'REJECTED'),
	(374, '79054097', 'Trilocale via Tabarrini, Roma', 'https://www.immobiliare.it/annunci/79054097/', 'RIF. 170760 - App.to di 90 mq in deliziosa palazzina anni \'20 di tre piani. L\'app.to include ingresso, corridoio, ampio soggiorno con cucina a vista, camera matrimoniale, cameretta, bagno. La tripla esposizione garantisce luminosità all\'immobile nell\'arco dell\'intera giornata. Finemente ristrutturato con arredo di design su misura, in grado di sfruttare al meglio gli spazi a disposizione. La palazzina è dotata di ascensore di recentissima installazione (anno 2013). No balconi. No pertinenze. Terrazzo condominiale a disposizione di tutti i condomini.', '€ 380.000', NULL, '3 locali', '90 m2', '1 bagni', '2 piano', 'Homepal', '02 9475 3358', '170760', '13/02/2020', 'no balconi', 0, 'REJECTED'),
	(375, '79036355', 'Trilocale buono stato, sesto piano, Roma', 'https://www.immobiliare.it/annunci/79036355/', 'ALBERONE APPIA FURIO CAMILLO - VIA VIRGINIA - Appartamento di ampia metratura posto al sesto piano di un PALAZZO IN CORTINA; composto di : ingresso, soggiorno, corridoio, 2 camere, cucina abitabile ,bagno (interamente ristrutturato di recente), ripostiglio ed un ampio balcone. L\'immobile, categoria catastale A3 (abitazione), gode di una doppia esposizione che contribuisce a renderlo MOLTO LUMINOSO. Altezza dei soffitti m. 3.00. L\'impianto elettrico è stato rifatto recentemente. Il condominio è dotato di VIDEOCITOFONO e di VIDEOCAMERE DI SORVEGLIANZA. Ubicato in zona centrale, ma in via molto tranquilla, con tutti i servizi nelle immediate vicinanze, tra cui: la Metro, linea A, fermata Furio Camillo, la Stazione Tuscolana, il Centro Commerciale Happio.', '€ 379.000', NULL, '3 locali', '102 m2', '1 bagni', '6 piano', 'Affiliato Tecnocasa: STUDIO APPIO ALBERONE S.R.L.', '06 7821 531', '40283203', '13/02/2020', '', 0, 'SELECTED');
